(3777, 'udb_settings', 'a:7:{s:10:\"icon_color\";s:7:\"#555555\";s:14:\"headline_color\";s:7:\"#23282d\";s:21:\"welcome_panel_content\";s:2169:\"<div class=\"welcome-panel-content\">\r\n<h2>Bienvenue sur WordPress !</h2>\r\n<p class=\"about-description\">Voici quelques liens pour vous aider à démarrer :</p>\r\n\r\n<div class=\"welcome-panel-column-container\">\r\n<div class=\"welcome-panel-column\">\r\n<h3>Lancez-vous !</h3>\r\n<a class=\"button button-primary button-hero load-customize hide-if-no-customize\" href=\"http://www.vie-investment.ci/wp-admin/customize.php\">Personnalisez votre site</a>\r\n<a class=\"button button-primary button-hero hide-if-customize\" href=\"http://www.vie-investment.ci/wp-admin/themes.php\">Personnalisez votre site</a>\r\n<p class=\"hide-if-no-customize\">ou alors, <a href=\"http://www.vie-investment.ci/wp-admin/customize.php?autofocus[panel]=themes\">changez complètement de thème</a></p>\r\n\r\n</div>\r\n<div class=\"welcome-panel-column\">\r\n<h3>Étapes suivantes</h3>\r\n<ul>\r\n 	<li><a class=\"welcome-icon welcome-edit-page\" href=\"http://www.vie-investment.ci/wp-admin/post.php?post=7&amp;action=edit&amp;classic-editor\">Modifiez votre page d’accueil</a></li>\r\n 	<li><a class=\"welcome-icon welcome-add-page\" href=\"http://www.vie-investment.ci/wp-admin/post-new.php?post_type=page\">Ajoutez de nouvelles pages</a></li>\r\n 	<li><a class=\"welcome-icon welcome-write-blog\" href=\"http://www.vie-investment.ci/wp-admin/post-new.php\">Écrivez un article</a></li>\r\n 	<li><a class=\"welcome-icon welcome-view-site\" href=\"http://www.vie-investment.ci/\">Affichez votre site</a></li>\r\n</ul>\r\n</div>\r\n<div class=\"welcome-panel-column welcome-panel-last\">\r\n<h3>Plus d’actions</h3>\r\n<ul>\r\n 	<li><a class=\"welcome-icon welcome-widgets\" href=\"http://www.vie-investment.ci/wp-admin/widgets.php\">Gérez les widgets</a></li>\r\n 	<li><a class=\"welcome-icon welcome-menus\" href=\"http://www.vie-investment.ci/wp-admin/nav-menus.php\">Gérez les menus</a></li>\r\n 	<li><a class=\"welcome-icon welcome-comments\" href=\"http://www.vie-investment.ci/wp-admin/options-discussion.php\">Activez ou désactivez les commentaires</a></li>\r\n 	<li><a class=\"welcome-icon welcome-learn-more\" href=\"https://fr.wordpress.org/support/article/first-steps-with-wordpress/\">Plus d’informations pour bien démarrer</a></li>\r\n</ul>\r\n</div>\r\n</div>\r\n</div>\";s:18:\"dashboard_headline\";s:12:\"Ange GNAHOUE\";s:10:\"howdy_text\";s:0:\"\";s:10:\"custom_css\";s:0:\"\";s:16:\"custom_admin_css\";s:0:\"\";}', 'yes'),
