(8688, '_transient_feed_0d2db5fea5a8633b56992c916819b198', 'a:4:{s:5:\"child\";a:1:{s:0:\"\";a:1:{s:3:\"rss\";a:1:{i:0;a:6:{s:4:\"data\";s:3:\"\n\n\n\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:7:\"version\";s:3:\"2.0\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:1:{s:0:\"\";a:1:{s:7:\"channel\";a:1:{i:0;a:6:{s:4:\"data\";s:49:\"\n	\n	\n	\n	\n	\n	\n	\n	\n	\n	\n		\n		\n		\n		\n		\n		\n		\n		\n		\n	\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:3:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:30:\"Blog | WordPress.org Français\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:24:\"https://fr.wordpress.org\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:0:\"\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:13:\"lastBuildDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 26 Jan 2022 17:40:47 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"language\";a:1:{i:0;a:5:{s:4:\"data\";s:5:\"fr-FR\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:9:\"generator\";a:1:{i:0;a:5:{s:4:\"data\";s:40:\"https://wordpress.org/?v=6.0-alpha-52726\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"item\";a:10:{i:0;a:6:{s:4:\"data\";s:73:\"\n		\n		\n					\n		\n		\n		\n				\n		\n\n					\n										\n					\n					\n			\n		\n		\n			\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:5:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:32:\"WordPress 5.9 « Joséphine »\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:50:\"https://fr.wordpress.org/2022/01/25/wordpress-5-9/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:58:\"https://fr.wordpress.org/2022/01/25/wordpress-5-9/#respond\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 25 Jan 2022 21:05:58 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Nouvelles versions de WordPress\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:32:\"https://fr.wordpress.org/?p=2330\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:450:\"Bienvenue sur WordPress 5.9 «&#160;Joséphine&#160;»&#160;! Nous vous présentons WordPress 5.9, nommée «&#160;Joséphine&#160;» en l’honneur de la chanteuse internationale de jazz Joséphine Baker. Vous pouvez&#160;télécharger cette version ici&#160;ou effectuer la mise à jour directement depuis votre tableau de bord. En tant que militante des droits civiques depuis toujours, Joséphine Baker pensait que tout le monde pouvait [&#8230;]\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:9:\"Jb Audras\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:61734:\"\n<figure class=\"wp-block-image size-large\"><img width=\"1024\" height=\"682\" src=\"https://fr.wordpress.org/files/2022/01/5-9-josephine-1024x682.png\" alt=\"\" class=\"wp-image-2341\" srcset=\"https://fr.wordpress.org/files/2022/01/5-9-josephine-1024x682.png 1024w, https://fr.wordpress.org/files/2022/01/5-9-josephine-300x200.png 300w, https://fr.wordpress.org/files/2022/01/5-9-josephine-768x512.png 768w, https://fr.wordpress.org/files/2022/01/5-9-josephine.png 1264w\" sizes=\"(max-width: 1024px) 100vw, 1024px\" /></figure>\n\n\n\n<h2 id=\"bienvenue-sur-wordpress-5-9-josephine\">Bienvenue sur WordPress 5.9 «&nbsp;Joséphine&nbsp;»&nbsp;!</h2>\n\n\n\n<p>Nous vous présentons WordPress 5.9, nommée «&nbsp;Joséphine&nbsp;» en l’honneur de la chanteuse internationale de jazz Joséphine Baker. Vous pouvez&nbsp;<a href=\"https://wordpress.org/download/\">télécharger cette version ici</a>&nbsp;ou effectuer la mise à jour directement depuis votre tableau de bord.</p>\n\n\n\n<p>En tant que militante des droits civiques depuis toujours, Joséphine Baker pensait que tout le monde pouvait vivre en harmonie ensemble, tout comme les différents instruments d&rsquo;un groupe de jazz se mélangent pour former un morceau complet. Mentionnons également que Joséphine Baker était naturalisée française et est d&rsquo;ailleurs entrée au Panthéon l’année dernière, en 2021.</p>\n\n\n\n<p>Activez donc une liste de lecture de votre service de musique préféré et profitez de ses célèbres interprétations de <em>« You are the greatest love »</em>, <em>« Sans Amour »</em> et <em>« Love is a dreamer »</em> tout en découvrant les fonctionnalités de cette toute nouvelle version de WordPress.</p>\n\n\n\n<span id=\"more-2330\"></span>\n\n\n\n<hr class=\"wp-block-separator\" />\n\n\n\n<h2 id=\"l-edition-complete-de-votre-site-est-la\">L’édition complète de votre site est là.</h2>\n\n\n\n<p>Cela vous donne le contrôle sur l’ensemble de votre site, directement depuis votre administration WordPress.</p>\n\n\n\n<div style=\"height:10px\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n\n\n\n<figure class=\"wp-block-image size-full\"><img src=\"https://wordpress.org/news/files/2022/01/5-9-release-1.png\" alt=\"\" class=\"wp-image-12101\" /></figure>\n\n\n\n<h3 id=\"decouvrez-twenty-twenty-two\">Découvrez Twenty Twenty-Two</h3>\n\n\n\n<p>Et saluez l’arrivée du premier thème natif basé sur des blocs dans l’histoire de WordPress. Cela représente bien plus qu’un thème natif&nbsp;: c’est une toute nouvelle façon de travailler avec les thèmes WordPress.</p>\n\n\n\n<p>Les <a href=\"https://fr.wordpress.org/support/article/block-themes/\">thèmes basés sur des blocs</a> placent un large choix de conception dans vos mains, des jeux de couleurs aux combinaisons typographiques, en passant par les modèles de pages et les filtres d’images. Tout cela est compris sur <a href=\"https://fr.wordpress.org/support/article/site-editor/\">la nouvelle interface d’édition de site</a>. En un seul et même endroit, vous trouverez tout ce qu’il faut pour donner votre touche graphique à <em>Twenty Twenty‑Two</em>, et vous pourrez donner un nouveau départ à votre site.</p>\n\n\n\n<p>Le thème Twenty Twenty‑Two est déjà sans doute disponible sur votre site si vous l’avez mis à jour vers WP 5.9. Il a été installé en même temps que WordPress 5.9. Vous le trouverez avec&nbsp;les autres thèmes que vous avez installés.</p>\n\n\n\n<div style=\"height:10px\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n\n\n\n<figure class=\"wp-block-image size-full\"><img src=\"https://wordpress.org/news/files/2022/01/5-9-release-2.png\" alt=\"\" class=\"wp-image-12102\" /></figure>\n\n\n\n<h3 id=\"votre-palette-de-peinture-vous-attend\">Votre palette de peinture vous attend</h3>\n\n\n\n<p>D’autres thèmes basés sur des blocs et implémentant des fonctionnalités d’édition de site sont disponibles dans le répertoire officiel des thèmes, aux côtés de Twenty Twenty‑Two. Ils attendent simplement d’être essayés. Et bien d’autres viendront avec le temps&nbsp;!</p>\n\n\n\n<p>Lorsque vous utiliserez l’un de ces nouveaux thèmes, vous n’aurez plus besoin de l’outil de personnalisation. À la place, vous découvrirez la puissance de l’interface de gestion des styles globaux comprise dans l’éditeur de site. Tout comme avec Twenty Twenty‑Two, vous pourrez y bâtir l’apparence de votre site avec des outils prêts à l’emploi et une interface fluide et dynamique.</p>\n\n\n\n<div style=\"height:10px\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n\n\n\n<figure class=\"wp-block-image size-full\"><img src=\"https://wordpress.org/news/files/2022/01/5-9-release-3.png\" alt=\"\" class=\"wp-image-12103\" /></figure>\n\n\n\n<h3 id=\"le-bloc-navigation\">Le bloc navigation</h3>\n\n\n\n<p>Les blocs font leur entrée dans les menus de navigation, le cœur de l’expérience de visite de votre site.</p>\n\n\n\n<p>Le nouveau bloc Navigation vous donne la possibilité de choisir&nbsp;: un menu fluide ou plutôt un menu adapté à la taille d’écran de l’internaute. Qu’importe le menu que vous créez, vous pourrez le réutiliser partout où vous le souhaitez, que ce soit dans un nouveau modèle de page ou même après avoir changé de thème.</p>\n\n\n\n<div style=\"height:10px\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n\n\n\n<h2 id=\"encore-plus-d-ameliorations-et-de-mises-a-jour\">Encore plus d’améliorations et de mises à jour</h2>\n\n\n\n<p>Vous aimez bloguer ou produire de contenu&nbsp;? De nouveaux ajustements aideront votre expérience éditoriale et la rendront plus efficace.</p>\n\n\n\n<div style=\"height:10px\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n\n\n\n<figure class=\"wp-block-image size-full\"><img src=\"https://wordpress.org/news/files/2022/01/5-9-release-4.png\" alt=\"\" class=\"wp-image-12104\" /></figure>\n\n\n\n<h3 id=\"de-meilleurs-outils-de-controle-pour-les-blocs\">De meilleurs outils de contrôle pour les blocs</h3>\n\n\n\n<p>WordPress 5.9 contient de nouveaux outils typographiques et vous permet de contrôler votre mise en page, comme par exemple sur des détails tels que les espacements, les bordures, et bien plus encore. Cela vous aidera à apporter autant de soin à l’apparence générale de votre site qu’aux détails des contenus de vos pages.</p>\n\n\n\n<div style=\"height:10px\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n\n\n\n<figure class=\"wp-block-image size-full\"><img src=\"https://wordpress.org/news/files/2022/01/5-9-release-5.png\" alt=\"\" class=\"wp-image-12105\" /></figure>\n\n\n\n<h3 id=\"le-pouvoir-des-compositions\">Le pouvoir des compositions</h3>\n\n\n\n<p>Le répertoire de compositions de WordPress contient un grand nombre de compositions de blocs construites pour vous faire gagner du temps. Vous pouvez les utiliser et les modifier autant que vous le souhaitez. Vous voulez un en-tête ou un pied de page différent pour votre site&nbsp;? Vous pourrez en installer de nouveaux en quelques clics.</p>\n\n\n\n<p>Avec sa vue en grande largeur qui vous montre tous les détails de chaque élément, l’outil d’exploration de compositions vous permet de comparer les compositions entre elles et de choisir la plus adaptée pour votre site.</p>\n\n\n\n<div style=\"height:10px\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n\n\n\n<figure class=\"wp-block-image size-full\"><img src=\"https://wordpress.org/news/files/2022/01/5-9-release-6.png\" alt=\"\" class=\"wp-image-12106\" /></figure>\n\n\n\n<h3 id=\"une-refonte-de-la-vue-en-liste\">Une refonte de la vue en liste</h3>\n\n\n\n<p>Dans WP 5.9, la vue en liste vous permet de glisser-déposer votre contenu exactement où vous le souhaitez. Gérer des documents complexes est encore plus simple&nbsp;: des boutons vous permettent de déplier-replier les sections pendant que vous bâtissez votre site, et d’ajouter des ancres à vos blocs pour aider les internautes à naviguer dans la page.</p>\n\n\n\n<div style=\"height:10px\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n\n\n\n<figure class=\"wp-block-image size-full\"><img src=\"https://wordpress.org/news/files/2022/01/5-9-release-7.png\" alt=\"\" class=\"wp-image-12107\" /></figure>\n\n\n\n<h3 id=\"un-meilleur-bloc-galerie\">Un meilleur bloc galerie</h3>\n\n\n\n<p>Manipulez chaque image de vos blocs galeries de la même façon que vous manipuleriez un bloc image indépendant.</p>\n\n\n\n<p>Mettez en forme chaque image de votre galerie de façon indépendante des autres (par exemple avec un recadrage différent ou un filtre duotone), ou faites-les toutes se ressembler. Vous pourrez ensuite modifier la mise en page de la galerie avec un simple glisser-déposer.</p>\n\n\n\n<div style=\"height:10px\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n\n\n\n<hr class=\"wp-block-separator\" />\n\n\n\n<h2 id=\"wordpress-5-9-pour-les-developpeurs-et-les-developpeuses\">WordPress 5.9 pour les développeurs et les développeuses</h2>\n\n\n\n<h3 id=\"le-fichier-theme-json-pour-les-themes-enfants\">Le fichier theme.json pour les thèmes enfants</h3>\n\n\n\n<p>Avec WP 5.9, le fichier <code>theme.json</code> prendra maintenant en charge les thèmes enfants. Cela signifie que vous pourrez construire un thème enfant directement depuis l’interface d’administration de WordPress, sans écrire la moindre ligne de code.&nbsp;</p>\n\n\n\n<p><a href=\"https://make.wordpress.org/core/2022/01/04/block-themes-a-new-way-to-build-themes-in-wordpress-5-9/\">Voir la note de développement sur la fonctionnalité theme.json pour les thèmes enfants (en anglais)</a></p>\n\n\n\n<h3 id=\"verrouillage-des-blocs\">Verrouillage des blocs</h3>\n\n\n\n<p>Vous pouvez maintenant verrouiller tout ou partie des blocs au sein d’une composition, juste en ajoutant un attribut de verrouillage dans ses réglages au sein du fichier block.json. Laissez les rédacteur·ice·s libres de modifier le reste de la composition pour adapter son contenu.</p>\n\n\n\n<p><a href=\"https://make.wordpress.org/core/2022/01/04/block-themes-a-new-way-to-build-themes-in-wordpress-5-9/\">Voir la note de développement sur la fonctionnalité de verrouillage des blocs (en anglais)</a></p>\n\n\n\n<h3 id=\"plusieurs-feuilles-de-styles-pour-chaque-bloc\">Plusieurs feuilles de styles pour chaque bloc</h3>\n\n\n\n<p>Vous pouvez maintenant déclarer plus qu’une seule feuille de style par bloc. Cela vous permet de partager des styles entre différents blocs que vous avez créés, ou pour charger des styles pour des blocs individuels, ce qui fait que vos styles ne sont chargés que lorsque le bloc est utilisé. Pour en savoir plus, apprenez à&nbsp;<a href=\"https://make.wordpress.org/core/2021/12/15/using-multiple-stylesheets-per-block/\">charger plusieurs feuilles de styles sur un bloc (en anglais)</a>.</p>\n\n\n\n<h3 id=\"un-bloc-galerie-remodele-de-a-a-z\">Un bloc galerie remodelé de A à Z</h3>\n\n\n\n<p>Les modifications du bloc galerie listées ci-dessus sont le résultat d’un remodelage complet. Si vous avez construit un thème ou une extension qui l’utilise, assurez-vous de lire la&nbsp;<a href=\"https://make.wordpress.org/core/2021/08/20/gallery-block-refactor-dev-note/\">note technique de compatibilité du bloc galerie (en anglais)</a>.</p>\n\n\n\n<div style=\"height:10px\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n\n\n\n<hr class=\"wp-block-separator\" />\n\n\n\n<h3 id=\"en-savoir-plus-sur-les-fonctionnalites-de-wp-5-9\">En savoir plus sur les fonctionnalités de WP&nbsp;5.9</h3>\n\n\n\n<p>Vous voulez plonger dans 5.9 mais ne savez pas par où commencer&nbsp;? Rendez-vous sur&nbsp;<a href=\"https://learn.wordpress.org/\">learn.wordpress.org</a>&nbsp;pour consulter des ressources sur les nouvelles fonctionnalités de WordPress 5.9.</p>\n\n\n\n<p>Si vous cherchez des ressources en français, nous vous conseillons aussi de <a href=\"https://fr.wordpress.org/2022/01/17/wordpress-5-9-documentation-en-francais-des-fonctionnalites-de-lediteur-de-site/\" data-type=\"post\" data-id=\"2304\">consulter la documentation produite par l&rsquo;équipe de traduction de WordPress en français tout spécialement pour WordPress&nbsp;5.9</a>.</p>\n\n\n\n<div style=\"height:10px\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n\n\n\n<hr class=\"wp-block-separator\" />\n\n\n\n<h3 id=\"consultez-le-guide-de-la-version-pour-en-savoir-plus\">Consultez le guide de la version pour en savoir plus&nbsp;!</h3>\n\n\n\n<p>Consultez le guide des changements techniques de WordPress&nbsp;5.9. Il met en avant les notes de développement pour chaque modification que vous souhaiteriez approfondir&nbsp;:&nbsp;<a href=\"https://fr.wordpress.org/2022/01/12/guide-des-changements-techniques-a-venir-sur-wordpress-5-9/\" data-type=\"post\" data-id=\"2264\">guide des changements techniques de WordPress 5.9 en français</a></p>\n\n\n\n<div style=\"height:10px\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n\n\n\n<h2 id=\"l-equipe-de-direction-de-wordpress-5-9\"><strong>L’équipe de direction de WordPress&nbsp;5.9</strong></h2>\n\n\n\n<p>La version 5.9 de WordPress 5.9 a été dirigée par <a href=\"https://profiles.wordpress.org/matt/\">Matt Mullenweg</a>, avec l’assistance de l’équipe de direction suivante&nbsp;:</p>\n\n\n\n<ul><li>Directeur de la version&nbsp;: <a href=\"https://profiles.wordpress.org/matt/\">Matt Mullenweg</a></li><li>Directrice technique et coordinatrice de la version&nbsp;: <a href=\"https://profiles.wordpress.org/hellofromtonya/\">Tonya Mork</a></li><li>Responsables projet&nbsp;: <a href=\"https://profiles.wordpress.org/audrasjb/\">Jb Audras</a> et <a href=\"https://profiles.wordpress.org/chaion07/\">Ahmed Chaion</a></li><li>Responsables techniques côté éditeur/Gutenberg&nbsp;: <a href=\"https://profiles.wordpress.org/noisysocks/\">Robert Anderson</a> et <a href=\"https://profiles.wordpress.org/mamaduka/\">George Mamadashvili</a></li><li>Responsables du nouveau thème&nbsp;: <a href=\"https://profiles.wordpress.org/kjellr/\">Kjell Reigstad</a> et <a href=\"https://profiles.wordpress.org/jffng/\">Jeff Ong</a></li><li>Rédacteur technique&nbsp;: <a href=\"https://profiles.wordpress.org/psykro/\">Jonathan Bossenger</a></li><li>Responsables de la documentation&nbsp;: <a href=\"https://profiles.wordpress.org/mkaz/\">Marcus Kazmierczak</a> et <a href=\"https://profiles.wordpress.org/milana_cap/\">Milana Cap</a></li><li>Responsables marketing &amp; communications&nbsp;: <a href=\"https://profiles.wordpress.org/marybaum/\">Mary Baum</a> et <a href=\"https://profiles.wordpress.org/webcommsat/\">Abha Thakor</a></li><li>Responsables des tests&nbsp;: <a href=\"https://profiles.wordpress.org/boniu91/\">Piotrek Boniu</a> et <a href=\"https://profiles.wordpress.org/annezazu/\">Anne McCarthy</a></li></ul>\n\n\n\n<p>WordPress 5.9 reflète l’impressionnant travail accompli par of 624 contributrices et contributeurs bénévoles. Cela a abouti à <a href=\"https://core.trac.wordpress.org/query?status=closed&amp;milestone=5.9&amp;group=component&amp;col=id&amp;col=summary&amp;col=status&amp;col=milestone&amp;col=owner&amp;col=type&amp;col=priority&amp;order=priority\">370 tickets sur Trac</a> et plus de <a href=\"https://github.com/WordPress/gutenberg/compare/v10.8.0...v11.9.0\">1900 <em>pull requests</em> sur GitHub</a>. Merci à toutes et à tous&nbsp;:</p>\n\n\n\n<p><a href=\"https://profiles.wordpress.org/2linctools/\">2linctools</a>, <a href=\"https://profiles.wordpress.org/aaroncampbell/\">Aaron D. Campbell</a>, <a href=\"https://profiles.wordpress.org/jorbin/\">Aaron Jorbin</a>, <a href=\"https://profiles.wordpress.org/aaronrobertshaw/\">Aaron Robertshaw</a>, <a href=\"https://profiles.wordpress.org/abesell132/\">abesell132</a>, <a href=\"https://profiles.wordpress.org/webcommsat/\">Abha Thakor</a>, <a href=\"https://profiles.wordpress.org/acosmin/\">acosmin</a>, <a href=\"https://profiles.wordpress.org/wpmudev-support8/\">Adam &#8211; WPMU DEV Support</a>,