ref=\"https://profiles.wordpress.org/sierratr/\">Tracy</a>, <a href=\"https://profiles.wordpress.org/travisnorthcutt/\">Travis Northcutt</a>, <a href=\"https://profiles.wordpress.org/tubys/\">tubys</a>, <a href=\"https://profiles.wordpress.org/dinhtungdu/\">Tung Du</a>, <a href=\"https://profiles.wordpress.org/twstokes/\">twstokes</a>, <a href=\"https://profiles.wordpress.org/desaiuditd/\">Udit Desai</a>, <a href=\"https://profiles.wordpress.org/umesh84/\">umesh84</a>, <a href=\"https://profiles.wordpress.org/devutpol/\">Utpol Deb Nath</a>, <a href=\"https://profiles.wordpress.org/webulous/\">Venkat Raj</a>, <a href=\"https://profiles.wordpress.org/versusbassz/\">versusbassz</a>, <a href=\"https://profiles.wordpress.org/bartoszgrzesik/\">verybg</a>, <a href=\"https://profiles.wordpress.org/vcanales/\">Vicente Canales</a>, <a href=\"https://profiles.wordpress.org/szepeviktor/\">Viktor Szépe</a>, <a href=\"https://profiles.wordpress.org/vishitshah/\">Vishit Shah</a>, <a href=\"https://profiles.wordpress.org/vladytimy/\">Vlad T</a>, <a href=\"https://profiles.wordpress.org/vondelphia/\">Vondelphia.com</a>, <a href=\"https://profiles.wordpress.org/vortfu/\">vortfu</a>, <a href=\"https://profiles.wordpress.org/wb1234/\">wb1234</a>, <a href=\"https://profiles.wordpress.org/webmandesign/\">WebMan Design | Oliver Juhas</a>, <a href=\"https://profiles.wordpress.org/west7/\">Wes Theron</a>, <a href=\"https://profiles.wordpress.org/westonruter/\">Weston Ruter</a>, <a href=\"https://profiles.wordpress.org/wfmattr/\">WFMattR</a>, <a href=\"https://profiles.wordpress.org/skorasaurus/\">Will Skora</a>, <a href=\"https://profiles.wordpress.org/earnjam/\">William Earnhardt</a>, <a href=\"https://profiles.wordpress.org/williampatton/\">williampatton</a>, <a href=\"https://profiles.wordpress.org/wojsmol/\">wojsmol</a>, <a href=\"https://profiles.wordpress.org/woodyhayday/\">woodyhayday</a>, <a href=\"https://profiles.wordpress.org/wp_kc/\">wp_kc</a>, <a href=\"https://profiles.wordpress.org/wpnomad/\">wpnomad a11n</a>, <a href=\"https://profiles.wordpress.org/wpweaver/\">wpweaver</a>, <a href=\"https://profiles.wordpress.org/yagniksangani/\">Yagnik Sangani</a>, <a href=\"https://profiles.wordpress.org/fierevere/\">Yui</a>, <a href=\"https://profiles.wordpress.org/yvettesonneveld/\">Yvette Sonneveld</a>, <a href=\"https://profiles.wordpress.org/zebulan/\">Zebulan Stanphill</a>, and <a href=\"https://profiles.wordpress.org/zoiec/\">zoiec</a>.</p>\n\n\n\n<p>Lors de la publication de ce communiqué de presse officiel, WordPress 5.9 est déjà disponible dans 71 langues ayant traduit 90&nbsp;% ou plus de la version. Les traductrices et traducteurs de la communauté travaillent dur pour vous permettre d’utiliser WordPress dans votre langue natale.</p>\n\n\n\n<p>Merci en particulier à toutes les personnes qui ont aidé à traduire WordPress 5.9 en français&nbsp;:</p>\n\n\n\n<p><a href=\"https://profiles.wordpress.org/jdy68\">Jenny Dupuy</a>, <a href=\"https://profiles.wordpress.org/audrasjb\">Jb Audras</a>, <a href=\"https://profiles.wordpress.org/fxbenard\">FX Bénard</a>, <a href=\"https://profiles.wordpress.org/wolforg\">Didier Demory</a>, <a href=\"https://profiles.wordpress.org/arpe5\">Arpe5</a>,&nbsp;<a href=\"https://profiles.wordpress.org/btpub\">Bruno Tritsch</a>,&nbsp;<a href=\"https://profiles.wordpress.org/chouby\">Chouby</a>,&nbsp;<a href=\"https://profiles.wordpress.org/clementpolito\">Clément Polito</a>,&nbsp;<a href=\"https://profiles.wordpress.org/eddystile\">Eddy</a>,&nbsp;<a href=\"https://profiles.wordpress.org/emlebrun\">Emilie LEBRUN</a>,&nbsp;<a href=\"https://profiles.wordpress.org/guerneves\">guerneves</a>,&nbsp;<a href=\"https://profiles.wordpress.org/juliobox\">Julio Potier</a>,&nbsp;<a href=\"https://profiles.wordpress.org/webaxones\">Loïc Antignac</a>,&nbsp;<a href=\"https://profiles.wordpress.org/oellin\">Magali</a>,&nbsp;<a href=\"https://profiles.wordpress.org/nuryko\">Marianna</a>,&nbsp;<a href=\"https://profiles.wordpress.org/chaton666\">Marie Comet</a>,&nbsp;<a href=\"https://profiles.wordpress.org/marineevain\">Marine EVAIN</a>,&nbsp;<a href=\"https://profiles.wordpress.org/nicolasricher\">Nicolas Richer</a>,&nbsp;<a href=\"https://profiles.wordpress.org/larrach\">Rachel Peter</a>,&nbsp;<a href=\"https://profiles.wordpress.org/sebastienserre\">Sébastien SERRE</a>,&nbsp;<a href=\"https://profiles.wordpress.org/spaceshipone\">Timothée Brosille</a>,&nbsp;<a href=\"https://profiles.wordpress.org/valer1e\">valer1e</a>,&nbsp;<a href=\"https://profiles.wordpress.org/weartdevelopment\">WeArt Development</a>, et&nbsp;<a href=\"https://profiles.wordpress.org/wplmillet\">wplmillet</a>.</p>\n\n\n\n<p>Merci également aux personnes qui contribuent bénévolement aux <a href=\"https://wordpress.org/support/\">forums de support officiels</a>. Elles répondent aux questions que se posent les gens qui utilisent WordPress partout dans le monde. Cela entretien le succès de WordPress depuis la toute première version sortie en 2003.</p>\n\n\n\n<p><em>Si vous souhaitez contribuer à WordPress, nous vous invitons à découvrir le fonctionnement de ce CMS open source sur le site <a href=\"https://make.wordpress.org/\">Make WordPress</a> et à en savoir plus sur le fonctionnement de l’équipe cœur de WP sur son <a href=\"https://make.wordpress.org/core/\">blog de développement</a>.</em></p>\n\n\n\n<p>Bonne mise à jour&nbsp;!</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:55:\"https://fr.wordpress.org/2022/01/25/wordpress-5-9/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"0\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:1;a:6:{s:4:\"data\";s:73:\"\n		\n		\n					\n		\n		\n		\n				\n		\n\n					\n										\n					\n					\n			\n		\n		\n			\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:5:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:88:\"WordPress 5.9 : documentation en français des fonctionnalités de l’éditeur de site\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:116:\"https://fr.wordpress.org/2022/01/17/wordpress-5-9-documentation-en-francais-des-fonctionnalites-de-lediteur-de-site/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:125:\"https://fr.wordpress.org/2022/01/17/wordpress-5-9-documentation-en-francais-des-fonctionnalites-de-lediteur-de-site/#comments\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Mon, 17 Jan 2022 15:40:06 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Documentation\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:32:\"https://fr.wordpress.org/?p=2304\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:374:\"À quelques jours de la sortie de WordPress 5.9 (prévue mardi 25 janvier 2022), l’équipe de documentation de WordPress en français vient de publier de nouveaux contenus afin de documenter les nouveautés de cette version. Ces pages de documentation sont enrichies de nombreuses captures d’écran et de quelques vidéos, et sont en particulier destinées aux [&#8230;]\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:11:\"Jenny Dupuy\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:3514:\"\n<p>À quelques jours de la sortie de WordPress 5.9 (prévue mardi 25 janvier 2022), l’équipe de documentation de WordPress en français vient de publier de nouveaux contenus afin de documenter les nouveautés de cette version.</p>\n\n\n\n<span id=\"more-2304\"></span>\n\n\n\n<p>Ces pages de documentation sont enrichies de nombreuses captures d’écran et de quelques vidéos, et sont en particulier destinées aux profils de webmasters.</p>\n\n\n\n<p>Si vous avez un profil plus technique nous vous conseillons également la lecture de <a href=\"https://fr.wordpress.org/2022/01/12/guide-des-changements-techniques-a-venir-sur-wordpress-5-9/\" data-type=\"post\" data-id=\"2264\">cet article détaillant les changements techniques à venir sur WordPress 5.9</a>.</p>\n\n\n\n<h2 id=\"la-fonctionnalite-d-edition-complete-de-site-full-site-editing\">La fonctionnalité d’édition complète de site (<em>full site editing</em>)</h2>\n\n\n\n<p>Avec WordPress 5.9, de nouvelles fonctionnalités font leur apparition dans votre éditeur et vont vous permettre de modifier l’apparence et la mise en page de l’ensemble de votre site (vous retrouverez souvent ce concept sous son appellation anglophone <em>full site editing</em>), de l’en-tête au pied de page, en passant par la création de vos propres modèles de pages personnalisés.</p>\n\n\n\n<p>Avec ces nouvelles pages de documentation, vous pourrez avoir une connaissance plus précise de ce que propose l’<a href=\"https://fr.wordpress.org/support/article/site-editor/\">éditeur de site</a>, de ce que sont les <a href=\"https://fr.wordpress.org/support/article/theme-base-sur-des-blocs/\">thèmes basés sur des blocs</a>, mais aussi avoir une <a href=\"https://fr.wordpress.org/support/article/styles-overview/\">vue d’ensemble des styles globaux</a>, de comprendre comment utiliser <a href=\"https://fr.wordpress.org/support/article/template-editor/\">l’éditeur de modèles</a>, et de prendre en main les nouveaux blocs avancés&nbsp;: le <a href=\"https://fr.wordpress.org/support/article/navigation-block/\">bloc Navigation</a>, le <a href=\"https://fr.wordpress.org/support/article/template-part-block/\">bloc Élément de modèle</a>, ou encore le <a href=\"https://fr.wordpress.org/support/article/query-loop-block/\">bloc Boucle de requête</a>.</p>\n\n\n\n<p>Vous retrouverez toutes ces pages dans la nouvelle catégorie <a href=\"https://fr.wordpress.org/support/category/editeur-de-site/\">Éditeur de site</a> au sein de la documentation officielle de WordPress en français.</p>\n\n\n\n<p>Merci à toutes les personnes qui ont contribué à l’écriture ou à la relecture de ces nouvelles pages de documentation&nbsp;: <a href=\"https://profiles.wordpress.org/jdy68\">Jenny Dupuy</a>, <a href=\"https://profiles.wordpress.org/audrasjb\">Jb Audras</a>, <a href=\"https://profiles.wordpress.org/pasglop\">Patrick Olivaud</a>, <a href=\"https://profiles.wordpress.org/chaton666\">Marie Comet</a>, <a href=\"https://profiles.wordpress.org/wolforg\">Didier Demory</a>, <a href=\"https://profiles.wordpress.org/webaxones\">Loïc Antignac</a> et <a href=\"https://profiles.wordpress.org/valer1e/\">Valérie Galassi</a>.</p>\n\n\n\n<p>Si vous avez des suggestions d’améliorations et de corrections, vous pouvez rejoindre l’équipe de documentation de WordPress en français sur le <a href=\"https://wpfr.net/slack\">Slack WordPress francophone</a>, canal <code>#documentation-fr</code>.</p>\n\n\n\n<p class=\"has-text-align-right has-small-font-size\">Communiqué co-rédigé par Jenny Dupuy et Jb Audras</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:121:\"https://fr.wordpress.org/2022/01/17/wordpress-5-9-documentation-en-francais-des-fonctionnalites-de-lediteur-de-site/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"1\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:2;a:6:{s:4:\"data\";s:73:\"\n		\n		\n					\n		\n		\n		\n				\n		\n\n					\n										\n					\n					\n			\n		\n		\n			\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:5:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:60:\"Guide des changements techniques à venir sur WordPress 5.9\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:95:\"https://fr.wordpress.org/2022/01/12/guide-des-changements-techniques-a-venir-sur-wordpress-5-9/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:104:\"https://fr.wordpress.org/2022/01/12/guide-des-changements-techniques-a-venir-sur-wordpress-5-9/#comments\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 12 Jan 2022 08:15:27 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Nouvelles versions de WordPress\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:32:\"https://fr.wordpress.org/?p=2264\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:353:\"La sortie de WordPress 5.9 est prévue pour le 25 janvier 2022. WordPress 5.9 offrira la possibilité de construire l’ensemble de votre site en utilisant des blocs. Cette nouvelle version majeure apportera en effet des outils de conception avancés pour vous permettre de créer des mises en page personnalisées pour votre thème, et de les [&#8230;]\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:9:\"Jb Audras\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:32497:\"\n<figure class=\"wp-block-image size-full\"><a href=\"https://fr.wordpress.org/files/2022/01/wordpress-59.png\"><img loading=\"lazy\" width=\"1000\" height=\"600\" src=\"https://fr.wordpress.org/files/2022/01/wordpress-59.png\" alt=\"WordPress 5.9\" class=\"wp-image-2265\" srcset=\"https://fr.wordpress.org/files/2022/01/wordpress-59.png 1000w, https://fr.wordpress.org/files/2022/01/wordpress-59-300x180.png 300w, https://fr.wordpress.org/files/2022/01/wordpress-59-768x461.png 768w\" sizes=\"(max-width: 1000px) 100vw, 1000px\" /></a></figure>\n\n\n\n<p class=\"has-text-align-center\" style=\"font-size:24px\">La sortie de WordPress 5.9 est prévue <br>pour le 25 janvier 2022.</p>\n\n\n\n<p>WordPress 5.9 offrira la possibilité de construire l’ensemble de votre site en utilisant des blocs. Cette nouvelle version majeure apportera en effet des outils de conception avancés pour vous permettre de créer des mises en page personnalisées pour votre thème, et de les mettre en forme selon vos préférences.</p>\n\n\n\n<p>Découvrez dans ce guide les nouveautés techniques majeures qui vous attendent pour cette nouvelle version de l’outil qui propulse plus de 43% du web !</p>\n\n\n\n<span id=\"more-2264\"></span>\n\n\n\n<p>Cette version majeure 5.9 corrige plus de <a href=\"https://core.trac.wordpress.org/query?milestone=5.9&amp;group=type&amp;page=4&amp;col=id&amp;col=summary&amp;col=milestone&amp;col=owner&amp;col=type&amp;col=status&amp;col=priority&amp;order=priority\">100 bugs</a>, apporte <a href=\"https://core.trac.wordpress.org/query?milestone=5.9&amp;group=type&amp;page=4&amp;col=id&amp;col=summary&amp;col=milestone&amp;col=owner&amp;col=type&amp;col=status&amp;col=priority&amp;order=priority\">99 améliorations</a>, répond à <a href=\"https://core.trac.wordpress.org/query?milestone=5.9&amp;group=type&amp;page=4&amp;col=id&amp;col=summary&amp;col=milestone&amp;col=owner&amp;col=type&amp;col=status&amp;col=priority&amp;order=priority\">5 demandes de nouvelles fonctionnalités</a> et prend en charge <a href=\"https://core.trac.wordpress.org/query?milestone=5.9&amp;group=type&amp;page=4&amp;col=id&amp;col=summary&amp;col=milestone&amp;col=owner&amp;col=type&amp;col=status&amp;col=priority&amp;order=priority\">51 tâches de maintenance</a>. Voici la <a href=\"https://core.trac.wordpress.org/query?status=closed&amp;milestone=5.9&amp;group=component&amp;col=id&amp;col=summary&amp;col=owner&amp;col=type&amp;col=priority&amp;col=component&amp;col=version&amp;order=priority\" data-type=\"URL\">liste complète des tickets fermés lors du développement de WordPress 5.9</a>.</p>\n\n\n\n<p>Vous pouvez d’ores et déjà tester cette nouvelle version en installant la <a href=\"https://wordpress.org/news/2022/01/wordpress-5-9-rc-2/\">version Release Candidate 2</a> sur un site de test. La version finale est prévue pour le 25 janvier 2022.</p>\n\n\n\n<p>Pour chaque composant de WordPress concerné par un changement majeur, vous trouverez un paragraphe introductif en français suivi des notes de développement et autres ressources publiées par l’équipe de développement de WordPress, en anglais.</p>\n\n\n\n<h2 id=\"editeur-de-blocs-arrivee-de-l-edition-complete-de-votre-site-a-l-aide-de-blocs-gutenberg\">Éditeur de blocs&nbsp;: arrivée de l’édition complète de votre site à l’aide de blocs Gutenberg</h2>\n\n\n\n<p>WordPress 5.9 est la version qui apporte le plus de changements à l’éditeur depuis le lancement de Gutenberg sur WP 5.0.</p>\n\n\n\n<p>Cette nouvelle version majeure apporte une suite complète d’outils permettant à l’éditeur de blocs de proposer bien plus que la seule écriture des pages et articles de votre site. Cela comprend une nouvelle façon de construire des thèmes, de créer des modèles et de mettre en forme votre site. En plus de cela, une dizaine de nouveaux blocs proposent le chargement de contenus dynamiques pour créer les modèles de pages de votre site.</p>\n\n\n\n<p>Le nouveau thème natif <strong>Twenty Twenty-Two</strong> est quant à lui chargé de faire la démonstration de toutes ces nouvelles fonctionnalités.</p>\n\n\n\n<figure class=\"wp-block-image size-large\"><a href=\"https://make.wordpress.org/core/files/2021/10/Example-Pages-scaled.jpg\"><img src=\"https://make.wordpress.org/core/files/2021/10/Example-Pages-1024x701.jpg\" alt=\"\" class=\"wp-image-91525\" /></a></figure>\n\n\n\n<p>Pour en savoir plus sur les thèmes basés sur des blocs et pour apprendre à construire le vôtre, consultez la note de développement dédiée&nbsp;:</p>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"SWXSKzm4tM\"><a href=\"https://make.wordpress.org/core/2022/01/04/block-themes-a-new-way-to-build-themes-in-wordpress-5-9/\">Block themes, a new way to build themes in WordPress 5.9</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;Block themes, a new way to build themes in WordPress 5.9&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2022/01/04/block-themes-a-new-way-to-build-themes-in-wordpress-5-9/embed/#?secret=c4fiUtwbS1#?secret=SWXSKzm4tM\" data-secret=\"SWXSKzm4tM\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<p><a href=\"https://developer.wordpress.org/block-editor/contributors/versions-in-wordpress/\">WordPress 5.9 comprend tous les changements ayant eu lieu sur l’extension Gutenberg</a> depuis la dernière version de WordPress, jusqu’au gel du développement de nouvelles fonctionnalités intervenu avec la version 11.9 de Gutenberg. Pour connaître le contenu de chaque version de l’extension Gutenberg, consultez leur article dédié&nbsp;: <a href=\"https://make.wordpress.org/core/2021/06/10/whats-new-in-gutenberg-10-8-9-june/\" data-type=\"post\" data-id=\"89357\">10.8</a>, <a href=\"https://make.wordpress.org/core/2021/06/24/whats-new-in-gutenberg-10-9-23-june/\" data-type=\"post\" data-id=\"89686\">10.9</a>, <a href=\"https://make.wordpress.org/core/2021/07/09/whats-new-in-gutenberg-11-0-0-9-july/\" data-type=\"post\" data-id=\"89923\">11.0</a>, <a href=\"https://make.wordpress.org/core/2021/07/21/whats-new-in-gutenberg-11-1-0-21-july/\" data-type=\"post\" data-id=\"90206\">11.1</a>, <a href=\"https://make.wordpress.org/core/2021/08/05/whats-new-in-gutenberg-11-2-0-4-august/\" data-type=\"post\" data-id=\"90397\">11.2</a>, <a href=\"https://make.wordpress.org/core/2021/08/18/whats-new-in-gutenberg-11-3-18-august/\" data-type=\"post\" data-id=\"90589\">11.3</a>, <a href=\"https://make.wordpress.org/core/2021/09/01/whats-new-in-gutenberg-11-4-1-september/\" data-type=\"post\" data-id=\"90781\">11.4</a>, <a href=\"https://make.wordpress.org/core/2021/09/17/whats-new-in-gutenberg-11-5-16-september/\" data-type=\"post\" data-id=\"91161\">11.5</a>, <a href=\"https://make.wordpress.org/core/2021/10/01/whats-new-in-gutenberg-11-6-29-september/\" data-type=\"post\" data-id=\"91369\">11.6</a>, <a href=\"https://make.wordpress.org/core/2021/10/14/whats-new-in-gutenberg-11-7-october-13th/\" data-type=\"post\" data-id=\"91649\">11.7</a>, <a href=\"https://make.wordpress.org/core/2021/10/28/whats-new-in-gutenberg-11-8-0-27-october/\" data-type=\"post\" data-id=\"91867\">11.8</a>, <a href=\"https://make.wordpress.org/core/2021/11/12/whats-new-in-gutenberg-11-9-0-10-november/\" data-type=\"post\" data-id=\"92148\">11.9</a>.</p>\n\n\n\n<p>Vous trouverez ci-après les principaux changements intervenus sur Gutenberg, avec des liens vers les notes de développement associées.</p>\n\n\n\n<h3 id=\"mise-a-jour-des-reglages-des-styles-et-du-fichier-theme-json\">Mise à jour des réglages, des styles et du fichier theme.json</h3>\n\n\n\n<p>La note de développement suivante décrit les changements notamment apportés au fichier theme.json.</p>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"svOvwF6t4G\"><a href=\"https://make.wordpress.org/core/2022/01/08/updates-for-settings-styles-and-theme-json/\">Updates for Settings, Styles, and theme.json</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;Updates for Settings, Styles, and theme.json&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2022/01/08/updates-for-settings-styles-and-theme-json/embed/#?secret=EZ9WXFA1VZ#?secret=svOvwF6t4G\" data-secret=\"svOvwF6t4G\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h3 id=\"refactorisation-du-bloc-galerie\">Refactorisation du bloc Galerie</h3>\n\n\n\n<p>Auparavant, le bloc galerie fonctionnait comme un bloc unique qui permettait de choisir des images à intégrer au bloc. À partir de WordPress 5.9, il devient un bloc «&nbsp;conteneur&nbsp;» et les images qu’il contient seront tout simplement des blocs intégrés au sein de celui-ci. Par ailleurs, il sera également possible d’y intégrer d’autres types de blocs.</p>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"ODDpuDSnAc\"><a href=\"https://make.wordpress.org/core/2021/08/20/gallery-block-refactor-dev-note/\">Gallery Block Refactor Dev Note</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;Gallery Block Refactor Dev Note&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2021/08/20/gallery-block-refactor-dev-note/embed/#?secret=S0lJLeqvqn#?secret=ODDpuDSnAc\" data-secret=\"ODDpuDSnAc\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h3 id=\"le-nouveau-bloc-navigation\">Le nouveau bloc Navigation</h3>\n\n\n\n<p>Le nouveau bloc de navigation s’intègre pleinement dans l’objectif d’édition complète de votre site via l’éditeur de blocs. Celui-ci permet de créer et gérer vos menus de navigation au sein de l’éditeur.</p>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"ZLBgTGrRWl\"><a href=\"https://make.wordpress.org/core/2022/01/07/the-new-navigation-block/\">The new Navigation block</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;The new Navigation block&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2022/01/07/the-new-navigation-block/embed/#?secret=7VIz3HSob6#?secret=ZLBgTGrRWl\" data-secret=\"ZLBgTGrRWl\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h3 id=\"encore-plus-de-controle-sur-les-blocs-pouvant-en-contenir-d-autres\">Encore plus de contrôle sur les blocs pouvant en contenir d’autres</h3>\n\n\n\n<p>La manière d’utiliser le composant <code>&lt;InnerBlocks /&gt;</code> a évolué. Cette note de développement vous permettra de mieux l’intégrer à vos projets de développements basés sur des blocs.</p>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"hQlv4ca8wR\"><a href=\"https://make.wordpress.org/core/2021/12/28/take-more-control-over-inner-block-areas-as-a-block-developer/\">Take more control over Inner Block Areas (as a block developer)</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;Take more control over Inner Block Areas (as a block developer)&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2021/12/28/take-more-control-over-inner-block-areas-as-a-block-developer/embed/#?secret=e3ut65A9Ce#?secret=hQlv4ca8wR\" data-secret=\"hQlv4ca8wR\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h3 id=\"possibilite-de-declarer-plusieurs-feuilles-de-styles-par-bloc\">Possibilité de déclarer plusieurs feuilles de styles par bloc</h3>\n\n\n\n<p>Le fichier <code>block.json</code> permet dorénavant de déclarer une ou plusieurs feuilles de styles pour un seul et même bloc, et de charger des styles provenant d’autres blocs si besoin. Les thèmes pourront donc ajouter des styles blocs par blocs au lieu d’utiliser des feuilles de styles très lourdes contenant des styles pour l’ensemble du site, et qui sont donc constamment chargées pour toutes les pages.</p>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"TWCV3clxxI\"><a href=\"https://make.wordpress.org/core/2021/12/15/using-multiple-stylesheets-per-block/\">Using multiple stylesheets per block</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;Using multiple stylesheets per block&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2021/12/15/using-multiple-stylesheets-per-block/embed/#?secret=SO4kaonk5W#?secret=TWCV3clxxI\" data-secret=\"TWCV3clxxI\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h3 id=\"une-nouvelle-api-permettant-d-acceder-aux-styles-et-reglages-globaux-du-site\">Une nouvelle API permettant d’accéder aux styles et réglages globaux du site</h3>\n\n\n\n<p>Un jeu de fonctions, de crochets d’action et de filtres permet d’accéder au fichier <code>theme.json</code> et d’en modifier les réglages.</p>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"pImnyM4YOk\"><a href=\"https://make.wordpress.org/core/2022/01/04/new-api-to-access-global-settings-styles/\">New API to access global settings &amp; styles</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;New API to access global settings &amp; styles&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2022/01/04/new-api-to-access-global-settings-styles/embed/#?secret=IeKJQ3tIxp#?secret=pImnyM4YOk\" data-secret=\"pImnyM4YOk\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h3 id=\"verrouillage-des-blocs\">Verrouillage des blocs</h3>\n\n\n\n<p>WordPress 5.9 apporte la possibilité de verrouiller certains blocs individuels au sein de compositions de blocs, afin d’empêcher leur modification dans l’éditeur. Ceci est particulièrement utile pour contraindre la mise en page et la mise en forme de certaines compositions par rapport à votre charte graphique.</p>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"m9aKusEXIo\"><a href=\"https://make.wordpress.org/core/2022/01/08/locking-blocks-in-wordpress-5-9/\">Locking Blocks in WordPress 5.9</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;Locking Blocks in WordPress 5.9&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2022/01/08/locking-blocks-in-wordpress-5-9/embed/#?secret=K3JEnG3aho#?secret=m9aKusEXIo\" data-secret=\"m9aKusEXIo\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h3 id=\"autres-modifications-concernant-l-editeur-de-blocs-sur-wp-5-9\">Autres modifications concernant l’éditeur de blocs sur WP 5.9</h3>\n\n\n\n<p>La note de développement suivante liste diverses autres améliorations et d’autres changements sur l’éditeur de blocs.</p>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"zcz3Iu1aJ3\"><a href=\"https://make.wordpress.org/core/2022/01/04/miscellaneous-block-editor-changes-in-wordpress-5-9/\">Miscellaneous block editor changes in WordPress 5.9</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;Miscellaneous block editor changes in WordPress 5.9&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2022/01/04/miscellaneous-block-editor-changes-in-wordpress-5-9/embed/#?secret=hwR7A5kJf5#?secret=zcz3Iu1aJ3\" data-secret=\"zcz3Iu1aJ3\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h2 id=\"performances\">Performances</h2>\n\n\n\n<h3 id=\"coup-d-oeil-sur-les-ameliorations-generales-des-performances-de-wordpress\">Coup d’œil sur les améliorations générales des performances de WordPress</h3>\n\n\n\n<p>La version 5.9 de WordPress apporte un grand nombre d’améliorations de performances. Cet article les détaille de façon précise.</p>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"5UGWFL9jjs\"><a href=\"https://make.wordpress.org/core/2022/01/05/wordpress-5-9-performance-improvements/\">WordPress 5.9 Performance Improvements</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;WordPress 5.9 Performance Improvements&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2022/01/05/wordpress-5-9-performance-improvements/embed/#?secret=N0dmvbpkZN#?secret=5UGWFL9jjs\" data-secret=\"5UGWFL9jjs\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h3 id=\"ameliorations-du-chargement-differe-des-medias-sur-wordpress-5-9\">Améliorations du chargement différé des médias sur WordPress 5.9</h3>\n\n\n\n<p>Présent depuis WordPress 5.5 pour les images et 5.7 pour les iframes, le chargement différé (en anglais <em>lazy loading</em>) permet de ne charger un élément que lorsque l’on a besoin de l’afficher à la personne qui visite le site. Mais tous les médias ne doivent pas tout le temps être chargés en différé. WordPress 5.9 améliore cela en évitant le chargement différé des premiers éléments médias du site, ceux qui sont généralement situés au dessus de la ligne de flottaison de l’écran. Si vous développez des sites web avec WordPress, vous pouvez paramétrer ces réglages précisément pour vos projets.</p>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"JgXt1vowJf\"><a href=\"https://make.wordpress.org/core/2021/12/29/enhanced-lazy-loading-performance-in-5-9/\">Enhanced lazy-loading performance in 5.9</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;Enhanced lazy-loading performance in 5.9&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2021/12/29/enhanced-lazy-loading-performance-in-5-9/embed/#?secret=9dEgcoZp6L#?secret=JgXt1vowJf\" data-secret=\"JgXt1vowJf\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h2 id=\"api-du-coeur-wordpress\">API du cœur WordPress</h2>\n\n\n\n<h3 id=\"changements-concernant-les-publications-les-types-de-publications-ainsi-que-les-taxonomies\">Changements concernant les publications, les types de publications, ainsi que les taxonomies</h3>\n\n\n\n<p>De nouvelles fonctions, crochets d’action et filtres ont été ajoutés pour faciliter le travail des développeurs et des développeuses WordPress. Découvrez-les dans cette note de développement.</p>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"w6AClHbkTk\"><a href=\"https://make.wordpress.org/core/2021/12/13/posts-post-types-and-taxonomy-changes-in-wordpress-5-9/\">Posts, Post types and Taxonomy changes in WordPress 5.9</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;Posts, Post types and Taxonomy changes in WordPress 5.9&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2021/12/13/posts-post-types-and-taxonomy-changes-in-wordpress-5-9/embed/#?secret=Y8kbbhiT7Z#?secret=w6AClHbkTk\" data-secret=\"w6AClHbkTk\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h3 id=\"une-nouvelle-facon-de-faire-des-requetes-sur-les-permissions-des-comptes\">Une nouvelle façon de faire des requêtes sur les permissions des comptes</h3>\n\n\n\n<p>WordPress 5.9 apporte des améliorations à l’API permettant de récupérer des comptes en fonction de leurs permissions.</p>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"YO1jgxzWku\"><a href=\"https://make.wordpress.org/core/2022/01/05/new-capability-queries-in-wordpress-5-9/\">New Capability Queries in WordPress 5.9</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;New Capability Queries in WordPress 5.9&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2022/01/05/new-capability-queries-in-wordpress-5-9/embed/#?secret=fFgZih7glT#?secret=YO1jgxzWku\" data-secret=\"YO1jgxzWku\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h2 id=\"internationalisation\">Internationalisation</h2>\n\n\n\n<p>Vous le verrez la prochaine fois que vous vous connecterez à votre site s’il dispose de plusieurs langues installées dans l’administration&nbsp;: un sélecteur de langue a été ajouté à la page de connexion de WordPress, ce qui permet aux utilisateurs et utilisatrices disposant d’un compte sur votre site d’afficher la page de connexion dans leur langue de préférence. Cela est particulièrement utile pour les sites multilingue, multisite ou comprenant un grand nombre de comptes.</p>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"cUWtWUTV8P\"><a href=\"https://make.wordpress.org/core/2021/12/20/introducing-new-language-switcher-on-the-login-screen-in-wp-5-9/\">Introducing new language switcher on the login screen in WP 5.9</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;Introducing new language switcher on the login screen in WP 5.9&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2021/12/20/introducing-new-language-switcher-on-the-login-screen-in-wp-5-9/embed/#?secret=MICZjoa8az#?secret=cUWtWUTV8P\" data-secret=\"cUWtWUTV8P\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h2 id=\"themes-et-outil-de-personnalisation\">Thèmes et outil de personnalisation</h2>\n\n\n\n<h3 id=\"changement-concernant-le-developpement-de-themes\">Changement concernant le développement de thèmes</h3>\n\n\n\n<p>WordPress 5.9 introduit des changements concernant le développement de thèmes, mais aussi de nouveaux filtres pour aider les développeurs et développeuses.</p>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"ez8hcRzofd\"><a href=\"https://make.wordpress.org/core/2022/01/07/theme-focused-changes-and-filters-in-wordpress-5-9/\">Theme-focused changes and filters in WordPress 5.9</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;Theme-focused changes and filters in WordPress 5.9&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2022/01/07/theme-focused-changes-and-filters-in-wordpress-5-9/embed/#?secret=9vlpnajCDf#?secret=ez8hcRzofd\" data-secret=\"ez8hcRzofd\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h3 id=\"mises-a-jour-sur-les-themes-natifs\">Mises à jour sur les thèmes natifs</h3>\n\n\n\n<p>WordPress 5.9 vient aussi avec un certain nombre de modifications concernant les thèmes natifs autres que Twenty Twenty-Two. Si vous utilisez ces thèmes natifs (ou un thème enfant basé sur ces thèmes), nous vous recommandons de prendre connaissance de cette note de développement.</p>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"urRKh3rve8\"><a href=\"https://make.wordpress.org/core/2022/01/05/bundled-theme-updates-with-wordpress-5-9/\">Bundled theme updates with WordPress 5.9</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;Bundled theme updates with WordPress 5.9&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2022/01/05/bundled-theme-updates-with-wordpress-5-9/embed/#?secret=zLDNcqhiAw#?secret=urRKh3rve8\" data-secret=\"urRKh3rve8\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h3 id=\"evolution-du-statut-de-l-outil-de-personnalisation\">Évolution du statut de l’outil de personnalisation</h3>\n\n\n\n<p>Avec les thèmes basés sur des blocs et l’édition complète de site (<em>full site editing</em> en anglais), l’outil de personnalisation perd un peu de son intérêt. Mais il reste utile pour les thèmes classiques&nbsp;!</p>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"xCZdOct8zV\"><a href=\"https://make.wordpress.org/core/2022/01/07/state-of-the-customizer-with-block-themes-in-wordpress-5-9/\">State of the Customizer with block themes in WordPress 5.9</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;State of the Customizer with block themes in WordPress 5.9&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2022/01/07/state-of-the-customizer-with-block-themes-in-wordpress-5-9/embed/#?secret=CHW5jm647u#?secret=xCZdOct8zV\" data-secret=\"xCZdOct8zV\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h2 id=\"php-8-0-et-8-1\">PHP 8.0 et 8.1</h2>\n\n\n\n<p>Cette note de développement fait le point sur l’état de la compatibilité de WordPress avec les versions 8.0 et 8.1 de PHP.</p>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"8HBIk3Ijni\"><a href=\"https://make.wordpress.org/core/2022/01/10/wordpress-5-9-and-php-8-0-8-1/\">WordPress 5.9 and PHP 8.0-8.1</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;WordPress 5.9 and PHP 8.0-8.1&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2022/01/10/wordpress-5-9-and-php-8-0-8-1/embed/#?secret=PDGYoJaxp8#?secret=8HBIk3Ijni\" data-secret=\"8HBIk3Ijni\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h2 id=\"outils-de-tests-unitaires-du-coeur-wordpress\">Outils de tests unitaires du cœur WordPress</h2>\n\n\n\n<p>Cet article fait le point sur les changements ayant eu lieu sur les tests unitaires dont fait l’objet chaque ligne de code introduite dans le code source du CMS.</p>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"6ihNzPxnfm\"><a href=\"https://make.wordpress.org/core/2021/09/27/changes-to-the-wordpress-core-php-test-suite/\">Changes to the WordPress Core PHP Test Suite</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;Changes to the WordPress Core PHP Test Suite&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2021/09/27/changes-to-the-wordpress-core-php-test-suite/embed/#?secret=Rbh1GTGYFP#?secret=6ihNzPxnfm\" data-secret=\"6ihNzPxnfm\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h2 id=\"autres-changements-techniques\">Autres changements techniques</h2>\n\n\n\n<p>Mais ce n’est pas tout&nbsp;!</p>\n\n\n\n<p>Cette dernière note de développement rassemble divers autres changements ayant eu lieu sur WordPress 5.9&nbsp;:</p>\n\n\n\n<ul><li>Le champ de message des commentaires est maintenant mentionné comme étant obligatoire.</li><li>Deux nouveaux fournisseurs oEmbed font leur apparition&nbsp;: Pinterest ainsi que l’outil de représentation mathématique Wolfram Notebook.</li><li>Une nouvelle option pour restreindre les balises autorisées dans l’éditeur en fonction de leurs attributs.</li><li>Les PDF peuvent dorénavant être embarqués via la balise <code>object</code>.</li><li>Suppression de l’attribut redondant <code>role=\"navigation\"</code> des balises <code>nav</code> générées par WordPress.</li><li>Le nouveau filtre <code>wp_http_validate_url</code> permet de déclarer les ports utilisables pour des requêtes externes.</li><li>Le crochet d’action&nbsp;<code>wp_mail_succeeded</code>&nbsp;a été ajouté à la fonction&nbsp;<code>wp_mail()</code>.</li><li>La variable globale <code>post</code> est à présent utilisée par défaut sur la fonction&nbsp;<code>wp_get_post_parent_id()</code>.</li><li><code>wp_register_script()</code>&nbsp;peut dorénavant être appelé après&nbsp;<code>wp_enqueue_script()</code>.</li><li>Les fonctions&nbsp;<code>get_*_*_link()</code>&nbsp;et&nbsp;<code>edit_term_link()</code>&nbsp;acceptent désormais un «&nbsp;term ID&nbsp;» ou un objet&nbsp;<code>WP_Term</code>.</li></ul>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"boNv6pFAzh\"><a href=\"https://make.wordpress.org/core/2022/01/04/miscellaneous-core-changes-in-wordpress-5-9/\">Miscellaneous Core changes in WordPress 5.9</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;Miscellaneous Core changes in WordPress 5.9&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2022/01/04/miscellaneous-core-changes-in-wordpress-5-9/embed/#?secret=Km2rn2BKZN#?secret=boNv6pFAzh\" data-secret=\"boNv6pFAzh\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<p class=\"has-text-align-right has-small-font-size\">Rédigé par <a href=\'https://profiles.wordpress.org/audrasjb/\' class=\'mention\'><span class=\'mentions-prefix\'>@</span>audrasjb</a>, relu et corrigé par <a href=\'https://profiles.wordpress.org/fxbenard/\' class=\'mention\'><span class=\'mentions-prefix\'>@</span>fxbenard</a> et <a href=\'https://profiles.wordpress.org/jdy68/\' class=\'mention\'><span class=\'mentions-prefix\'>@</span>jdy68</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:100:\"https://fr.wordpress.org/2022/01/12/guide-des-changements-techniques-a-venir-sur-wordpress-5-9/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"1\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:3;a:6:{s:4:\"data\";s:73:\"\n		\n		\n					\n		\n		\n		\n				\n		\n\n					\n										\n					\n					\n			\n		\n		\n			\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:5:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:103:\"« State of the Word 2021 », le bilan annuel du projet WordPress en vidéo sous-titrée en français\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:128:\"https://fr.wordpress.org/2021/12/22/state-of-the-word-2021-le-bilan-annuel-du-projet-wordpress-en-video-sous-titree-en-francais/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:136:\"https://fr.wordpress.org/2021/12/22/state-of-the-word-2021-le-bilan-annuel-du-projet-wordpress-en-video-sous-titree-en-francais/#respond\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 22 Dec 2021 20:23:46 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"WordPress.org\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:32:\"https://fr.wordpress.org/?p=2239\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:372:\"Le « State of the Word » est la conférence annuelle du cofondateur de WordPress Matt Mullenweg. Cette année, elle s’est déroulée le 14 décembre 2021 à New York devant une petite audience de personnes. Une diffusion vidéo était également proposée pour que tout le monde puisse suivre cette conférence en direct. Il s’agit toujours d’un moment [&#8230;]\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:9:\"Jb Audras\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:5893:\"\n<p>Le « State of the Word » est la conférence annuelle du cofondateur de WordPress Matt Mullenweg. Cette année, elle s’est déroulée le 14 décembre 2021 à New York devant une petite audience de personnes. Une diffusion vidéo était également proposée pour que tout le monde puisse suivre cette conférence en direct. Il s’agit toujours d’un moment important pour la communauté. Plus de 30 communautés locales ont même réuni en tout plus de 300 personnes lors de meetups locaux pour assister ensemble à la conférence, comme à Séville en Espagne.</p>\n\n\n\n<span id=\"more-2239\"></span>\n\n\n\n<p>Vous pouvez voir ou revoir cette conférence en utilisant le lecteur ci-dessous ou <a href=\"https://wordpress.tv/2021/12/15/matt-mullenweg-2021-state-of-the-word/\">en vous rendant sur WordPress.tv</a>.</p>\n\n\n\n<figure class=\"wp-block-embed is-type-video is-provider-videopress wp-block-embed-videopress wp-embed-aspect-16-9 wp-has-aspect-ratio\"><div class=\"wp-block-embed__wrapper\">\n<iframe title=\"Matt Mullenweg: 2021 State of the Word\" width=\'612\' height=\'344\' src=\'https://video.wordpress.com/embed/Io14KzZ3?hd=1&amp;cover=1\' frameborder=\'0\' allowfullscreen ></iframe><script src=\'https://v0.wordpress.com/js/next/videopress-iframe.js?m=1633526814\'></script>\n</div></figure>\n\n\n\n<div class=\"wp-block-image\"><figure class=\"alignright size-full is-resized\"><a href=\"https://fr.wordpress.org/files/2021/12/video-subtitles-sotw-wordpress.png\"><img loading=\"lazy\" src=\"https://fr.wordpress.org/files/2021/12/video-subtitles-sotw-wordpress.png\" alt=\"\" class=\"wp-image-2241\" width=\"108\" height=\"97\" srcset=\"https://fr.wordpress.org/files/2021/12/video-subtitles-sotw-wordpress.png 433w, https://fr.wordpress.org/files/2021/12/video-subtitles-sotw-wordpress-300x268.png 300w\" sizes=\"(max-width: 108px) 100vw, 108px\" /></a></figure></div>\n\n\n\n<p>Pour activer les sous-titres en français, lancez la vidéo puis sélectionnez sur le troisième bouton à droite, cliquez sur «&nbsp;Subtitles : On/Off&nbsp;» et sélectionnez «&nbsp;Français&nbsp;».</p>\n\n\n\n<p>Comme d’habitude, Matt a couvert un grand nombre de sujets. Le passé, le présent et le futur de WordPress ont été abordés, en soulignant notamment l’augmentation du nombre de contributeurs et contributrices, de traductions de WP dans d’autres langues que l’anglais, les différents jalons atteints par les dernières versions de WordPress, ou encore les initiatives en matière de contenus d’apprentissage et de documentation.</p>\n\n\n\n<p>Des démonstrations des nouvelles fonctionnalités qui arrivent avec la prochaine version majeure 5.9 ont été présentées&nbsp;: édition complète du site, compositions de blocs, options de styles globaux, contrôles d’images avancés…</p>\n\n\n\n<figure class=\"wp-block-image size-large\"><a href=\"https://fr.wordpress.org/files/2021/12/sotw-2021-WP59-fonctionnalites.png\"><img loading=\"lazy\" width=\"1024\" height=\"575\" src=\"https://fr.wordpress.org/files/2021/12/sotw-2021-WP59-fonctionnalites-1024x575.png\" alt=\"\" class=\"wp-image-2246\" srcset=\"https://fr.wordpress.org/files/2021/12/sotw-2021-WP59-fonctionnalites-1024x575.png 1024w, https://fr.wordpress.org/files/2021/12/sotw-2021-WP59-fonctionnalites-300x168.png 300w, https://fr.wordpress.org/files/2021/12/sotw-2021-WP59-fonctionnalites-768x431.png 768w, https://fr.wordpress.org/files/2021/12/sotw-2021-WP59-fonctionnalites-1536x862.png 1536w, https://fr.wordpress.org/files/2021/12/sotw-2021-WP59-fonctionnalites-2048x1149.png 2048w\" sizes=\"(max-width: 1024px) 100vw, 1024px\" /></a></figure>\n\n\n\n<p>Matt en a profité pour féliciter la communauté d&rsquo;avoir permis à WordPress de dépasser les 43&nbsp;% de parts de marché des CMS en décembre 2021, et pour remercier toutes les personnes qui ont déjà contribué à WordPress 5.9. Il a également rappelé que les entreprises qui bâtissent leur économie sur le CMS sont invitées à participer au programme «&nbsp;Five for the Future&nbsp;», c’est à dire à donner 5% de leur temps à la contribution à WordPress. Cela permet de garantir la pérennité du CMS sur le long terme, de continuer à évoluer et de maintenir ses parts de marché sur le web.</p>\n\n\n\n<figure class=\"wp-block-image size-large\"><a href=\"https://fr.wordpress.org/files/2021/12/sotw-2021-WP59-contributeurs.png\"><img loading=\"lazy\" width=\"1024\" height=\"590\" src=\"https://fr.wordpress.org/files/2021/12/sotw-2021-WP59-contributeurs-1024x590.png\" alt=\"\" class=\"wp-image-2249\" srcset=\"https://fr.wordpress.org/files/2021/12/sotw-2021-WP59-contributeurs-1024x590.png 1024w, https://fr.wordpress.org/files/2021/12/sotw-2021-WP59-contributeurs-300x173.png 300w, https://fr.wordpress.org/files/2021/12/sotw-2021-WP59-contributeurs-768x442.png 768w, https://fr.wordpress.org/files/2021/12/sotw-2021-WP59-contributeurs-1536x884.png 1536w, https://fr.wordpress.org/files/2021/12/sotw-2021-WP59-contributeurs.png 1980w\" sizes=\"(max-width: 1024px) 100vw, 1024px\" /></a><figcaption><small>Ci-dessus, la liste des personnes ayant contribué à WordPress 5.9 au 14 décembre 2021</small></figcaption></figure>\n\n\n\n<p>Matt a aussi rappelé la feuille de route du projet WordPress, qui comprend l’édition collaborative en temps réel pour 2023, puis la gestion multilingue native.</p>\n\n\n\n<p>Il a enfin évoqué des sujets plus généraux, comme le «&nbsp;web3&nbsp;», les différentes acquisitions et fusions au sein de l’écosystème, ainsi que la poursuite du développement de l’open-source dans le web.</p>\n\n\n\n<p>S’en est suivi une <a href=\"https://wordpress.tv/2021/12/15/matt-mullenweg-state-of-the-word-2021-qa/\">séance de questions-réponses</a> pendant laquelle il a pu répondre a plusieurs questions de l’assistance.</p>\n\n\n\n<p>N’hésitez pas à rejoindre la discussion sur Twitter, avec le mot-dièse <a href=\"https://twitter.com/hashtag/ILoveWP\">#ILoveWP</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:133:\"https://fr.wordpress.org/2021/12/22/state-of-the-word-2021-le-bilan-annuel-du-projet-wordpress-en-video-sous-titree-en-francais/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"0\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:4;a:6:{s:4:\"data\";s:79:\"\n		\n		\n					\n		\n		\n		\n				\n		\n		\n		\n\n					\n										\n					\n					\n			\n		\n		\n			\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:5:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:80:\"Déposer et gérer une extension sur WordPress.org : documentation en français\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:111:\"https://fr.wordpress.org/2021/10/24/deposer-et-gerer-une-extension-sur-wordpress-org-documentation-en-francais/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:119:\"https://fr.wordpress.org/2021/10/24/deposer-et-gerer-une-extension-sur-wordpress-org-documentation-en-francais/#respond\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Sun, 24 Oct 2021 16:32:29 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:3:{i:0;a:5:{s:4:\"data\";s:10:\"Contribuer\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:1;a:5:{s:4:\"data\";s:13:\"Documentation\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:2;a:5:{s:4:\"data\";s:5:\"Guide\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:32:\"https://fr.wordpress.org/?p=2208\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:368:\"Proposer une extension sur le répertoire WordPress.org, c&#8217;est une belle façon de faire profiter la communauté de ce que vous avez développé pour vos propres besoins, et de rendre la pareille à cette communauté tout en vous y faisant connaître. Ça tombe bien, l&#8217;équipe de documentation de WordPress en français vient de publier un guide [&#8230;]\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:9:\"Jb Audras\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:3570:\"\n<div class=\"wp-block-media-text alignwide has-media-on-the-right is-stacked-on-mobile\" style=\"grid-template-columns:auto 40%\"><figure class=\"wp-block-media-text__media\"><img loading=\"lazy\" width=\"1024\" height=\"701\" src=\"https://fr.wordpress.org/files/2021/10/wordpress-documentation-fr-1024x701.png\" alt=\"\" class=\"wp-image-2210 size-full\" srcset=\"https://fr.wordpress.org/files/2021/10/wordpress-documentation-fr-1024x701.png 1024w, https://fr.wordpress.org/files/2021/10/wordpress-documentation-fr-300x205.png 300w, https://fr.wordpress.org/files/2021/10/wordpress-documentation-fr-768x525.png 768w, https://fr.wordpress.org/files/2021/10/wordpress-documentation-fr.png 1450w\" sizes=\"(max-width: 1024px) 100vw, 1024px\" /></figure><div class=\"wp-block-media-text__content\">\n<p>Proposer une extension sur le répertoire WordPress.org, c&rsquo;est une belle façon de faire profiter la communauté de ce que vous avez développé pour vos propres besoins, et de rendre la pareille à cette communauté tout en vous y faisant connaître.</p>\n</div></div>\n\n\n\n<p>Ça tombe bien, l&rsquo;équipe de documentation de WordPress en français vient de publier un guide pour apprendre aux développeurs et développeuses d&rsquo;extensions comment déposer et gérer dans la durée leurs extensions WordPress sur le <a href=\"https://fr.wordpress.org/plugins\">répertoire officiel des extensions WordPress.org</a>.</p>\n\n\n\n<span id=\"more-2208\"></span>\n\n\n\n<p>Ce guide est accessible sur la <a href=\"https://fr.wordpress.org/support\">page d&rsquo;accueil de la documentation de WordPress en français</a>, rubrique «&nbsp;Développement&nbsp;». Vous pouvez également y accéder en suivant ce lien&nbsp;:</p>\n\n\n\n<div class=\"wp-container-620b7dee99368 wp-block-buttons\">\n<div class=\"wp-block-button\"><a class=\"wp-block-button__link has-vivid-cyan-blue-background-color has-background\" href=\"https://fr.wordpress.org/support/article/deposer-et-gerer-son-extension-sur-le-repertoire-wordpress-org/\">Déposer et gérer mon extension sur le répertoire WP.org</a></div>\n</div>\n\n\n\n<p>Vous y retrouverez les pré-requis nécessaires avant de déposer votre extension, de l&rsquo;aide concernant les bonnes pratiques de développement, et les instructions concernant le versionnement de votre extension.</p>\n\n\n\n<p>En effet, si GIT est bien connu aujourd&rsquo;hui, SVN reste relativement obscur pour beaucoup de développeurs et de développeuses alors qu&rsquo;il ne s&rsquo;agit que de 4 ou 5 commandes à connaître.</p>\n\n\n\n<p>Ce point est d&rsquo;ailleurs celui qui a justifié la mise en œuvre de ce travail de documentation car l&rsquo;utilisation de SVN pose parfois des difficultés à la communauté.</p>\n\n\n\n<p>Bref, vous retrouverez tout ce qu&rsquo;il faut savoir concernant le dépôt et la gestion de votre extension sur le répertoire WordPress.org sur <a href=\"https://fr.wordpress.org/support/article/deposer-et-gerer-son-extension-sur-le-repertoire-wordpress-org/\">cette documentation dédiée</a>.</p>\n\n\n\n<p>Nous prévoyons prochainement de proposer plusieurs nouveaux guides liés à la contribution open source&nbsp;: dépôt d&rsquo;un thème sur le répertoire officiel, création d&rsquo;un meetup WordPress local officiel pris en charge par la communauté, etc. Si ce travail de documentation vous intéresse, n&rsquo;hésitez pas à <a href=\"https://fr.wordpress.org/team/handbook/traduire-la-documentation-de-wordpress-en-francais/rejoindre-lequipe-de-traduction-de-la-documentation/\">rejoindre l&rsquo;équipe de documentation de WordPress en français</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:116:\"https://fr.wordpress.org/2021/10/24/deposer-et-gerer-une-extension-sur-wordpress-org-documentation-en-francais/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"0\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:5;a:6:{s:4:\"data\";s:79:\"\n		\n		\n					\n		\n		\n		\n				\n		\n		\n		\n\n					\n										\n					\n					\n			\n		\n		\n			\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:5:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:69:\"Rendez-vous le 24 septembre 2021 pour le WordPress Translation Day !\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:106:\"https://fr.wordpress.org/2021/09/06/rejoignez-nous-le-24-septembre-pour-le-wordpress-translation-day-2021/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:114:\"https://fr.wordpress.org/2021/09/06/rejoignez-nous-le-24-septembre-pour-le-wordpress-translation-day-2021/#respond\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Mon, 06 Sep 2021 13:53:14 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:3:{i:0;a:5:{s:4:\"data\";s:11:\"Évènement\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:1;a:5:{s:4:\"data\";s:10:\"Contribuer\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:2;a:5:{s:4:\"data\";s:10:\"Traduction\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:32:\"https://fr.wordpress.org/?p=2186\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:371:\"Cette année encore, c&#8217;est le retour du WordPress Translation Day, un évènement mondial dédié à la traduction de WordPress et de son écosystème. Cet évènement réunit toutes les communautés de traductrices et de traducteurs à travers le monde afin de contribuer ensemble à la traduction de notre CMS favori. Cette année, le WP Translation Day [&#8230;]\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:9:\"Jb Audras\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:3522:\"\n<figure class=\"wp-block-image size-large\"><a href=\"https://fr.wordpress.org/files/2021/09/wptranslationday-fr-2021.png\"><img loading=\"lazy\" width=\"1024\" height=\"553\" src=\"https://fr.wordpress.org/files/2021/09/wptranslationday-fr-2021-1024x553.png\" alt=\"\" class=\"wp-image-2187\" srcset=\"https://fr.wordpress.org/files/2021/09/wptranslationday-fr-2021-1024x553.png 1024w, https://fr.wordpress.org/files/2021/09/wptranslationday-fr-2021-300x162.png 300w, https://fr.wordpress.org/files/2021/09/wptranslationday-fr-2021-768x415.png 768w, https://fr.wordpress.org/files/2021/09/wptranslationday-fr-2021-1536x830.png 1536w, https://fr.wordpress.org/files/2021/09/wptranslationday-fr-2021-2048x1107.png 2048w\" sizes=\"(max-width: 1024px) 100vw, 1024px\" /></a></figure>\n\n\n\n<p>Cette année encore, c&rsquo;est le retour du WordPress Translation Day, un évènement mondial dédié à la traduction de WordPress et de son écosystème.</p>\n\n\n\n<p>Cet évènement réunit toutes les communautés de traductrices et de traducteurs à travers le monde afin de contribuer ensemble à la traduction de notre CMS favori. Cette année, le WP Translation Day se déroulera durant tout le mois de septembre, pour permettre à chaque communauté locale de pouvoir organiser ses évènements locaux comme elle l&rsquo;entend.</p>\n\n\n\n<span id=\"more-2186\"></span>\n\n\n\n<div class=\"wp-block-image\"><figure class=\"alignright size-large is-resized\"><img loading=\"lazy\" src=\"https://fr.wordpress.org/files/2021/09/Polyglots-Wapuu-WPTD2021.png\" alt=\"\" class=\"wp-image-2190\" width=\"129\" height=\"121\" /></figure></div>\n\n\n\n<p class=\"has-text-color has-medium-font-size\" style=\"color:#c91e68\">L&rsquo;équipe de traduction de WordPress en français a le plaisir de vous convier à son évènement local en ligne, le vendredi 24 septembre 2021 de 14h à 19h&nbsp;!</p>\n\n\n\n<h2 id=\"comment-participer\">Comment participer&nbsp;?</h2>\n\n\n\n<p>C’est très simple&nbsp;: rendez-vous à partir de 14 heures sur le canal <code>#traductions</code> du <a href=\"https://wpfr.net/slack\">Slack WordPress FR (inscrivez-vous gratuitement ici)</a>. Si vous ne pouvez pas vous libérer dès 14 heures, n’hésitez pas à nous rejoindre en cours de route&nbsp;! Un lien de visioconférence sera alors partagé, mais vous pourrez aussi suivre l&rsquo;évènement depuis Slack.</p>\n\n\n\n<p>Durant cette après-midi les 4 GTE (<em>General Translation Editors</em>) seront présents pour vous aider (<a href=\"https://profile.wordpress.org/jdy68\">Jenny Dupuy</a>,&nbsp;<a href=\"https://profile.wordpress.org/fxbenard\">FX Bénard</a>,&nbsp;<a href=\"https://profile.wordpress.org/wolforg\">Didier Demory</a>&nbsp;et&nbsp;<a href=\"https://profile.wordpress.org/audrasjb\">Jb Audras</a>) ainsi que les responsables de la documentation de WordPress en français (<a href=\"https://profile.wordpress.org/chaton666\">Marie Comet</a>&nbsp;et&nbsp;<a href=\"https://profile.wordpress.org/jdy68\">Jenny Dupuy</a>).</p>\n\n\n\n<p>L’objectif est d’accueillir, orienter et accompagner un maximum de nouvelles personnes pour les initier à la traduction du cœur de WordPress, mais aussi des thèmes, des extensions et de la documentation du CMS.</p>\n\n\n\n<p>On vous réservera aussi quelques petites surprises, avec notamment un petit jeu/quiz <img src=\"https://s.w.org/images/core/emoji/13.1.0/72x72/1f31f.png\" alt=\"🌟\" class=\"wp-smiley\" style=\"height: 1em; max-height: 1em;\" /></p>\n\n\n\n<p>N&rsquo;hésitez pas à partager cet article sur vos réseaux, on se retrouve vendredi 24 septembre&nbsp;!</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:111:\"https://fr.wordpress.org/2021/09/06/rejoignez-nous-le-24-septembre-pour-le-wordpress-translation-day-2021/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"0\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:6;a:6:{s:4:\"data\";s:73:\"\n		\n		\n					\n		\n		\n		\n				\n		\n\n					\n										\n					\n					\n			\n		\n		\n			\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:5:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:27:\"WordPress 5.8 « Tatum »\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:56:\"https://fr.wordpress.org/2021/07/20/wordpress-5-8-tatum/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:65:\"https://fr.wordpress.org/2021/07/20/wordpress-5-8-tatum/#comments\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 20 Jul 2021 17:44:40 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Nouvelles versions de WordPress\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:32:\"https://fr.wordpress.org/?p=2168\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:382:\"Trois changements d’ampleur Gestion des widgets à l’aide des blocs Après des mois de travail acharné, la puissance des blocs a enfin atteint l’éditeur de widgets et l’outil de personnalisation. Vous pouvez maintenant ajouter des blocs dans tous les emplacements de widgets de votre site et même les prévisualiser en direct dans l’outil de personnalisation. [&#8230;]\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:9:\"Jb Audras\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:50707:\"\n<div style=\"height:20px\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n\n\n\n<figure class=\"wp-block-image size-large\"><img src=\"https://wordpress.org/news/files/2021/07/5x8-Album-1-1024x683.jpg\" alt=\"\" class=\"wp-image-11042\" /></figure>\n\n\n\n<div class=\"wp-block-cover has-background-dim\"><img loading=\"lazy\" width=\"1978\" height=\"1254\" class=\"wp-block-cover__image-background wp-image-2126\" alt=\"\" src=\"https://fr.wordpress.org/files/2021/06/wp-5-8-about-page-cover.png\" data-object-fit=\"cover\" srcset=\"https://fr.wordpress.org/files/2021/06/wp-5-8-about-page-cover.png 1978w, https://fr.wordpress.org/files/2021/06/wp-5-8-about-page-cover-300x190.png 300w, https://fr.wordpress.org/files/2021/06/wp-5-8-about-page-cover-1024x649.png 1024w, https://fr.wordpress.org/files/2021/06/wp-5-8-about-page-cover-768x487.png 768w, https://fr.wordpress.org/files/2021/06/wp-5-8-about-page-cover-1536x974.png 1536w\" sizes=\"(max-width: 1978px) 100vw, 1978px\" /><div class=\"wp-block-cover__inner-container\">\n<h2>WordPress 5.8 «&nbsp;Tatum&nbsp;»</h2>\n\n\n\n<p>Nous vous présentons WordPress 5.8 «&nbsp;Tatum&nbsp;», nommée en l’honneur de Art Tatum, le pianiste de Jazz légendaire. Sa technique exceptionnelle et sa volonté de repousser les limites ont inspiré des milliers de musiciens.</p>\n\n\n\n<p>Lancez donc un de ses meilleurs morceaux – comme <em>«&nbsp;Tea for Two&nbsp;»</em>, <em>«&nbsp;Tiger Rag&nbsp;»</em>, <em>«&nbsp;Begin the Beguine»</em> ou encore <em>«&nbsp;Night and Day&nbsp;»</em> et découvrez les nouveautés de la dernière version de WordPress.</p>\n</div></div>\n\n\n\n<div style=\"height:48px\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n\n\n\n<span id=\"more-2168\"></span>\n\n\n\n<h2 class=\"has-text-align-center\">Trois changements d’ampleur</h2>\n\n\n\n<div style=\"height:16px\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n\n\n\n<figure class=\"wp-block-gallery columns-2 is-cropped\"><ul class=\"blocks-gallery-grid\"><li class=\"blocks-gallery-item\"><figure><img src=\"https://wordpress.org/news/files/2021/07/about-widgets-blocks-1024x768.png\" alt=\"\" data-id=\"10985\" data-full-url=\"https://wordpress.org/news/files/2021/07/about-widgets-blocks.png\" data-link=\"https://wordpress.org/news/?attachment_id=10985\" class=\"wp-image-10985\" /></figure></li><li class=\"blocks-gallery-item\"><figure><img src=\"https://wordpress.org/news/files/2021/07/about-query-loop-1024x811.png\" alt=\"\" data-id=\"10986\" data-full-url=\"https://wordpress.org/news/files/2021/07/about-query-loop.png\" data-link=\"https://wordpress.org/news/?attachment_id=10986\" class=\"wp-image-10986\" /></figure></li><li class=\"blocks-gallery-item\"><figure><img src=\"https://wordpress.org/news/files/2021/07/about-template-1024x666.png\" alt=\"\" data-id=\"10987\" data-full-url=\"https://wordpress.org/news/files/2021/07/about-template.png\" data-link=\"https://wordpress.org/news/?attachment_id=10987\" class=\"wp-image-10987\" /></figure></li></ul></figure>\n\n\n\n<h3>Gestion des widgets à l’aide des blocs</h3>\n\n\n\n<p>Après des mois de travail acharné, la puissance des blocs a enfin atteint l’éditeur de widgets et l’outil de personnalisation. Vous pouvez maintenant ajouter des blocs dans tous les emplacements de widgets de votre site et même les prévisualiser en direct dans l’outil de personnalisation. Cela ouvre de nouvelles possibilités pour créer du contenu&nbsp;: des mises en page sans coder, des présentations avancées à l’aide des blocs fournis par le cœur de WordPress ou par les extensions tierces… tout est possible. Les développeurs et les développeuses trouveront plus d’informations dans la&nbsp;<a href=\"https://make.wordpress.org/core/2021/06/29/block-based-widgets-editor-in-wordpress-5-8/\">note de développement dédiée</a>.</p>\n\n\n\n<h3>De nouveaux blocs et compositions pour vos publications</h3>\n\n\n\n<p>Le bloc de boucle de requête permet d’afficher une liste de publications basée sur des paramètres définis, exactement comme une boucle PHP mais sans avoir à écrire la moindre ligne de code. Cela vous permet très facilement d’afficher les articles appartenant à une catégorie spécifique, de créer un portfolio ou encore une page présentant vos meilleures recettes de cuisine. C’est un peu comme le bloc «&nbsp;Derniers articles&nbsp;», mais en bien plus puissant&nbsp;! De plus, les suggestions de compositions rendent très facile la gestion de l’affichage de ces listes.</p>\n\n\n\n<h3>Modification des modèles de publications</h3>\n\n\n\n<p>Vous pouvez maintenant utiliser l’éditeur de blocs pour modifier les modèles qui permettent l’affichage de votre contenu. Il vous faut pour cela disposer d’un thème conçu sur la base des blocs, ou qui a intégré la prise en charge de cette fonctionnalité. Vous pourrez basculer de l’éditeur de publication vers l’éditeur de modèles et inversement, tout en restant dans l’interface de l’éditeur de blocs. Il y a plus de 20 nouveaux blocs dédiés à l’édition des modèles. Vous pourrez en apprendre davantage sur cette fonctionnalité en lisant le guide disponible en bas de cette page.</p>\n\n\n\n<div style=\"height:32px\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n\n\n\n<h2 class=\"has-text-align-center\">Trois nouveautés utiles au quotidien</h2>\n\n\n\n<div style=\"height:16px\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n\n\n\n<figure class=\"wp-block-gallery columns-2 is-cropped\"><ul class=\"blocks-gallery-grid\"><li class=\"blocks-gallery-item\"><figure><img src=\"https://wordpress.org/news/files/2021/07/about-list-view-1024x803.png\" alt=\"\" data-id=\"10988\" data-full-url=\"https://wordpress.org/news/files/2021/07/about-list-view.png\" data-link=\"https://wordpress.org/news/?attachment_id=10988\" class=\"wp-image-10988\" /></figure></li><li class=\"blocks-gallery-item\"><figure><img src=\"https://wordpress.org/news/files/2021/07/about-pattern-suggestions-1024x555.png\" alt=\"\" data-id=\"10989\" data-full-url=\"https://wordpress.org/news/files/2021/07/about-pattern-suggestions.png\" data-link=\"https://wordpress.org/news/?attachment_id=10989\" class=\"wp-image-10989\" /></figure></li><li class=\"blocks-gallery-item\"><figure><img src=\"https://wordpress.org/news/files/2021/07/about-duotone-1024x837.png\" alt=\"\" data-id=\"10990\" data-full-url=\"https://wordpress.org/news/files/2021/07/about-duotone.png\" data-link=\"https://wordpress.org/news/?attachment_id=10990\" class=\"wp-image-10990\" /></figure></li></ul></figure>\n\n\n\n<h3>Vue d’ensemble de la structure des pages</h3>\n\n\n\n<p>Parfois vous n’avez besoin que d’une mise en page simple. Mais il arrive aussi d’avoir besoin de quelque chose de plus complexe. À mesure que la quantité de blocs et de compositions disponibles s’étoffe dans l’éditeur, les options de création de contenu deviennent plus nombreuses. La vue sous forme de liste vous permet d’avoir une vue d’ensemble du contenu de l’éditeur et de naviguer rapidement d’un bloc à l’autre. Vous pouvez décider de l’afficher constamment ou au contraire de le masquer, à votre guise.</p>\n\n\n\n<h3>Des suggestions de compositions de blocs</h3>\n\n\n\n<p>À partir de cette version, l’outil de transformation des blocs vous suggérera des compositions de blocs basées sur les blocs utilisés sur la sélection courante. Dès maintenant, vous pouvez l’essayer avec le bloc «&nbsp;boucle de requête&nbsp;» ou le bloc «&nbsp;icônes de réseaux sociaux&nbsp;». Au fur et à mesure de l’ajout de nouvelles compositions, vous pourrez obtenir davantage de suggestions de mises en page sans même quitter l’éditeur&nbsp;!</p>\n\n\n\n<h3>Style et colorisation des images</h3>\n\n\n\n<p>Colorisez vos images et blocs bannières avec des filtres duotones&nbsp;! Cela vous permet de rendre vos images (et même vos vidéos&nbsp;!) bicolores pour qu’elles s’intègrent mieux au design de votre site. Bien entendu, le filtre duotone le plus utilisé est sans doute le noir et blanc, mais de nombreuses autres combinaisons sont également disponibles et vous pouvez même créer vos propres combinaisons en suivant la documentation technique de la fonctionnalité.</p>\n\n\n\n<div style=\"height:32px\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n\n\n\n<h2 class=\"has-text-align-center\">Pour les développeurs et les développeuses</h2>\n\n\n\n<div style=\"height:16px\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n\n\n\n<figure class=\"wp-block-image size-large\"><img src=\"https://wordpress.org/news/files/2021/07/about-theme-json-2x-1024x613.png\" alt=\"\" class=\"wp-image-10992\" /></figure>\n\n\n\n<div style=\"height:16px\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n\n\n\n<h3>Un nouveau fichier theme.json</h3>\n\n\n\n<p>WordPress&nbsp;5.8 dévoile une nouvelle API dédiée aux styles et réglages globaux de votre site. Cette API vous permet de contrôler les réglages de l’éditeur, les outils de personnalisation disponibles pour chaque bloc, les styles disponibles pour chaque bloc, le tout dans un simple fichier theme.json déclaré dans votre thème. Ce fichier de configuration permet d’activer ou de désactiver les fonctionnalités de l’éditeur, et de mettre en place des styles par défaut pour l’ensemble de votre site et pour chaque bloc indépendamment. Si vous développez des thèmes, vous pouvez expérimenter cette nouvelle fonctionnalité dès maintenant. Pour en savoir davantage sur cette API,&nbsp;<a href=\"https://make.wordpress.org/core/2021/06/25/introducing-theme-json-in-wordpress-5-8/\">lisez la note de développement dédiée</a>.</p>\n\n\n\n<div style=\"height:16px\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n\n\n\n<div class=\"wp-container-620b7deeb2713 wp-block-columns\">\n<div class=\"wp-block-column\">\n<h3>Fin de la prise en charge d’IE&nbsp;11</h3>\n\n\n\n<p>La prise en charge d’Internet Explorer 11 est abandonnée à partir de WordPress&nbsp;5.8. Cela signifie que les bogues découverts sur ce navigateur ne seront plus corrigés à l’avenir. Si vous utilisez actuellement IE&nbsp;11, nous vous recommandons fortement de&nbsp;<a href=\"https://browsehappy.com/\">basculer vers un navigateur plus moderne</a>.</p>\n</div>\n\n\n\n<div class=\"wp-block-column\">\n<h3>Prise en charge du format WebP</h3>\n\n\n\n<p>WebP est un format d’image moderne qui fournit une meilleure compression d’image sur le web, avec un poids bien plus léger. Les images WebP sont en moyenne 30&nbsp;% plus légères que leurs équivalents PNG ou JPEG, ce qui a pour résultat de rendre vos sites plus performants.</p>\n</div>\n</div>\n\n\n\n<h3>Nouvelles fonctionnalités liées aux blocs</h3>\n\n\n\n<p>À la suite des fonctionnalités introduites dans les versions&nbsp;<a href=\"https://make.wordpress.org/core/2020/11/18/block-supports-in-wordpress-5-6/\">5.6</a>&nbsp;et&nbsp;<a href=\"https://make.wordpress.org/core/2021/02/24/changes-to-block-editor-components-and-blocks/\">5.7</a>, WordPress&nbsp;5.8 ajoute plusieurs nouvelles fonctionnalités liées aux blocs, afin de plus simplement les déclarer ou les personnaliser. Pour en savoir plus, lisez la&nbsp;<a href=\"https://make.wordpress.org/core/2021/06/25/block-supports-api-updates-for-wordpress-5-8/\">note de développement dédiée</a>.</p>\n\n\n\n<div style=\"height:16px\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n\n\n\n<h3>Consultez le guide de la version pour en savoir plus&nbsp;!</h3>\n\n\n\n<p>Consultez le <a href=\"https://fr.wordpress.org/2021/07/04/guide-des-changements-techniques-a-venir-sur-wordpress-5-8/\" data-type=\"post\" data-id=\"2124\">guide des changements techniques de WordPress&nbsp;5.8</a>. Il met en avant les notes de développement pour chaque modification que vous souhaiteriez approfondir.</p>\n\n\n\n<h2>Contributrices et contributeurs</h2>\n\n\n\n<p>WordPress 5.8 était dirigée par&nbsp;<a href=\"https://profiles.wordpress.org/matt/\">Matt Mullenweg</a> ainsi que l&rsquo;équipe suivante&nbsp;:</p>\n\n\n\n<ul><li><strong>Coordinateurs&nbsp;:</strong>&nbsp;Jeffrey Paul (<a href=\'https://profiles.wordpress.org/jeffpaul/\' class=\'mention\'><span class=\'mentions-prefix\'>@</span>jeffpaul</a>) et Jonathan Desrosiers (<a href=\'https://profiles.wordpress.org/desrosj/\' class=\'mention\'><span class=\'mentions-prefix\'>@</span>desrosj</a>)</li><li><strong>Responsable technique de l’éditeur&nbsp;:</strong>&nbsp;Riad Benguella (<a href=\'https://profiles.wordpress.org/youknowriad/\' class=\'mention\'><span class=\'mentions-prefix\'>@</span>youknowriad</a>)</li><li><strong>Responsable du marketing et de la communication&nbsp;:</strong> Josepha Haden Chomphosy (<a href=\'https://profiles.wordpress.org/chanthaboune/\' class=\'mention\'><span class=\'mentions-prefix\'>@</span>chanthaboune</a>)</li><li><strong>Responsable de la documentation&nbsp;:</strong> Milana Cap (<a href=\'https://profiles.wordpress.org/milana_cap/\' class=\'mention\'><span class=\'mentions-prefix\'>@</span>milana_cap</a>)</li><li><strong>Responsable des tests&nbsp;:</strong>&nbsp;Piotrek Boniu (<a href=\'https://profiles.wordpress.org/boniu91/\' class=\'mention\'><span class=\'mentions-prefix\'>@</span>boniu91</a>)</li><li><strong>Responsable du support&nbsp;:&nbsp;</strong>Mary Job (<a href=\'https://profiles.wordpress.org/mariaojob/\' class=\'mention\'><span class=\'mentions-prefix\'>@</span>mariaojob</a>)</li></ul>\n\n\n\n<p>Cette version est le résultat du travail de 530 contributrices et contributeurs qui ont travaillé sur plus de <a href=\"https://core.trac.wordpress.org/query?milestone=5.8&amp;group=component&amp;col=id&amp;col=summary&amp;col=milestone&amp;col=owner&amp;col=type&amp;col=status&amp;col=priority&amp;order=priority\">320 tickets sur Trac</a> et sur plus de <a href=\"https://github.com/wordpress/gutenberg/compare/v10.0.0...v10.7.0\">1&nbsp;500 pull requests sur GitHub</a>&nbsp;:</p>\n\n\n\n<p><a href=\"https://profiles.wordpress.org/5ubliminal/\">5ubliminal</a>, <a href=\"https://profiles.wordpress.org/ninetyninew/\">99w</a>, <a href=\"https://profiles.wordpress.org/9primus/\">9primus</a>, <a href=\"https://profiles.wordpress.org/jorbin/\">Aaron Jorbin</a>, <a href=\"https://profiles.wordpress.org/aaronrobertshaw/\">aaronrobertshaw</a>, <a href=\"https://profiles.wordpress.org/abderrahman/\">abderrahman</a>, <a href=\"https://profiles.wordpress.org/webcommsat/\">Abha Thakor</a>, <a href=\"https://profiles.wordpress.org/abhijitrakas/\">Abhijit Rakas</a>, <a href=\"https://profiles.wordpress.org/achbed/\">achbed</a>, <a href=\"https://profiles.wordpress.org/adamsilverstein/\">Adam Silverstein</a>, <a href=\"https://profiles.wordpress.org/zieladam/\">Adam Zielinski</a>, <a href=\"https://profiles.wordpress.org/addiestavlo/\">Addie</a>, <a href=\"https://profiles.wordpress.org/aduth/\">aduth</a>, <a href=\"https://profiles.wordpress.org/chaion07/\">Ahmed Chaion</a>, <a href=\"https://profiles.wordpress.org/engahmeds3ed/\">Ahmed Saeed</a>, <a href=\"https://profiles.wordpress.org/ajitbohra/\">Ajit Bohra</a>, <a href=\"https://profiles.wordpress.org/schlessera/\">Alain Schlesser</a>, <a href=\"https://profiles.wordpress.org/alanjacobmathew/\">alanjacobmathew</a>, <a href=\"https://profiles.wordpress.org/aljullu/\">Albert Juhé Lluveras</a>, <a href=\"https://profiles.wordpress.org/al