\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:104:\"https://fr.wordpress.org/2021/07/04/guide-des-changements-techniques-a-venir-sur-wordpress-5-8/#comments\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Sun, 04 Jul 2021 10:30:50 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:2:{i:0;a:5:{s:4:\"data\";s:5:\"Guide\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:1;a:5:{s:4:\"data\";s:31:\"Nouvelles versions de WordPress\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:32:\"https://fr.wordpress.org/?p=2124\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:376:\"La version 5.8 de WordPress prévue pour le 20 juillet 2021 n’apportera pas moins de 96 améliorations et nouvelles fonctionnalités, 170 correctifs de bugs et 24 autres modifications diverses. Cela correspond au total à 291 tickets sur Trac, l&#8217;outil que nous utilisons pour organiser le développement de WordPress. Dans ce guide, vous retrouverez tous les [&#8230;]\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:9:\"enclosure\";a:1:{i:0;a:5:{s:4:\"data\";s:0:\"\";s:7:\"attribs\";a:1:{s:0:\"\";a:3:{s:3:\"url\";s:84:\"https://fr.wordpress.org/files/2021/07/wordpress-5-8-delete-menus-maxime-pertici.mp4\";s:6:\"length\";s:6:\"410124\";s:4:\"type\";s:9:\"video/mp4\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:9:\"Jb Audras\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:38080:\"\n<div class=\"wp-block-cover has-background-dim\"><img loading=\"lazy\" width=\"1978\" height=\"1254\" class=\"wp-block-cover__image-background wp-image-2126\" alt=\"\" src=\"https://fr.wordpress.org/files/2021/06/wp-5-8-about-page-cover.png\" data-object-fit=\"cover\" srcset=\"https://fr.wordpress.org/files/2021/06/wp-5-8-about-page-cover.png 1978w, https://fr.wordpress.org/files/2021/06/wp-5-8-about-page-cover-300x190.png 300w, https://fr.wordpress.org/files/2021/06/wp-5-8-about-page-cover-1024x649.png 1024w, https://fr.wordpress.org/files/2021/06/wp-5-8-about-page-cover-768x487.png 768w, https://fr.wordpress.org/files/2021/06/wp-5-8-about-page-cover-1536x974.png 1536w\" sizes=\"(max-width: 1978px) 100vw, 1978px\" /><div class=\"wp-block-cover__inner-container\">\n<h2>La sortie de WordPress 5.8 est<br>prévue pour le 20 juillet 2021</h2>\n\n\n\n<p>Découvrez dans ce guide les nouveautés techniques qui vous attendent pour cette nouvelle version de l’outil qui propulse plus de 42% du web&nbsp;!</p>\n</div></div>\n\n\n\n<p>La version 5.8 de WordPress prévue pour le 20 juillet 2021 n’apportera pas moins de <a href=\"https://core.trac.wordpress.org/query?status=closed&amp;type=enhancement&amp;type=feature+request&amp;milestone=5.8&amp;max=500&amp;col=id&amp;col=summary&amp;col=type&amp;col=status&amp;col=milestone&amp;col=owner&amp;col=priority&amp;order=priority\">96 améliorations et nouvelles fonctionnalités</a>, <a href=\"https://core.trac.wordpress.org/query?status=closed&amp;type=defect+(bug)&amp;milestone=5.8&amp;max=500&amp;col=id&amp;col=summary&amp;col=type&amp;col=status&amp;col=milestone&amp;col=owner&amp;col=priority&amp;order=priority\">170 correctifs de bugs</a> et <a href=\"https://core.trac.wordpress.org/query?status=closed&amp;type=task+(blessed)&amp;milestone=5.8&amp;max=500&amp;col=id&amp;col=summary&amp;col=type&amp;col=status&amp;col=milestone&amp;col=owner&amp;col=priority&amp;order=priority\">24 autres modifications diverses</a>. Cela correspond au total à <a href=\"https://core.trac.wordpress.org/query?status=closed&amp;milestone=5.8&amp;group=component&amp;col=id&amp;col=summary&amp;col=owner&amp;col=type&amp;col=priority&amp;col=component&amp;col=version&amp;order=priority\">291 tickets sur Trac</a>, l&rsquo;outil que nous utilisons pour organiser le développement de WordPress.</p>\n\n\n\n<p>Dans ce guide, vous retrouverez tous les changements majeurs apportés par la version 5.8 de WordPress.</p>\n\n\n\n<p>Pour chaque composant de WordPress concerné par un changement majeur, vous trouverez un paragraphe introductif en français suivi des notes de développement et autres ressources publiées par l&rsquo;équipe de développement de WordPress, en anglais.</p>\n\n\n\n<span id=\"more-2124\"></span>\n\n\n\n<h2>Un premier pas vers l&rsquo;édition complète de votre site avec Gutenberg</h2>\n\n\n\n<p>Toutes les versions de Gutenberg sorties entre WP 5.7 et aujourd&rsquo;hui ont été intégrées dans WordPress 5.8. Ainsi, la prochaine version de WordPress contiendra les versions <a href=\"https://make.wordpress.org/core/2021/02/17/whats-new-in-gutenberg-10-0-february/\">10.0</a>, <a href=\"https://make.wordpress.org/core/2021/03/02/whats-new-in-gutenberg-10-1-3-march/\">10.1</a>, <a href=\"https://make.wordpress.org/core/2021/03/17/whats-new-in-gutenberg-10-2-17-march/\">10.2</a>, <a href=\"https://make.wordpress.org/core/2021/04/02/whats-new-in-gutenberg-10-3-31-march/\">10.3</a>, <a href=\"https://make.wordpress.org/core/2021/04/14/whats-new-in-gutenberg-10-4-14-april/\">10.4</a>, <a href=\"https://make.wordpress.org/core/2021/04/30/whats-new-in-gutenberg-10-5-28-april/\">10.5</a>, <a href=\"https://make.wordpress.org/core/2021/05/14/whats-new-in-gutenberg-10-6-12-may/\">10.6</a> et <a href=\"https://make.wordpress.org/core/2021/05/27/whats-new-in-gutenberg-10-7-26-may/\">10.7</a> de l&rsquo;extension Gutenberg. Par ailleurs, les correctifs et améliorations de performances des versions <a href=\"https://make.wordpress.org/core/2021/06/10/whats-new-in-gutenberg-10-8-9-june/\">10.8</a> et <a href=\"https://make.wordpress.org/core/2021/06/24/whats-new-in-gutenberg-10-9-23-june/\">10.9</a> seront également intégrées dans WP&nbsp;5.8.</p>\n\n\n\n<p><a href=\"https://wordpress.org/news/2021/06/wordpress-5-8-beta-1/\">L&rsquo;annonce de sortie de la version beta 1 de WordPress 5.8</a> présente de nombreuses améliorations et nouvelles fonctionnalités.</p>\n\n\n\n<p>WordPress 5.8 est une version un peu spéciale, car elle contient les premières briques de l&rsquo;édition complète de site, une fonctionnalité connue en anglais sous le nom de <em>«&nbsp;FSE&nbsp;»</em> pour <em>«&nbsp;Full Site Editing&nbsp;»</em>. Vous retrouverez ci-dessous les nouveautés apportées par cette nouvelle fonctionnalité, dont l&rsquo;arrivée dans WordPress sera répartie entre les versions 5.8 et 5.9 de WP.</p>\n\n\n\n<p>Premièrement, commençons par présenter l&rsquo;introduction du fichier <code>theme.json</code>, utilisable par les thèmes prenant en charge l&rsquo;édition complète de sites pour déclarer les fonctionnalités supportées par le thème.</p>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"w8UV72ClgX\"><a href=\"https://make.wordpress.org/core/2021/06/25/introducing-theme-json-in-wordpress-5-8/\">Introducing theme.json in WordPress 5.8</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;Introducing theme.json in WordPress 5.8&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2021/06/25/introducing-theme-json-in-wordpress-5-8/embed/#?secret=w8UV72ClgX\" data-secret=\"w8UV72ClgX\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<p>Cet article présente quant à lui le nouvel éditeur de modèles disponible à partir de WP 5.8, et comment rendre votre thème compatible&nbsp;:</p>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"es1csQoiTx\"><a href=\"https://make.wordpress.org/core/2021/06/29/on-layout-and-content-width-in-wordpress-5-8/\">On layout and content width in WordPress 5.8</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;On layout and content width in WordPress 5.8&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2021/06/29/on-layout-and-content-width-in-wordpress-5-8/embed/#?secret=es1csQoiTx\" data-secret=\"es1csQoiTx\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<p>Pour créer le nouvel éditeur de modèles basé sur Gutenberg, il a été nécessaire d&rsquo;isoler l&rsquo;éditeur dans un contexte autre que celui de l&rsquo;édition d&rsquo;une publication. Cet article présente la démarche qui a été suivie pour cette nouvelle fonctionnalité de WP 5.8.</p>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"ShMB0FsNYJ\"><a href=\"https://make.wordpress.org/core/2021/06/16/introducing-the-template-editor-in-wordpress-5-8/\">Introducing the template editor in WordPress 5.8</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;Introducing the template editor in WordPress 5.8&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2021/06/16/introducing-the-template-editor-in-wordpress-5-8/embed/#?secret=ShMB0FsNYJ\" data-secret=\"ShMB0FsNYJ\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<p>La note de développement ci-dessous présente le nouvel éditeur de widgets embarqué dans WP 5.8. Si vous souhaitez garder l&rsquo;ancien écran de widgets de WordPress, vous pouvez installer l&rsquo;extension <a href=\"https://fr.wordpress.org/plugins/classic-widgets/\">Classic Widgets</a> dès à présent sur votre site.</p>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"3MHyLuLV2p\"><a href=\"https://make.wordpress.org/core/2021/06/29/block-based-widgets-editor-in-wordpress-5-8/\">Block-based Widgets Editor in WordPress 5.8</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;Block-based Widgets Editor in WordPress 5.8&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2021/06/29/block-based-widgets-editor-in-wordpress-5-8/embed/#?secret=3MHyLuLV2p\" data-secret=\"3MHyLuLV2p\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<p>Cette note de développement décrit quant à elle les modifications faites sur l’API de l&rsquo;éditeur de blocs. Le fichier de métadonnées <code>block.json</code> devient la façon normale de déclarer un bloc Gutenberg, la spécification des métadonnées de blocs est lancée et sera développée de façon itérative dans les prochaines versions. Cet article propose aussi de nombreux exemples d&rsquo;implémentation très utiles si vous développez régulièrement des blocs Gutenberg.</p>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"hxJO8ZqA05\"><a href=\"https://make.wordpress.org/core/2021/06/23/block-api-enhancements-in-wordpress-5-8/\">Block API Enhancements in WordPress 5.8</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;Block API Enhancements in WordPress 5.8&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2021/06/23/block-api-enhancements-in-wordpress-5-8/embed/#?secret=hxJO8ZqA05\" data-secret=\"hxJO8ZqA05\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<p>Un changement longtemps attendu : l&rsquo;écran de modification des publications n&rsquo;est plus le seul écran de l&rsquo;administration a pouvoir accueillir l&rsquo;éditeur de blocs. Ce sera dorénavant aussi le cas de l&rsquo;écran des widgets, et pour WordPress 5.9 de l&rsquo;écran des menus. Dans un futur proche, il sera possible d&rsquo;intégrer l&rsquo;éditeur sur n&rsquo;importe quelle écran de l&rsquo;administration. Ces évolutions demandent de revoir certaines parties du fonctionnement général de l&rsquo;éditeur de blocs et cet article présente les changements qui arrivent dans un premier temps sur WP 5.8.</p>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"ME4MeIf0TJ\"><a href=\"https://make.wordpress.org/core/2021/06/16/block-editor-api-changes-to-support-multiple-admin-screens-in-wp-5-8/\">Block Editor API Changes to Support Multiple Admin Screens in WP 5.8</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;Block Editor API Changes to Support Multiple Admin Screens in WP 5.8&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2021/06/16/block-editor-api-changes-to-support-multiple-admin-screens-in-wp-5-8/embed/#?secret=ME4MeIf0TJ\" data-secret=\"ME4MeIf0TJ\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<p>Cette note de développement présente les fonctionnalités de Gutenberg qui ont été dépréciées dans WP 5.8. Pour éviter des avertissements et erreurs sur vos développements, consultez cette note de développement et mettez à jour votre code&nbsp;:</p>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"gJoIVtykTI\"><a href=\"https://make.wordpress.org/core/2021/06/29/block-editor-api-removals-58/\">Various Block Editor API removals in WordPress 5.8</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;Various Block Editor API removals in WordPress 5.8&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2021/06/29/block-editor-api-removals-58/embed/#?secret=gJoIVtykTI\" data-secret=\"gJoIVtykTI\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<p>Cette note de développement présente la nouvelle API de réglages et de styles globaux. Cette API vous permet de définir dans votre thème des réglages et styles prédéfinis.</p>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"ZwJIunoY2d\"><a href=\"https://make.wordpress.org/core/2021/06/29/blocks-in-an-iframed-template-editor/\">Blocks in an iframed (template) editor</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;Blocks in an iframed (template) editor&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2021/06/29/blocks-in-an-iframed-template-editor/embed/#?secret=ZwJIunoY2d\" data-secret=\"ZwJIunoY2d\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<p>Pour finir avec l&rsquo;éditeur, WordPress&nbsp;5.8 comprend aussi plusieurs améliorations concernant le chargement des styles CSS associés aux blocs, pour de meilleures performances et un meilleur contrôle des feuilles de styles associées </p>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"Pm4Aq7nwpg\"><a href=\"https://make.wordpress.org/core/2021/07/01/block-styles-loading-enhancements-in-wordpress-5-8/\">Block-styles loading enhancements in WordPress 5.8</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;Block-styles loading enhancements in WordPress 5.8&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2021/07/01/block-styles-loading-enhancements-in-wordpress-5-8/embed/#?secret=Pm4Aq7nwpg\" data-secret=\"Pm4Aq7nwpg\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h2>Médiathèque</h2>\n\n\n\n<p><a href=\"https://core.trac.wordpress.org/query?status=closed&amp;component=Media&amp;milestone=5.8&amp;group=component&amp;col=id&amp;col=summary&amp;col=owner&amp;col=type&amp;col=priority&amp;col=component&amp;col=version&amp;order=priority\">Parmi toutes les modifications dans le composant «&nbsp;Médias&nbsp;» de WordPress</a>, c&rsquo;est sans aucun doute l&rsquo;arrivée de la prise en charge native du format WebP qui est le changement le plus important. Cette prise en charge du format WebP est complète, et tous les filtres et crochets d&rsquo;actions disponibles sur le reste des fichiers médias sont également disponibles pour vos médias au format WebP, qui est un format beaucoup plus performant que les «&nbsp;antiques&nbsp;» formats PNG ou JPEG. Accompagnés du nouveau filtre <code>image_editor_output_format</code>, ces changements posent les bases de bonnes améliorations de performances en perspective.</p>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"WtrYvObnKA\"><a href=\"https://make.wordpress.org/core/2021/06/07/wordpress-5-8-adds-webp-support/\">WordPress 5.8 adds WebP support</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;WordPress 5.8 adds WebP support&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2021/06/07/wordpress-5-8-adds-webp-support/embed/#?secret=WtrYvObnKA\" data-secret=\"WtrYvObnKA\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<p>Vous noterez également quelques améliorations sur l&rsquo;écran Médiathèque de l&rsquo;administration. Par exemple, le défilement infini au sein de la médiathèque posant un certain nombre de problèmes d&rsquo;accessibilité et d&rsquo;utilisabilité générale, nous l&rsquo;avons remplacé par un bouton de chargement dynamique en AJAX (tickets <a href=\"https://core.trac.wordpress.org/ticket/50105\">#50105</a> et <a href=\"https://core.trac.wordpress.org/ticket/40330\">#40330</a>). Nous avons aussi ajouté un bouton permettant de copier-coller rapidement le permalien vers les fichiers de la médiathèque après les avoir téléversés (ticket <a href=\"https://core.trac.wordpress.org/ticket/51754\">#51754</a>).</p>\n\n\n\n<h2>Menus</h2>\n\n\n\n<p>Une nouvelle fonctionnalité a été ajoutée sur l&rsquo;écran de gestion des menus. Celle-ci permet de sélectionner plusieurs éléments de menus afin de les supprimer en un clic, alors que cette opération était particulièrement longue à faire manuellement. Bravo au français <a href=\'https://profiles.wordpress.org/maxpertici/\' class=\'mention\'><span class=\'mentions-prefix\'>@</span>maxpertici</a> qui a travaillé sur le développement de cette nouvelle fonctionnalité intégrée dans WP&nbsp;5.8, résolvant ainsi <a href=\"https://core.trac.wordpress.org/ticket/21603\">un ticket datant de plus de 9 ans</a>.</p>\n\n\n\n<figure class=\"wp-block-video\"><video controls src=\"https://fr.wordpress.org/files/2021/07/wordpress-5-8-delete-menus-maxime-pertici.mp4\"></video></figure>\n\n\n\n<h2>Changement concernant la gestion des extensions</h2>\n\n\n\n<p>WordPress 5.8 introduit un nouveau champ d&rsquo;en-tête utilisable dans le fichier principal de vos extensions&nbsp;: le champ <code>Update URI</code>. Attendu depuis des années par les développeur et développeuses, cet en-tête permet aux personnes développant des extensions de définir la source depuis laquelle l&rsquo;extension peut être mise à jour. Cela permet d&rsquo;éviter que votre extension réalisée sur-mesure soit écrasée par une mise à jour d&rsquo;une extension portant le même nom et provenant du répertoire WordPress.org.</p>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"ETv1k1T7tI\"><a href=\"https://make.wordpress.org/core/2021/06/29/introducing-update-uri-plugin-header-in-wordpress-5-8/\">Introducing &#8220;Update URI&#8221; plugin header in WordPress 5.8</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;Introducing &#8220;Update URI&#8221; plugin header in WordPress 5.8&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2021/06/29/introducing-update-uri-plugin-header-in-wordpress-5-8/embed/#?secret=ETv1k1T7tI\" data-secret=\"ETv1k1T7tI\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<p>À noter que ce changement ne sera pour l&rsquo;instant disponible que pour les extensions. Le même changement sera opéré sur les thèmes dans WordPress 5.9 si l&rsquo;expérience s&rsquo;avère concluante.</p>\n\n\n\n<h2>API REST</h2>\n\n\n\n<p>Cette note de développement présente toutes les modifications de l&rsquo;API REST ayant été faites sur WordPress&nbsp;5.8. La plupart de ces modifications concernent évidemment l&rsquo;éditeur de widget, qui a nécessité la création d&rsquo;un grand nombre de points de terminaison au sein de l&rsquo;API REST. Longtemps attendue par les développeuses et les développeurs utilisant l&rsquo;API REST, la prise en charge de l&rsquo;opérateur de comparaison <code>AND</code> a été ajouté à l&rsquo;API.<br>D&rsquo;autres changements mineurs sur l&rsquo;API REST sont également présentés.</p>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"TjZRGpgbDw\"><a href=\"https://make.wordpress.org/core/2021/06/29/rest-api-changes-in-wordpress-5-8/\">REST API Changes in WordPress 5.8</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;REST API Changes in WordPress 5.8&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2021/06/29/rest-api-changes-in-wordpress-5-8/embed/#?secret=TjZRGpgbDw\" data-secret=\"TjZRGpgbDw\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h2>Santé du site</h2>\n\n\n\n<p>Encore un changement attendu depuis longtemps&nbsp;! En utilisant quelques filtres, crochets d&rsquo;action, et fonctions PHP, les développeurs et développeuses d&rsquo;extensions ont maintenant la possibilité de créer leurs propres onglets au sein de l’écran de Santé du site.</p>\n\n\n\n<p>WordPress 5.8 propose aussi de nouvelles informations, notamment une liste des types de fichiers pris en charges par l&rsquo;installation pour le module PHP d’édition d’images actif sur le serveur (ticket <a href=\"https://core.trac.wordpress.org/ticket/53022\">#53022</a>).</p>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"jFT4GGBqsS\"><a href=\"https://make.wordpress.org/core/2021/06/22/extending-the-site-health-interface-in-wordpress-5-8/\">Extending the Site Health interface in WordPress 5.8</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;Extending the Site Health interface in WordPress 5.8&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2021/06/22/extending-the-site-health-interface-in-wordpress-5-8/embed/#?secret=jFT4GGBqsS\" data-secret=\"jFT4GGBqsS\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h2>Thèmes natifs proposés par WordPress</h2>\n\n\n\n<p>Avec l&rsquo;arrivée partielle de l&rsquo;édition complète de site sur WP 5.8, il était nécessaire de proposer davantage d&rsquo;exemples de compositions de blocs au sein des thèmes natifs proposés par le cœur de WordPress. Et c&rsquo;est chose faite, en attendant l&rsquo;arrivée du prochain thème natif qui sera traditionnellement proposé par la dernière version de l&rsquo;année –WordPress 5.9– et qui sera évidemment nommé <em>Twenty&nbsp;Twenty-Two</em>&nbsp;!</p>\n\n\n\n<p>Notons également l’arrivée de deux nouveaux crochets d’action,&nbsp;<code>delete_theme</code>&nbsp;et&nbsp;<code>deleted_theme</code>&nbsp;(ticket <a href=\"https://core.trac.wordpress.org/ticket/16401\">#16401</a>), de plusieurs améliorations de l’interface de gestion des thèmes pour mieux mettre en évidence les thèmes enfants&nbsp;(ticket <a href=\"https://core.trac.wordpress.org/ticket/30240\">#30240</a>), du compteur de mises à jour disponibles dans le menu de l&rsquo;administration (ticket <a href=\"https://core.trac.wordpress.org/ticket/43697\">#43697</a>), et la suppression de l’onglet «&nbsp;Mis en avant&nbsp;» de l’écran d’ajout de thèmes (ticket <a href=\"https://core.trac.wordpress.org/ticket/49487\">#49487</a>).</p>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"p8kO9fNBXg\"><a href=\"https://make.wordpress.org/core/2021/06/21/bundled-themes-changes-in-wordpress-5-8/\">Bundled themes changes in WordPress 5.8</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;Bundled themes changes in WordPress 5.8&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2021/06/21/bundled-themes-changes-in-wordpress-5-8/embed/#?secret=p8kO9fNBXg\" data-secret=\"p8kO9fNBXg\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h2>Fin de la prise en charge d&rsquo;Internet Explorer&nbsp;11</h2>\n\n\n\n<p>Hé oui&nbsp;! WordPress cesse définitivement de prendre en charge Internet Explorer 11 (et donc Internet Explorer tout court). Du moins, en ce qui concerne l&rsquo;interface d&rsquo;administration. Un choix logique pris à l&rsquo;unanimité de l&rsquo;équipe de développement. En effet, ce navigateur en fin de vie représente depuis début 2021 moins de 1% de parts de marché des navigateurs. L&rsquo;arrêt de la prise en charge de cet ancien navigateur permettra d&rsquo;améliorer grandement les performances d&rsquo;affichage de l&rsquo;administration sur l&rsquo;ensemble des autres navigateurs, en débarrassant WordPress des règles CSS et <em>polyfills</em> JavaScript nécessaires à la prise en charge d&rsquo;IE&nbsp;11. Ces changements ne concernent que l&rsquo;interface d&rsquo;administration. Les thèmes seront quant à eux libres de prendre en charge ou non l&rsquo;antique IE&nbsp;11. </p>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-wordpress-news wp-block-embed-wordpress-news\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"ITMmCNTUqZ\"><a href=\"https://wordpress.org/news/2021/05/dropping-support-for-internet-explorer-11/\">Dropping support for Internet Explorer 11</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;Dropping support for Internet Explorer 11&#8221; &#8212; WordPress News\" src=\"https://wordpress.org/news/2021/05/dropping-support-for-internet-explorer-11/embed/#?secret=ITMmCNTUqZ\" data-secret=\"ITMmCNTUqZ\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h2>Autres changements techniques notables</h2>\n\n\n\n<p>Le composant Bootstrap/Load correspond à tout ce qui se passe lors du processus d&rsquo;initialisation et de chargement de WordPress. Dans cette note de développement, vous en saurez davantage sur les quelques changements associés à ce composant.</p>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"o4kX1ByqXv\"><a href=\"https://make.wordpress.org/core/2021/06/09/bootstrap-load-changes-in-5-8/\">Bootstrap/Load Changes in 5.8</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;Bootstrap/Load Changes in 5.8&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2021/06/09/bootstrap-load-changes-in-5-8/embed/#?secret=o4kX1ByqXv\" data-secret=\"o4kX1ByqXv\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<p>Enfin, voici une note de développement regroupant différents changements qui n&rsquo;avaient pas besoin d&rsquo;avoir leur propre note individuelle. Les changements abordés sont les suivants&nbsp;:</p>\n\n\n\n<ul><li>Outils de compilation et de test&nbsp;: suppression d’IE11 de la liste des navigateurs pris en charges (cela signifie qu’il n&rsquo;y aura plus de tests de non-regression sur IE11 à l’avenir)</li><li>Formatage&nbsp;: meilleure cohérence et contrôle du rendu de <code>wp_get_document_title()</code></li><li>Général&nbsp;: cohérence de la déclaration du type des propriétés des classes <code>WP_Post</code>, <code>WP_Term</code>, <code>WP_User</code></li><li>Publications et types de publications&nbsp;: utilisation de&nbsp;<code>_prime_post_caches()</code>&nbsp;pour de meilleures performances pour les appels à la fonction&nbsp;<code>get_pages()</code></li><li>Comptes&nbsp;: les actions et filtres associés à la fonction <code>wp_insert_user()</code> reçoivent maintenant le contenu des métadonnées de l’utilisateur·ice via la variable&nbsp;<code>$userdata</code></li><li>Médiathèque&nbsp;: ajout du filtre&nbsp;<code>image_editor_output_format</code></li><li>Général&nbsp;: tous les filtres de type&nbsp;<code>*_url</code>&nbsp;reçoivent maintenant le schéma d&rsquo;URL demandé</li><li>Publications et types de publications&nbsp;:&nbsp;améliorations de performances sur la fonction&nbsp;<code>post_exists()</code></li><li>Thèmes&nbsp;: ajout des crochets d’action <code>delete_theme</code>&nbsp;et&nbsp;<code>deleted_theme</code>&nbsp;</li><li>Publications et types de publications&nbsp;:&nbsp;les révisions sont maintenant disponibles par défaut pour le type de publication «&nbsp;blocs réutilisables&nbsp;» – <code>wp_block</code>&nbsp;</li><li>Publications et types de publications&nbsp;: amélioration de l&rsquo;extensibilité du filtre <code>the_password_form</code></li></ul>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"Ugc9GmEfsF\"><a href=\"https://make.wordpress.org/core/2021/06/28/miscellaneous-developer-focused-changes-in-wordpress-5-8/\">Miscellaneous developer focused changes in WordPress 5.8</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;Miscellaneous developer focused changes in WordPress 5.8&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2021/06/28/miscellaneous-developer-focused-changes-in-wordpress-5-8/embed/#?secret=Ugc9GmEfsF\" data-secret=\"Ugc9GmEfsF\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h2>Et bien plus encore…</h2>\n\n\n\n<p>WordPress&nbsp;5.8 contient bien d’autres améliorations et modifications !<br>Plus de <a href=\"https://core.trac.wordpress.org/query?status=closed&amp;type=defect+(bug)&amp;milestone=5.8&amp;group=component&amp;col=id&amp;col=summary&amp;col=type&amp;col=owner&amp;col=priority&amp;col=component&amp;col=version&amp;order=priority\">170 bugs</a> ont été corrigés,&nbsp;<a href=\"https://core.trac.wordpress.org/query?status=closed&amp;type=enhancement&amp;type=feature+request&amp;milestone=5.8&amp;group=component&amp;col=id&amp;col=summary&amp;col=type&amp;col=owner&amp;col=priority&amp;col=component&amp;col=version&amp;order=priority\">96 améliorations et nouvelles fonctionnalités</a> ont été implémentées et <a href=\"https://core.trac.wordpress.org/query?status=closed&amp;type=task+(blessed)&amp;milestone=5.8&amp;group=component&amp;col=id&amp;col=summary&amp;col=type&amp;col=owner&amp;col=priority&amp;col=component&amp;col=version&amp;order=priority\">24 tâches courantes</a> ont été&nbsp;<a href=\"https://core.trac.wordpress.org/query?status=closed&amp;milestone=5.7&amp;group=component&amp;col=id&amp;col=summary&amp;col=owner&amp;col=type&amp;col=priority&amp;col=component&amp;col=version&amp;order=priority\">clôturées dans WordPress 5.8</a>.</p>\n\n\n\n<p>Voici d’autres modifications qui n’ont pas été évoquées dans les notes de développement listées ci-dessus&nbsp;:</p>\n\n\n\n<ul><li>Outils de compilation et de test&nbsp;: remplacement de la bibliothèque&nbsp;<code>@babel/polyfill</code>&nbsp;par&nbsp;<code>core-js/stable</code>, ce qui nécessite l&rsquo;ajout de&nbsp;<code>regenerator-runtime</code>&nbsp;en tant que dépendance si la prise en charge d’IE11 est souhaitée sur votre site (<a href=\"https://core.trac.wordpress.org/ticket/52941\">#52941</a>)</li><li>Thèmes natifs&nbsp;: ajout de compositions de blocs sur les thèmes Twenty Ten à Twenty Fifteen (<a href=\"https://core.trac.wordpress.org/ticket/51107\">#51107</a>,&nbsp;<a href=\"https://core.trac.wordpress.org/ticket/51106\">#51106</a>,&nbsp;<a href=\"https://core.trac.wordpress.org/ticket/51105\">#51105</a>,&nbsp;<a href=\"https://core.trac.wordpress.org/ticket/51104\">#51104</a>,&nbsp;<a href=\"https://core.trac.wordpress.org/ticket/51103\">#51103</a>,&nbsp;<a href=\"https://core.trac.wordpress.org/ticket/51102\">#51102</a>)</li><li>Commentaires&nbsp;: ajout de la fonction manquante&nbsp;<code>comments_pagination_base</code>&nbsp;dans la fonction&nbsp;<code>get_comment_reply_link()</code> (<a href=\"https://core.trac.wordpress.org/ticket/51189\">#51189</a>)</li><li>Commentaires&nbsp;: dans l’administration, ajout du lien vers l’article seul sur la liste des articles (<a href=\"https://core.trac.wordpress.org/ticket/52353\">#52353</a>)</li><li>Contenus embarqués&nbsp;: implémentation des contenus embarqués sur les blocs de widgets (<a href=\"https://core.trac.wordpress.org/ticket/51566\">#51566</a>)</li><li>Emojis&nbsp;: mise à jour de la bibliothèque <code>Twemoji</code>&nbsp;de 13.0.1 vers 13.1.0 (<a href=\"https://core.trac.wordpress.org/ticket/52852\">#52852</a>)</li><li>Bibliothèques externes&nbsp;: mise à jour de la bibliothèque&nbsp;<code>jQuery</code>&nbsp;de 3.5.1 vers 3.6.0 (<a href=\"https://core.trac.wordpress.org/ticket/52707\">#52707</a>)</li><li>Bibliothèques externes&nbsp;: mise à jour de la bibliothèque&nbsp;<code>Moment.js</code>&nbsp;de 2.27.0 vers 2.29.1 (<a href=\"https://core.trac.wordpress.org/ticket/52853\">#52853</a>)</li><li>Bibliothèques externes&nbsp;: mise à jour de la bibliothèque&nbsp;<code>Requests</code>&nbsp;de 1.7.0 vers 1.8.1 (<a href=\"https://core.trac.wordpress.org/ticket/53101\">#53101</a>&nbsp;and&nbsp;<a href=\"https://core.trac.wordpress.org/ticket/53334\">#53334</a>)</li><li>Bibliothèques externes&nbsp;: mise à jour de la bibliothèque&nbsp;<code>Underscore</code>&nbsp;de 1.8.3 vers 1.13.1 (<a href=\"https://core.trac.wordpress.org/ticket/45785\">#45785</a>)</li><li>Médias&nbsp;: suppression de comportement de défilement infini de la bibliothèque de médias (<a href=\"https://core.trac.wordpress.org/ticket/50105\">#50105</a>)</li><li>Médias&nbsp;: ajout d&rsquo;un lien de copier-coller de la source d&rsquo;un média accessible après son téléversement (<a href=\"https://core.trac.wordpress.org/ticket/51754\">#51754</a>)</li><li>Menus&nbsp;: ajout de la possibilité de supprimer de multiples éléments de menus d&rsquo;un coup (<a href=\"https://core.trac.wordpress.org/ticket/21603\">#21603</a>)</li><li>Révisions&nbsp;: un nouveau filtre dynamique est disponible pour spécifier le nombre de révisions à conserver pour chaque type de publication,&nbsp;<code>wp_{$post-&gt;post_type}_revisions_to_keep</code>&nbsp;(<a href=\"https://core.trac.wordpress.org/ticket/51550\">#51550</a>)</li><li>Rôle/permissions&nbsp;:&nbsp;<code>user_can()</code>&nbsp;propose maintenant la permission&nbsp;<code>exist</code>&nbsp;afin d&rsquo;identifier les comptes anonymes (<a href=\"https://core.trac.wordpress.org/ticket/52076\">#52076</a>)</li><li>Mise à niveau/installation&nbsp;: suppression du parcours des fichiers&nbsp;<code>readme.txt</code> de la fonction <code>validate_plugin_requirements()</code>&nbsp;(<a href=\"https://core.trac.wordpress.org/ticket/48520\">#48520</a>)</li><li>Mise à niveau/installation&nbsp;: suppression d&rsquo;une erreur fatale PHP pouvant survenir si l’extension Gutenberg était activée et lorsque le site était mis à jour vers WP&nbsp;5.8 (<a href=\"https://core.trac.wordpress.org/ticket/53432\">#53432</a>)</li><li>Widgets&nbsp;: ajout d&rsquo;une sécurité permettant de s&rsquo;assurer que le constructeur&nbsp;<code>WP_Widget</code>&nbsp;créé bien une valeur correcte pour <code>classname</code>&nbsp;sur les classes de widgets disposant d&rsquo;un espace de nom (<a href=\"https://core.trac.wordpress.org/ticket/44098\">#44098</a>)</li><li>…et bien plus encore&nbsp;!</li></ul>\n\n\n\n<hr class=\"wp-block-separator\" />\n\n\n\n<p>Pour rappel, la sortie de WordPress 5.8 est prévue le 20 juillet 2021. Vous pouvez d’ores et déjà la tester en version&nbsp;<em>Release Candidate</em>&nbsp;en installant l’extension officielle&nbsp;<em>WordPress Beta Tester</em>&nbsp;puis en allant dans ses réglages et en cochant la case&nbsp;Beta / Version de développement puis en mettant à jour votre installation de façon classique.</p>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-plugin-directory wp-block-embed-plugin-directory\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"zv9jX9AbIL\"><a href=\"https://fr.wordpress.org/plugins/wordpress-beta-tester/\">WordPress Beta Tester</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"« WordPress Beta Tester » &#8212; Plugin Directory\" src=\"https://fr.wordpress.org/plugins/wordpress-beta-tester/embed/#?secret=zv9jX9AbIL\" data-secret=\"zv9jX9AbIL\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<p class=\"has-text-align-right\"><em>Merci à&nbsp;<a href=\'https://profiles.wordpress.org/jdy68/\' class=\'mention\'><span class=\'mentions-prefix\'>@</span>jdy68</a> pour la relecture de ce guide.</em></p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:100:\"https://fr.wordpress.org/2021/07/04/guide-des-changements-techniques-a-venir-sur-wordpress-5-8/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"3\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:8;a:6:{s:4:\"data\";s:76:\"\n		\n		\n					\n		\n		\n		\n				\n		\n		\n\n					\n										\n					\n					\n			\n		\n		\n			\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:5:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"WordPress fête ses 18 ans !\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:62:\"https://fr.wordpress.org/2021/05/27/wordpress-fete-ses-18-ans/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:71:\"https://fr.wordpress.org/2021/05/27/wordpress-fete-ses-18-ans/#comments\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 27 May 2021 09:26:25 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:2:{i:0;a:5:{s:4:\"data\";s:11:\"Évènement\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:1;a:5:{s:4:\"data\";s:13:\"WordPress.org\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:32:\"https://fr.wordpress.org/?p=2117\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:365:\"Aujourd&#8217;hui est un grand jour pour la communauté WordPress, car il s’agit du dix-huitième anniversaire de notre CMS favori&#160;! Il y a à peine 3 ans, nous célébrions nos quinze ans en organisant des évènements un peu partout dans le monde entier, et voilà que nous arrivons aujourd&#8217;hui à l&#8217;age de la majorité 😎 WordPress [&#8230;]\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:9:\"Jb Audras\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:1513:\"\n<p>Aujourd&rsquo;hui est un grand jour pour la communauté WordPress, car il s’agit du dix-huitième anniversaire de notre CMS favori&nbsp;!</p>\n\n\n\n<p>Il y a à peine 3 ans, nous célébrions nos quinze ans <a href=\"https://wp15.wordpress.net/\">en organisant des évènements</a> un peu partout dans le monde entier, et voilà que nous arrivons aujourd&rsquo;hui à l&rsquo;age de la majorité <img src=\"https://s.w.org/images/core/emoji/13.1.0/72x72/1f60e.png\" alt=\"😎\" class=\"wp-smiley\" style=\"height: 1em; max-height: 1em;\" /></p>\n\n\n\n<p>WordPress propulse désormais plus de 40 % du web. Une belle façon de fêter nos 18 ans !</p>\n\n\n\n<p>Nous vous proposons de redécouvrir le chemin parcouru en toutes ces années sur cette petite <a href=\"https://fr.wordpress.org/40-percent-of-web/\">frise chronologique</a>.</p>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-francais wp-block-embed-francais\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"YPOlv6WP3r\"><a href=\"https://fr.wordpress.org/40-percent-of-web/\">WordPress and the Journey to 40% of the Web</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"« WordPress and the Journey to 40% of the Web » &#8212; Français\" src=\"https://fr.wordpress.org/40-percent-of-web/embed/#?secret=YPOlv6WP3r\" data-secret=\"YPOlv6WP3r\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:67:\"https://fr.wordpress.org/2021/05/27/wordpress-fete-ses-18-ans/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"2\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:9;a:6:{s:4:\"data\";s:73:\"\n		\n		\n					\n		\n		\n		\n				\n		\n\n					\n										\n					\n					\n			\n		\n		\n			\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:5:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:80:\"Le 30 avril 2021, rejoignez-nous pour un nouveau WordPress Translation Day FR !\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:113:\"https://fr.wordpress.org/2021/04/09/le-30-avril-2021-rejoignez-nous-pour-un-nouveau-wordpress-translation-day-fr/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:122:\"https://fr.wordpress.org/2021/04/09/le-30-avril-2021-rejoignez-nous-pour-un-nouveau-wordpress-translation-day-fr/#comments\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 09 Apr 2021 10:33:25 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:1:{i:0;a:5:{s:4:\"data\";s:11:\"Évènement\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:32:\"https://fr.wordpress.org/?p=2028\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:372:\"Les WordCamps et Meetups ne sont toujours pas à l&#8217;ordre du jour… mais la communauté WordPress s&#8217;organise&#160;! Cette année, les équipes de traduction et de documentation de WP en français vous proposent de participer à un nouveau WordPress Translation Day FR en ligne le vendredi 30 avril 2021. Cet évènement se déroulera donc le vendredi [&#8230;]\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:9:\"Jb Audras\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:2462:\"\n<p>Les WordCamps et Meetups ne sont toujours pas à l&rsquo;ordre du jour… mais la communauté WordPress s&rsquo;organise&nbsp;!</p>\n\n\n\n<p>Cette année, les équipes de traduction et de documentation de WP en français vous proposent de participer à un nouveau WordPress Translation Day FR en ligne le vendredi 30 avril 2021.</p>\n\n\n\n<figure class=\"wp-block-image size-large\"><a href=\"https://fr.wordpress.org/files/2021/04/wp-translation-day-fr-avril-2021-1.png\"><img loading=\"lazy\" width=\"1024\" height=\"487\" src=\"https://fr.wordpress.org/files/2021/04/wp-translation-day-fr-avril-2021-1-1024x487.png\" alt=\"\" class=\"wp-image-2038\" srcset=\"https://fr.wordpress.org/files/2021/04/wp-translation-day-fr-avril-2021-1-1024x487.png 1024w, https://fr.wordpress.org/files/2021/04/wp-translation-day-fr-avril-2021-1-300x143.png 300w, https://fr.wordpress.org/files/2021/04/wp-translation-day-fr-avril-2021-1-768x365.png 768w, https://fr.wordpress.org/files/2021/04/wp-translation-day-fr-avril-2021-1.png 1467w\" sizes=\"(max-width: 1024px) 100vw, 1024px\" /></a></figure>\n\n\n\n<p>Cet évènement se déroulera donc le vendredi 30 avril de 14h à 18h, en visioconférence via Zoom.</p>\n\n\n\n<p>Durant cette après-midi 4 GTE (<em>General Translation Editors</em>) seront présents pour vous aider (<a href=\"https://profile.wordpress.org/jdy68\">Jenny Dupuy</a>, <a href=\"https://profile.wordpress.org/fxbenard\">FX Bénard</a>, <a href=\"https://profile.wordpress.org/wolforg\">Didier Wolforg</a> et <a href=\"https://profile.wordpress.org/audrasjb\">Jb Audras</a>) ainsi que les responsables de la documentation de WordPress en français (<a href=\"https://profile.wordpress.org/chaton666\">Marie Comet</a> et <a href=\"https://profile.wordpress.org/jdy68\">Jenny Dupuy</a>).</p>\n\n\n\n<p>L’objectif est d’accueillir, orienter et accompagner un maximum de nouvelles personnes pour les initier à la traduction du cœur de WordPress, mais aussi des thèmes, des extensions et de la documentation relative au fonctionnement de ce CMS.</p>\n\n\n\n<p>Tout au long de l’après-midi nous accueillerons les personnes désireuses de participer et si besoin, nous organiserons des mini-formations pour aider les personnes débutantes.</p>\n\n\n\n<p>Nous vous attendons nombreuses et nombreux ! Alors rendez-vous sur le Slack de la communauté WordPress-fr&nbsp;:&nbsp;<a href=\"https://wpfr.net/slack/\">https://wpfr.net/slack/</a>&nbsp;puis dans le canal&nbsp;<strong>#wptranslationday</strong></p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:118:\"https://fr.wordpress.org/2021/04/09/le-30-avril-2021-rejoignez-nous-pour-un-nouveau-wordpress-translation-day-fr/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"1\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}}}s:27:\"http://www.w3.org/2005/Atom\";a:1:{s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:0:\"\";s:7:\"attribs\";a:1:{s:0:\"\";a:3:{s: