Je vous ai préparé dans cette vidéo une présentation des nouveautés de notre CMS préféré : performance, ergonomie, nouveaux blocs, et ce fameux FSE (Full Site Editing) est-il compatible avec votre thème actuel, qu’est ce que cela vous apporte… Je vous explique tout ça en détail dans cette vidéo. Un aperçu des nouveautés côté administration : WordPress 5.9, ce qui vous attend la vidéo intégrale (12min.) Si vous avez des questions sur la version WordPress 5.9 laissez simplement un commentaire ci-dessous : nous nous ferons…\nL’article WordPress 5.9 ce qui vous attend dans cette nouvelle version est apparu en premier sur Agence WordPress Whodunit.\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"content\";a:1:{i:0;a:5:{s:4:\"data\";s:3172:\"\n        \n<p>WordPress 5.9 sort la semaine prochaine et cette nouvelle version majeure apporte plein de changements 🙌 <br><br>Je vous ai préparé dans cette vidéo une présentation des nouveautés de notre CMS préféré : performance, ergonomie, nouveaux blocs, et ce fameux FSE (<a href=\"https://www.whodunit.fr/fse-ou-le-full-site-editing/\" target=\"_blank\" rel=\"noreferrer noopener\">Full Site Editing</a>) est-il compatible avec votre thème actuel, qu&#8217;est ce que cela vous apporte&#8230; Je vous explique tout ça en détail dans cette vidéo.</p>\n\n\n\n<h2 id=\"h-un-apercu-des-nouveautes-cote-administration\" data-block-type=\"core\">Un aperçu des nouveautés côté administration :</h2>\n\n\n\n<figure class=\"wp-block-gallery columns-3\" data-block-type=\"core\"><ul class=\"blocks-gallery-grid\"><li class=\"blocks-gallery-item\"><figure><img width=\"273\" height=\"398\" src=\"https://www.whodunit.fr/wp-content/uploads/2022/01/styles.png\" alt=\"\" data-id=\"73425\" data-full-url=\"https://www.whodunit.fr/wp-content/uploads/2022/01/styles.png\" data-link=\"https://www.whodunit.fr/wordpress-5-9-ce-qui-vous-attend-dans-cette-nouvelle-version/styles/\" class=\"wp-image-73425\" //><figcaption class=\"blocks-gallery-item__caption\">Des options pour les styles globaux</figcaption></figure></li><li class=\"blocks-gallery-item\"><figure><img width=\"334\" height=\"692\" src=\"https://www.whodunit.fr/wp-content/uploads/2022/01/listview.png\" alt=\"\" data-id=\"73424\" data-full-url=\"https://www.whodunit.fr/wp-content/uploads/2022/01/listview.png\" data-link=\"https://www.whodunit.fr/wordpress-5-9-ce-qui-vous-attend-dans-cette-nouvelle-version/listview/\" class=\"wp-image-73424\" //><figcaption class=\"blocks-gallery-item__caption\">Collapse et ancres dans la vue liste</figcaption></figure></li><li class=\"blocks-gallery-item\"><figure><img width=\"273\" height=\"587\" src=\"https://www.whodunit.fr/wp-content/uploads/2022/01/couleurpersonnalises.png\" alt=\"\" data-id=\"73423\" data-full-url=\"https://www.whodunit.fr/wp-content/uploads/2022/01/couleurpersonnalises.png\" data-link=\"https://www.whodunit.fr/wordpress-5-9-ce-qui-vous-attend-dans-cette-nouvelle-version/couleurpersonnalises/\" class=\"wp-image-73423\" //><figcaption class=\"blocks-gallery-item__caption\">Couleurs personnalisées</figcaption></figure></li></ul></figure>\n\n\n\n<h2 id=\"h-wordpress-5-9-ce-qui-vous-attend-la-video-integrale-12min\" data-block-type=\"core\"><span class=\"stk-highlight\">WordPress 5.9, ce qui vous attend</span> <br>la vidéo intégrale (12min.)</h2>\n\n\n\n<figure class=\"wp-block-embed is-type-video is-provider-youtube wp-block-embed-youtube wp-embed-aspect-16-9 wp-has-aspect-ratio\"><div class=\"wp-block-embed__wrapper\">\n\n</div></figure>\n\n\n\n<p><br>Si vous avez des questions sur la version WordPress 5.9 laissez simplement un commentaire ci-dessous : nous nous ferons une joie de vous répondre 🙂</p>\n\n\n\n<p></p>\n<p>L’article <a rel=\"nofollow\" href=\"https://www.whodunit.fr/wordpress-5-9-ce-qui-vous-attend-dans-cette-nouvelle-version/\">WordPress 5.9 ce qui vous attend dans cette nouvelle version</a> est apparu en premier sur <a rel=\"nofol