resse à tous les sujets et dévore les podcasts et émissions, que ce soit sur les jeux de société, WordPress,…\nL’article WOA ! #14 Bonus Noël Live ! est apparu en premier sur Agence WordPress Whodunit.\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"content\";a:1:{i:0;a:5:{s:4:\"data\";s:9045:\"\n        \n\n\n\n\n<p><strong>A écouter également sur :</strong></p>\n\n\n\n<div class=\"wp-block-columns\" data-block-type=\"core\">\n<div class=\"wp-block-column\" data-block-type=\"core\">\n<figure class=\"wp-block-image size-large\" data-block-type=\"core\"><a href=\"https://podcasts.apple.com/fr/podcast/woa-wordpress-on-air/id1482779414\" target=\"_blank\" rel=\"noopener noreferrer\"><img src=\"https://www.whodunit.fr/wp-content/uploads/2019/10/apple-podcasts-e1571142591535.jpg\" alt=\"\" class=\"wp-image-66447\" //></a></figure>\n</div>\n\n\n\n<div class=\"wp-block-column\" data-block-type=\"core\">\n<figure class=\"wp-block-image size-large\" data-block-type=\"core\"><a href=\"https://open.spotify.com/show/5rEMqG2cyoKYxpTTUAKSPp\" target=\"_blank\" rel=\"noopener noreferrer\"><img src=\"https://www.whodunit.fr/wp-content/uploads/2019/10/unknown.png\" alt=\"\" class=\"wp-image-66448\" //></a></figure>\n</div>\n\n\n\n<div class=\"wp-block-column\" data-block-type=\"core\">\n<figure class=\"wp-block-image size-large\" data-block-type=\"core\"><a href=\"https://www.deezer.com/fr/show/586602\" target=\"_blank\" rel=\"noopener noreferrer\"><img src=\"https://www.whodunit.fr/wp-content/uploads/2019/10/deezer-1024x196.png\" alt=\"\" class=\"wp-image-66449\" //></a></figure>\n</div>\n\n\n\n<div class=\"wp-block-column\" data-block-type=\"core\">\n<figure class=\"wp-block-image size-large\" data-block-type=\"core\"><a href=\"http://podplayer.net/?podId=2447675\" target=\"_blank\" rel=\"noopener noreferrer\"><img src=\"https://www.whodunit.fr/wp-content/uploads/2019/10/podcast-addict-for-windows-pc.jpg\" alt=\"\" class=\"wp-image-66450\" //></a></figure>\n</div>\n</div>\n\n\n\n<h2 id=\"h-woa-wordpress-on-air-n-14\" data-block-type=\"core\">WOA : WordPress On Air N°14</h2>\n\n\n\n<p>Fin de l&rsquo;année 2021, c&rsquo;est l&rsquo;occasion de prendre des nouvelles de nos anciens invités. Nous avons enregistré cet épisode bonus en live en présence de certains auditeurs et plusieurs de nos anciens invités. Rachel et JB ont tenté de nous coller avec un petit quizz WordPress et nous avons pris des nouvelles de chacun de nos invités.  </p>\n\n\n\n<div style=\"height:20px\" aria-hidden=\"true\" class=\"wp-block-spacer\" data-block-type=\"core\"></div>\n\n\n\n<h2 id=\"h-nos-invites\" data-block-type=\"core\">Nos invités</h2>\n\n\n\n<div class=\"wp-block-group\" data-block-type=\"core\"><div class=\"wp-block-group__inner-container\">\n<figure class=\"wp-block-gallery columns-3 is-cropped\" data-block-type=\"core\"><ul class=\"blocks-gallery-grid\"><li class=\"blocks-gallery-item\"><figure><img width=\"500\" height=\"500\" src=\"https://www.whodunit.fr/wp-content/uploads/2021/10/olivier-gorzalka.jpg\" alt=\"\" data-id=\"73062\" data-full-url=\"https://www.whodunit.fr/wp-content/uploads/2021/10/olivier-gorzalka.jpg\" data-link=\"https://www.whodunit.fr/woa-12-maintenance-eco-conception/olivier-gorzalka/\" class=\"wp-image-73062\" //><figcaption class=\"blocks-gallery-item__caption\">Olivier Gorzalka</figcaption></figure></li><li class=\"blocks-gallery-item\"><figure><img width=\"960\" height=\"960\" src=\"https://www.whodunit.fr/wp-content/uploads/2021/10/stephanie_vachon.jpeg\" alt=\"\" data-id=\"73061\" data-full-url=\"https://www.whodunit.fr/wp-content/uploads/2021/10/stephanie_vachon.jpeg\" data-link=\"https://www.whodunit.fr/woa-12-maintenance-eco-conception/stephanie_vachon/\" class=\"wp-image-73061\" //><figcaption class=\"blocks-gallery-item__caption\">Stéphanie Vachon</figcaption></figure></li><li class=\"blocks-gallery-item\"><figure><img width=\"395\" height=\"395\" src=\"https://www.whodunit.fr/wp-content/uploads/2021/06/alexandre-derocq.jpeg\" alt=\"\" data-id=\"72502\" data-full-url=\"https://www.whodunit.fr/wp-content/uploads/2021/06/alexandre-derocq.jpeg\" data-link=\"https://www.whodunit.fr/woa-11-parlons-newsletter-avec-acymailing/alexandre-derocq/\" class=\"wp-image-72502\" //><figcaption class=\"blocks-gallery-item__caption\">Alexandre Derocq</figcaption></figure></li><li class=\"blocks-gallery-item\"><figure><img width=\"400\" height=\"400\" src=\"https://www.whodunit.fr/wp-content/uploads/2021/06/loic-blascos.jpg\" alt=\"\" data-id=\"72051\" data-full-url=\"https://www.whodunit.fr/wp-content/uploads/2021/06/loic-blascos.jpg\" data-link=\"https://www.whodunit.fr/woa-1-le-podcast-wordpress-de-lagence-whodunit/loic-blascos/\" class=\"wp-image-72051\" //><figcaption class=\"blocks-gallery-item__caption\">Loïc Blascos</figcaption></figure></li><li class=\"blocks-gallery-item\"><figure><img width=\"430\" height=\"440\" src=\"https://www.whodunit.fr/wp-content/uploads/2021/06/lycia-diaz.jpg\" alt=\"\" data-id=\"71942\" data-full-url=\"https://www.whodunit.fr/wp-content/uploads/2021/06/lycia-diaz.jpg\" data-link=\"https://www.whodunit.fr/woa-8-le-podcast-wordpress-de-agence-whodunit/lycia-diaz/\" class=\"wp-image-71942\" //><figcaption class=\"blocks-gallery-item__caption\">Lycia Diaz.</figcaption></figure></li><li class=\"blocks-gallery-item\"><figure><img width=\"396\" height=\"396\" src=\"https://www.whodunit.fr/wp-content/uploads/2021/06/nicolas-mercatili.jpeg\" alt=\"\" data-id=\"71937\" data-full-url=\"https://www.whodunit.fr/wp-content/uploads/2021/06/nicolas-mercatili.jpeg\" data-link=\"https://www.whodunit.fr/woa-9-le-podcast-wordpress-de-lagence-whodunit/nicolas-mercatili/\" class=\"wp-image-71937\" //><figcaption class=\"blocks-gallery-item__caption\">Nicolas Mercatili</figcaption></figure></li><li class=\"blocks-gallery-item\"><figure><img width=\"460\" height=\"460\" src=\"https://www.whodunit.fr/wp-content/uploads/2021/06/jonathan.jpg\" alt=\"\" data-id=\"71908\" data-full-url=\"https://www.whodunit.fr/wp-content/uploads/2021/06/jonathan.jpg\" data-link=\"https://www.whodunit.fr/woa-10-parlons-performance-avec-jonathan-buttigieg/jonathan/\" class=\"wp-image-71908\" //><figcaption class=\"blocks-gallery-item__caption\">Jonathan Buttigieg</figcaption></figure></li><li class=\"blocks-gallery-item\"><figure><img width=\"400\" height=\"224\" src=\"https://www.whodunit.fr/wp-content/uploads/2022/01/a4-021_scruberthumbnail_1.jpg\" alt=\"\" data-id=\"73355\" data-full-url=\"https://www.whodunit.fr/wp-content/uploads/2022/01/a4-021_scruberthumbnail_1.jpg\" data-link=\"https://www.whodunit.fr/?attachment_id=73355\" class=\"wp-image-73355\" //><figcaption class=\"blocks-gallery-item__caption\">Frédéric Demarle</figcaption></figure></li></ul></figure>\n</div></div>\n\n\n\n<div class=\"wp-block-group alignfull\" data-block-type=\"core\"><div class=\"wp-block-group__inner-container\"></div></div>\n\n\n\n<div style=\"height:17px\" aria-hidden=\"true\" class=\"wp-block-spacer\" data-block-type=\"core\"></div>\n\n\n\n<h2 id=\"h-l-equipe\" data-block-type=\"core\">L&rsquo;équipe</h2>\n\n\n\n<p><strong>Simon</strong> est un enfant de <s>la TV</s> Youtube, il s’intéresse à tous les sujets et dévore les podcasts et émissions, que ce soit sur les jeux de société, WordPress, la science ou encore la bière&nbsp;!</p>\n\n\n\n<p><strong>JB</strong> est une encyclopédie sur pattes de son CMS préféré. Devinez ce qu&rsquo;il a gravé dans <a href=\"https://twitter.com/AudrasJb/status/1189955528782471169\" target=\"_blank\" rel=\"noreferrer noopener\">sa citrouille</a> pour Halloween&nbsp;?</p>\n\n\n\n<p><strong>Eddy</strong> a goûté au plaisir de la radio pendant plusieurs années, ça le démangeait de reprendre le micro.</p>\n\n\n\n<figure class=\"wp-block-gallery columns-3 is-cropped\" data-block-type=\"core\"><ul class=\"blocks-gallery-grid\"><li class=\"blocks-gallery-item\"><figure><img width=\"425\" height=\"425\" src=\"https://www.whodunit.fr/wp-content/uploads/2021/05/eddy.jpg\" alt=\"\" data-id=\"69730\" data-full-url=\"https://www.whodunit.fr/wp-content/uploads/2021/05/eddy.jpg\" data-link=\"https://www.whodunit.fr/agence-wordpress/eddy/\" class=\"wp-image-69730\" //><figcaption class=\"blocks-gallery-item__caption\">Eddy</figcaption></figure></li><li class=\"blocks-gallery-item\"><figure><img width=\"425\" height=\"425\" src=\"https://www.whodunit.fr/wp-content/uploads/2021/05/simon.jpg\" alt=\"\" data-id=\"69748\" data-full-url=\"https://www.whodunit.fr/wp-content/uploads/2021/05/simon.jpg\" data-link=\"https://www.whodunit.fr/agence-wordpress/simon/\" class=\"wp-image-69748\" //><figcaption class=\"blocks-gallery-item__caption\">Simon</figcaption></figure></li><li class=\"blocks-gallery-item\"><figure><img width=\"425\" height=\"425\" src=\"https://www.whodunit.fr/wp-content/uploads/2021/05/jean-baptiste.jpg\" alt=\"\" data-id=\"69738\" data-full-url=\"https://www.whodunit.fr/wp-content/uploads/2021/05/jean-baptiste.jpg\" data-link=\"https://www.whodunit.fr/agence-wordpress/jean-baptiste/\" class=\"wp-image-69738\" //><figcaption class=\"blocks-gallery-item__caption\">Jb</figcaption></figure></li></ul></figure>\n\n\n\n<h2 id=\"h-on-attend-vos-retours-avec-impatience\" data-block-type=\"core\">On attend vos retours avec impatience&nbsp;!</h2>\n\n\n\n<p>N&rsquo;hésitez pas à laisser un commentaire, ça nous fera plaisir et surtout ça nous aidera à nous améliorer.</p>\n\n\n\n<p>Vous souhaitez intervenir ? Envoyez un mail à eddy@whodunit.fr pour en discuter.</p>\n<p>L’article <a rel=\"nofollow\" href=\"https://www.whodunit.fr/woa-14-bonus-noel-live/\">WOA ! #14 Bonus Noël Live !</a> est apparu en premier sur <a rel=\"nofollow\" href=\"https://www.whodunit.fr\">Agence WordPress Whodunit</a>.</p>\n\n    \";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:4:\"type\";s:4:\"html\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:6:\"author\";a