iteorigin.com\">SiteOrigin</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:14:\"Andrew Misplon\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:1422:\"<p>SiteOrigin CSS version <code>1.5.0</code> includes an editor theme option. Choose between the default Light theme or switch to a Dark Theme.</p>\n<p>The Editor Theme setting is located in the right column at <span class=\"adminized-section\"><span class=\"adminized-part\">Appearance</span><span class=\"adminized-arrow icon-arrow-right\"></span><span class=\"adminized-part\">Custom CSS</span></span>.</p>\n<div id=\"attachment_349371\" style=\"width: 375px\" class=\"wp-caption alignnone\"><img aria-describedby=\"caption-attachment-349371\" src=\"https://siteorigin.com/wp-content/uploads/2022/01/editor-theme-setting.png\" alt=\"\" width=\"355\" height=\"266\" class=\"size-full wp-image-349371\" style=\"max-width: 355px\" /><p id=\"caption-attachment-349371\" class=\"wp-caption-text\">Switch editor themes using the setting in the right column at Appearance > Custom CSS.</p></div>\n<p>If you have any queries or requests, please, let us know. Free support is available on the <a href=\"https://siteorigin.com/thread/\">SiteOrigin forum</a>. Quick email support with a wide scope is available <a href=\"mailto:support@siteorigin.com\">via email</a> for all SiteOrigin Premium users.</p>\n<p>Thanks for reading.</p>\n<p>The post <a rel=\"nofollow\" href=\"https://siteorigin.com/dark-theme-now-available-in-siteorigin-css/\">Dark Theme Now Available in SiteOrigin CSS</a> appeared first on <a rel=\"nofollow\" href=\"https://siteorigin.com\">SiteOrigin</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:71:\"https://siteorigin.com/dark-theme-now-available-in-siteorigin-css/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"0\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:1;a:6:{s:4:\"data\";s:76:\"\n		\n		\n					\n		\n		\n		\n				\n		\n		\n\n					\n										\n					\n					\n			\n		\n		\n			\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:5:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:54:\"WPML Translation Editor – Page Builder Compatibility\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:74:\"https://siteorigin.com/wpml-translation-editor-page-builder-compatibility/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:82:\"https://siteorigin.com/wpml-translation-editor-page-builder-compatibility/#respond\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 01 Dec 2021 13:27:02 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:2:{i:0;a:5:{s:4:\"data\";s:13:\"Announcements\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:1;a:5:{s:4:\"data\";s:7:\"Plugins\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:32:\"https://siteorigin.com/?p=342053\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:544:\"<p>We\'re excited to announce that Page Builder is now compatible with the WPML Advanced Translation Editor. Translate your SiteOrigin Page Builder and Widgets Bundle content quickly and easily using the Automatic Translation option or manually translating the available strings.</p>\n<p>The post <a rel=\"nofollow\" href=\"https://siteorigin.com/wpml-translation-editor-page-builder-compatibility/\">WPML Translation Editor &#8211; Page Builder Compatibility</a> appeared first on <a rel=\"nofollow\" href=\"https://siteorigin.com\">SiteOrigin</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:14:\"Andrew Misplon\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:5184:\"<p>We&#8217;re excited to announce that Page Builder is now compatible with the <a href=\"https://wpml.org/?aid=88702&amp;affiliate_key=V5z6Km6VwAK0\">WPML Advanced Translation Editor</a>. Translate your SiteOrigin Page Builder and Widgets Bundle content quickly and easily using the Automatic Translation option or manually translating the available strings.</p>\n<p><em>WPML&#8217;s Advanced Translation Editor allows you and your translators to work more quickly and easily while providing better translations. The editor comes with key features like machine translation, a glossary, translation memory, spell checker, HTML-less editing, and more.</em><br />\n<a href=\"https://wpml.org/documentation/translating-your-contents/advanced-translation-editor/?aid=88702&amp;affiliate_key=V5z6Km6VwAK0\">Find out more about the WPML Advanced Translation Editor</a>.</p>\n<h3>Translating SiteOrigin Page Builder Pages Using WPML&#8217;s Translation Editor</h3>\n<p>Navigate to the page or post you&#8217;d like to translate. Locate the <span class=\"adminized-section\"><span class=\"adminized-part\">Language</span></span> meta box in the right column. With the <span class=\"adminized-section\"><span class=\"adminized-part\">Use WPML&#8217;s Translation Editor</span></span> option enabled, click on the plus icon corresponding to the language you&#8217;d like to translate.</p>\n<div id=\"attachment_341935\" style=\"width: 2570px\" class=\"wp-caption alignnone\"><img aria-describedby=\"caption-attachment-341935\" loading=\"lazy\" class=\"wp-image-341935 size-full\" src=\"https://siteorigin.com/wp-content/uploads/2021/11/language-meta-box.jpg\" alt=\"\" width=\"2560\" height=\"1366\" srcset=\"https://siteorigin.com/wp-content/uploads/2021/11/language-meta-box.jpg 2560w, https://siteorigin.com/wp-content/uploads/2021/11/language-meta-box-300x160.jpg 300w, https://siteorigin.com/wp-content/uploads/2021/11/language-meta-box-699x373.jpg 699w, https://siteorigin.com/wp-content/uploads/2021/11/language-meta-box-768x410.jpg 768w, https://siteorigin.com/wp-content/uploads/2021/11/language-meta-box-1536x820.jpg 1536w, https://siteorigin.com/wp-content/uploads/2021/11/language-meta-box-2048x1093.jpg 2048w, https://siteorigin.com/wp-content/uploads/2021/11/language-meta-box-1050x560.jpg 1050w, https://siteorigin.com/wp-content/uploads/2021/11/language-meta-box-313x167.jpg 313w\" sizes=\"(max-width: 2560px) 100vw, 2560px\" /><p id=\"caption-attachment-341935\" class=\"wp-caption-text\">Click on the plus icon corresponding to the language you&#8217;d like to translate.</p></div>\n<p>Use the WPML Translation Editor to translate the page content, either automatically using the <span class=\"adminized-section\"><span class=\"adminized-part\">Translate automatically</span></span> button or manually. Click the <span class=\"adminized-section\"><span class=\"adminized-part\">Complete</span></span> button when you&#8217;re done.</p>\n<div id=\"attachment_342233\" style=\"width: 2570px\" class=\"wp-caption alignnone\"><img aria-describedby=\"caption-attachment-342233\" loading=\"lazy\" src=\"https://siteorigin.com/wp-content/uploads/2021/12/wpml-advanced-translation-editor-scaled.jpg\" alt=\"\" width=\"2560\" height=\"1253\" class=\"size-full wp-image-342233\" srcset=\"https://siteorigin.com/wp-content/uploads/2021/12/wpml-advanced-translation-editor-scaled.jpg 2560w, https://siteorigin.com/wp-content/uploads/2021/12/wpml-advanced-translation-editor-300x147.jpg 300w, https://siteorigin.com/wp-content/uploads/2021/12/wpml-advanced-translation-editor-699x342.jpg 699w, https://siteorigin.com/wp-content/uploads/2021/12/wpml-advanced-translation-editor-768x376.jpg 768w, https://siteorigin.com/wp-content/uploads/2021/12/wpml-advanced-translation-editor-1536x752.jpg 1536w, https://siteorigin.com/wp-content/uploads/2021/12/wpml-advanced-translation-editor-2048x1003.jpg 2048w, https://siteorigin.com/wp-content/uploads/2021/12/wpml-advanced-translation-editor-1050x514.jpg 1050w, https://siteorigin.com/wp-content/uploads/2021/12/wpml-advanced-translation-editor-313x153.jpg 313w\" sizes=\"(max-width: 2560px) 100vw, 2560px\" /><p id=\"caption-attachment-342233\" class=\"wp-caption-text\">WPML Translation Editor interface.</p></div>\n<h3>Links</h3>\n<p><a href=\"https://siteorigin.com/page-builder/compatible-translation-plugins/using-page-builder-wpml/\">SiteOrigin Documentation: Using Page Builder with WPML</a>.<br />\n<a href=\"https://wpml.org/documentation/plugins-compatibility/using-wpml-siteorigin/?aid=88702&amp;affiliate_key=V5z6Km6VwAK0\" rel=\"noopener\" target=\"_blank\">WPML Documentation: Using WPML with SiteOrigin Page Builder</a>.</p>\n<p>Thanks for reading. We hope you find the enhanced SiteOrigin &#8211; WPML integration useful. If you have any queries or comments, please, let us know below. If you&#8217;re a SiteOrigin Premium user, please, email <a href=\"mailto:support@siteorigin.com\" rel=\"noopener\" target=\"_blank\">support@siteorigin.com</a> as queries arise.</p>\n<p>The post <a rel=\"nofollow\" href=\"https://siteorigin.com/wpml-translation-editor-page-builder-compatibility/\">WPML Translation Editor &#8211; Page Builder Compatibility</a> appeared first on <a rel=\"nofollow\" href=\"https://siteorigin.com\">SiteOrigin</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:79:\"https://siteorigin.com/wpml-translation-editor-page-builder-compatibility/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"0\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:2;a:6:{s:4:\"data\";s:76:\"\n		\n		\n					\n		\n		\n		\n				\n		\n		\n\n					\n										\n					\n					\n			\n		\n		\n			\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:5:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:76:\"Link an entire Page Builder row, cell, or widget with the Link Overlay Addon\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:98:\"https://siteorigin.com/link-an-entire-page-builder-row-cell-or-widget-with-the-link-overlay-addon/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:106:\"https://siteorigin.com/link-an-entire-page-builder-row-cell-or-widget-with-the-link-overlay-addon/#respond\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Sun, 21 Nov 2021 09:31:31 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:2:{i:0;a:5:{s:4:\"data\";s:13:\"Announcements\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:1;a:5:{s:4:\"data\";s:7:\"Plugins\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:32:\"https://siteorigin.com/?p=337527\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:516:\"<p>We\'re thrilled to announce the Link Overlay Addon recently introduced in SiteOrigin Premium version <code>1.27.0</code>. The Link Overlay Addon allows easy linking of any Page Builder row, cell, or widget.</p>\n<p>The post <a rel=\"nofollow\" href=\"https://siteorigin.com/link-an-entire-page-builder-row-cell-or-widget-with-the-link-overlay-addon/\">Link an entire Page Builder row, cell, or widget with the Link Overlay Addon</a> appeared first on <a rel=\"nofollow\" href=\"https://siteorigin.com\">SiteOrigin</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:14:\"Andrew Misplon\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:7560:\"<div id=\"pl-337527\"  class=\"panel-layout\" ><div id=\"pg-337527-0\"  class=\"panel-grid panel-no-style\" ><div id=\"pgc-337527-0-0\"  class=\"panel-grid-cell\" ><div id=\"panel-337527-0-0-0\" class=\"so-panel widget widget_sow-editor panel-first-child panel-last-child\" data-index=\"0\" ><div class=\"so-widget-sow-editor so-widget-sow-editor-base\">\n<div class=\"siteorigin-widget-tinymce textwidget\">\n	<p>We\'re thrilled to announce the Link Overlay Addon recently introduced in SiteOrigin Premium version <code>1.27.0</code>. The Link Overlay Addon allows easy linking of any Page Builder row, cell, or widget.</p>\n</div>\n</div></div></div></div><div id=\"pg-337527-1\"  class=\"panel-grid panel-no-style\" ><div id=\"pgc-337527-1-0\"  class=\"panel-grid-cell\" ><div id=\"panel-337527-1-0-0\" class=\"so-panel widget widget_sow-editor panel-first-child panel-last-child\" data-index=\"1\" ><div class=\"so-widget-sow-editor so-widget-sow-editor-base\">\n<div class=\"siteorigin-widget-tinymce textwidget\">\n	<h3>Usage Example - Linking a Page Builder Row</h3>\n<p>Edit the row you\'d like to link by clicking the wrench icon followed by <span class=\"adminized-section\"><span class=\"adminized-part\">Edit Row</span></span>.</p>\n<p><img loading=\"lazy\" src=\"https://siteorigin.com/wp-content/uploads/2021/10/edit-page-builder-row.png\" alt=\"\" width=\"1876\" height=\"326\" class=\"alignnone size-full wp-image-336422\" srcset=\"https://siteorigin.com/wp-content/uploads/2021/10/edit-page-builder-row.png 1876w, https://siteorigin.com/wp-content/uploads/2021/10/edit-page-builder-row-300x52.png 300w, https://siteorigin.com/wp-content/uploads/2021/10/edit-page-builder-row-699x121.png 699w, https://siteorigin.com/wp-content/uploads/2021/10/edit-page-builder-row-768x133.png 768w, https://siteorigin.com/wp-content/uploads/2021/10/edit-page-builder-row-1536x267.png 1536w, https://siteorigin.com/wp-content/uploads/2021/10/edit-page-builder-row-1050x182.png 1050w, https://siteorigin.com/wp-content/uploads/2021/10/edit-page-builder-row-313x54.png 313w\" sizes=\"(max-width: 1876px) 100vw, 1876px\" /></p>\n<p>Next, locate and open the <span class=\"adminized-section\"><span class=\"adminized-part\">Link Overlay</span></span> settings section.</p>\n<p><img loading=\"lazy\" src=\"https://siteorigin.com/wp-content/uploads/2021/10/row-styles-link-overlay-2.png\" alt=\"\" width=\"580\" height=\"1046\" class=\"alignnone size-full wp-image-336421\" style=\"max-width: 290px\" srcset=\"https://siteorigin.com/wp-content/uploads/2021/10/row-styles-link-overlay-2.png 580w, https://siteorigin.com/wp-content/uploads/2021/10/row-styles-link-overlay-2-166x300.png 166w, https://siteorigin.com/wp-content/uploads/2021/10/row-styles-link-overlay-2-388x699.png 388w, https://siteorigin.com/wp-content/uploads/2021/10/row-styles-link-overlay-2-313x564.png 313w\" sizes=\"(max-width: 580px) 100vw, 580px\" /></p>\n<p><strong>URL</strong><br />\nEnter the URL you\'d like to link the row to. For example, to link the row to SiteOrigin.com, enter <code>https://siteorigin.com</code>.</p>\n<p><strong>Open link in new window</strong><br />\nEnable to open the link in a new browser window.</p>\n<p>The process is very similar for linking a <a href=\"https://siteorigin.com/premium-documentation/plugin-addons/link-overlay/#heading-linking-a-page-builder-cell\">cell</a> or <a href=\"https://siteorigin.com/premium-documentation/plugin-addons/link-overlay/#heading-linking-a-page-builder-widget\">widget</a>.</p>\n</div>\n</div></div></div></div><div id=\"pg-337527-2\"  class=\"panel-grid panel-no-style\" ><div id=\"pgc-337527-2-0\"  class=\"panel-grid-cell\" ><div id=\"panel-337527-2-0-0\" class=\"so-panel widget widget_sow-editor panel-first-child\" data-index=\"2\" ><div class=\"so-widget-sow-editor so-widget-sow-editor-base\">\n<div class=\"siteorigin-widget-tinymce textwidget\">\n	<h3>Addon Demo</h3>\n<p>A SiteOrigin Editor has been used to insert the text below. The entire widget is linked to the addon documentation page at <a href=\"https://siteorigin.com/premium-documentation/plugin-addons/link-overlay/#heading-linking-a-page-builder-widget.\">https://siteorigin.com/premium-documentation/plugin-addons/link-overlay/#heading-linking-a-page-builder-widget.</a></p>\n</div>\n</div><a href=\"https://siteorigin.com/premium-documentation/plugin-addons/link-overlay/#heading-linking-a-page-builder-widget\" target=\"_blank\" rel=\"noopener noreferrer\" class=\"so-premium-link-overlay\">&nbsp;</a></div><div id=\"panel-337527-2-0-1\" class=\"so-panel widget widget_sow-editor panel-last-child\" data-index=\"3\" ><div class=\"panel-widget-style panel-widget-style-for-337527-2-0-1\" ><div class=\"so-widget-sow-editor so-widget-sow-editor-base\">\n<div class=\"siteorigin-widget-tinymce textwidget\">\n	<p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Donec fringilla maximus ipsum. In tincidunt auctor viverra. Nam posuere, enim quis tempus eleifend, urna mauris commodo neque, quis vehicula lacus diam in nisl. Quisque semper dui id ante lacinia, eu dapibus libero interdum. Aenean sed dictum turpis. Vivamus vel dui quam. Quisque luctus malesuada nulla facilisis rutrum. Vivamus pharetra elit ex, non lacinia purus pulvinar quis. Praesent mi turpis, pellentesque at fringilla at, dapibus nec felis. Nulla blandit blandit volutpat. Etiam tincidunt et arcu sit amet facilisis. Maecenas vel purus est.</p>\n<p>Morbi hendrerit, arcu id semper dapibus, tellus leo laoreet risus, at facilisis massa libero sit amet elit. Maecenas ac sapien quam. Curabitur a blandit massa. Etiam rutrum, leo eu euismod convallis, quam felis lacinia dolor, at tempus urna odio quis risus. Sed viverra ultrices volutpat. Sed ut dui at elit facilisis pulvinar. Proin vel odio ac nisl laoreet consectetur sit amet in diam. Phasellus vehicula et ipsum vel ullamcorper.</p>\n</div>\n</div><a href=\"https://siteorigin.com/premium-documentation/plugin-addons/link-overlay/#heading-linking-a-page-builder-widget\" target=\"_blank\" rel=\"noopener noreferrer\" class=\"so-premium-link-overlay\">&nbsp;</a></div></div></div></div><div id=\"pg-337527-3\"  class=\"panel-grid panel-no-style\" ><div id=\"pgc-337527-3-0\"  class=\"panel-grid-cell\" ><div id=\"panel-337527-3-0-0\" class=\"so-panel widget widget_sow-editor panel-first-child panel-last-child\" data-index=\"4\" ><div class=\"so-widget-sow-editor so-widget-sow-editor-base\">\n<div class=\"siteorigin-widget-tinymce textwidget\">\n	<h3>Documentation</h3>\n<p>Find out more about the Link Overlay Addon in the <a href=\"https://siteorigin.com/premium-documentation/plugin-addons/link-overlay/\">premium documentation</a>.</p>\n</div>\n</div></div></div></div><div id=\"pg-337527-4\"  class=\"panel-grid panel-no-style\" ><div id=\"pgc-337527-4-0\"  class=\"panel-grid-cell\" ><div id=\"panel-337527-4-0-0\" class=\"so-panel widget widget_sow-editor panel-first-child panel-last-child\" data-index=\"5\" ><div class=\"so-widget-sow-editor so-widget-sow-editor-base\">\n<div class=\"siteorigin-widget-tinymce textwidget\">\n	<h3>Support</h3>\n<p>Thanks for reading. If you have any queries or comments, please, let us know below. If you\'re a SiteOrigin Premium user, please, don\'t hesitate to email us on <a href=\"mailto:support@siteorigin.com\">support@siteorigin</a>. We also offer free support on the <a href=\"https://siteorigin.com/thread/\">SiteOrigin forum</a>.</p>\n</div>\n</div></div></div></div></div><p>The post <a rel=\"nofollow\" href=\"https://siteorigin.com/link-an-entire-page-builder-row-cell-or-widget-with-the-link-overlay-addon/\">Link an entire Page Builder row, cell, or widget with the Link Overlay Addon</a> appeared first on <a rel=\"nofollow\" href=\"https://siteorigin.com\">SiteOrigin</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:103:\"https://siteorigin.com/link-an-entire-page-builder-row-cell-or-widget-with-the-link-overlay-addon/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"0\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:3;a:6:{s:4:\"data\";s:77:\"\n		\n		\n					\n		\n		\n		\n				\n		\n		\n\n					\n										\n					\n					\n			\n		\n		\n\n			\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:5:{s:0:\"\";a:8:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:52:\"Speed up Your Workflow With the Multiple Media Addon\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:76:\"https://siteorigin.com/speed-up-your-workflow-with-the-multiple-media-addon/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:84:\"https://siteorigin.com/speed-up-your-workflow-with-the-multiple-media-addon/#respond\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 03 Nov 2021 19:23:13 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:2:{i:0;a:5:{s:4:\"data\";s:13:\"Announcements\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:1;a:5:{s:4:\"data\";s:7:\"Plugins\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:32:\"https://siteorigin.com/?p=337067\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:490:\"<p>We\'re excited to announce the SiteOrigin Premium Multiple Media Addon. Speed up your workflow by adding multiple frames at once to the following SiteOrigin widgets; Hero, Slider, Layout Slider, Image Grid, and Simple Masonry.</p>\n<p>The post <a rel=\"nofollow\" href=\"https://siteorigin.com/speed-up-your-workflow-with-the-multiple-media-addon/\">Speed up Your Workflow With the Multiple Media Addon</a> appeared first on <a rel=\"nofollow\" href=\"https://siteorigin.com\">SiteOrigin</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:9:\"enclosure\";a:1:{i:0;a:5:{s:4:\"data\";s:0:\"\";s:7:\"attribs\";a:1:{s:0:\"\";a:3:{s:3:\"url\";s:73:\"https://siteorigin.com/wp-content/uploads/2021/11/hero-multiple-media.mp4\";s:6:\"length\";s:7:\"6580056\";s:4:\"type\";s:9:\"video/mp4\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:14:\"Andrew Misplon\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:6357:\"<p>We&#8217;re excited to announce the <a href=\"https://siteorigin.com/downloads/premium/?featured_addon=plugin/multiple-media\">SiteOrigin Premium Multiple Media Addon</a>. Speed up your workflow by adding multiple frames at once to the following SiteOrigin widgets:</p>\n<ul>\n<li>Hero</li>\n<li>Slider</li>\n<li>Layout Slider</li>\n<li>Image Grid</li>\n<li>Simple Masonry</li>\n</ul>\n<p>Within each of the above widgets, you have the option to add frames individually. Once the Multiple Media Addon is activated, a new <span class=\"adminized-section\"><span class=\"adminized-part\">Add Media</span></span> button will be available that allows multiple frames to be inserted at once. Click the <span class=\"adminized-section\"><span class=\"adminized-part\">Add Media</span></span> button to select images in your Media Library. If you&#8217;re using a Mac, hold down the Command key while selecting images. If you’re using Windows, hold down the Control key while selecting images. Click the <span class=\"adminized-section\"><span class=\"adminized-part\">Set Media</span></span> button in the bottom right of the modal window to complete the process.</p>\n<div id=\"attachment_337138\" style=\"width: 2190px\" class=\"wp-caption alignnone\"><img aria-describedby=\"caption-attachment-337138\" loading=\"lazy\" src=\"https://siteorigin.com/wp-content/uploads/2021/11/siteorigin-hero-add-media.png\" alt=\"\" width=\"2180\" height=\"444\" class=\"size-full wp-image-337138\" srcset=\"https://siteorigin.com/wp-content/uploads/2021/11/siteorigin-hero-add-media.png 2180w, https://siteorigin.com/wp-content/uploads/2021/11/siteorigin-hero-add-media-300x61.png 300w, https://siteorigin.com/wp-content/uploads/2021/11/siteorigin-hero-add-media-699x142.png 699w, https://siteorigin.com/wp-content/uploads/2021/11/siteorigin-hero-add-media-768x156.png 768w, https://siteorigin.com/wp-content/uploads/2021/11/siteorigin-hero-add-media-1536x313.png 1536w, https://siteorigin.com/wp-content/uploads/2021/11/siteorigin-hero-add-media-2048x417.png 2048w, https://siteorigin.com/wp-content/uploads/2021/11/siteorigin-hero-add-media-1050x214.png 1050w, https://siteorigin.com/wp-content/uploads/2021/11/siteorigin-hero-add-media-313x64.png 313w\" sizes=\"(max-width: 2180px) 100vw, 2180px\" /><p id=\"caption-attachment-337138\" class=\"wp-caption-text\">Click the Add Media button to add multiple frames at once.</p></div>\n<div id=\"attachment_337144\" style=\"width: 2570px\" class=\"wp-caption alignnone\"><img aria-describedby=\"caption-attachment-337144\" loading=\"lazy\" src=\"https://siteorigin.com/wp-content/uploads/2021/11/add-multiple-media-scaled.jpg\" alt=\"\" width=\"2560\" height=\"1365\" class=\"size-full wp-image-337144\" srcset=\"https://siteorigin.com/wp-content/uploads/2021/11/add-multiple-media-scaled.jpg 2560w, https://siteorigin.com/wp-content/uploads/2021/11/add-multiple-media-300x160.jpg 300w, https://siteorigin.com/wp-content/uploads/2021/11/add-multiple-media-699x373.jpg 699w, https://siteorigin.com/wp-content/uploads/2021/11/add-multiple-media-768x410.jpg 768w, https://siteorigin.com/wp-content/uploads/2021/11/add-multiple-media-1536x819.jpg 1536w, https://siteorigin.com/wp-content/uploads/2021/11/add-multiple-media-2048x1092.jpg 2048w, https://siteorigin.com/wp-content/uploads/2021/11/add-multiple-media-1050x560.jpg 1050w, https://siteorigin.com/wp-content/uploads/2021/11/add-multiple-media-313x167.jpg 313w\" sizes=\"(max-width: 2560px) 100vw, 2560px\" /><p id=\"caption-attachment-337144\" class=\"wp-caption-text\">If you&#8217;re using a Mac, hold down the Command key while selecting images. If you&#8217;re using Windows, hold down the Control key while selecting images. Click Set Media to complete the process.</p></div>\n<p>Once the <span class=\"adminized-section\"><span class=\"adminized-part\">Set Media</span></span> button has been clicked, a frame will be created per image selected. You can then edit and customize each frame as required.</p>\n<div id=\"attachment_337142\" style=\"width: 2190px\" class=\"wp-caption alignnone\"><img aria-describedby=\"caption-attachment-337142\" loading=\"lazy\" src=\"https://siteorigin.com/wp-content/uploads/2021/11/siteorigin-hero-frames.png\" alt=\"\" width=\"2180\" height=\"754\" class=\"size-full wp-image-337142\" srcset=\"https://siteorigin.com/wp-content/uploads/2021/11/siteorigin-hero-frames.png 2180w, https://siteorigin.com/wp-content/uploads/2021/11/siteorigin-hero-frames-300x104.png 300w, https://siteorigin.com/wp-content/uploads/2021/11/siteorigin-hero-frames-699x242.png 699w, https://siteorigin.com/wp-content/uploads/2021/11/siteorigin-hero-frames-768x266.png 768w, https://siteorigin.com/wp-content/uploads/2021/11/siteorigin-hero-frames-1536x531.png 1536w, https://siteorigin.com/wp-content/uploads/2021/11/siteorigin-hero-frames-2048x708.png 2048w, https://siteorigin.com/wp-content/uploads/2021/11/siteorigin-hero-frames-1050x363.png 1050w, https://siteorigin.com/wp-content/uploads/2021/11/siteorigin-hero-frames-313x108.png 313w\" sizes=\"(max-width: 2180px) 100vw, 2180px\" /><p id=\"caption-attachment-337142\" class=\"wp-caption-text\">Once your images have been inserted you can edit each frame as required.</p></div>\n<div style=\"width: 944px;\" class=\"wp-video\"><!--[if lt IE 9]><script>document.createElement(\'video\');</script><![endif]-->\n<video class=\"wp-video-shortcode\" id=\"video-337067-1\" width=\"944\" height=\"531\" preload=\"metadata\" controls=\"controls\"><source type=\"video/mp4\" src=\"https://siteorigin.com/wp-content/uploads/2021/11/hero-multiple-media.mp4?_=1\" /><a href=\"https://siteorigin.com/wp-content/uploads/2021/11/hero-multiple-media.mp4\">https://siteorigin.com/wp-content/uploads/2021/11/hero-multiple-media.mp4</a></video></div>\n<p>Thanks for reading, we hope you find the Multiple Media Addon helpful. If you&#8217;d like to read the addon documentation, you can find it <a href=\"https://siteorigin.com/premium-documentation/plugin-addons/multiple-media/\">here</a>. If you have any queries or requests, please, let us know below. SiteOrigin Premium users can email <a href=\"mailto:support@siteorigin.com\">support@siteorigin.com</a> for fast and effective support.</p>\n<p>The post <a rel=\"nofollow\" href=\"https://siteorigin.com/speed-up-your-workflow-with-the-multiple-media-addon/\">Speed up Your Workflow With the Multiple Media Addon</a> appeared first on <a rel=\"nofollow\" href=\"https://siteorigin.com\">SiteOrigin</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:81:\"https://siteorigin.com/speed-up-your-workflow-with-the-multiple-media-addon/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"0\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:4;a:6:{s:4:\"data\";s:76:\"\n		\n		\n					\n		\n		\n		\n				\n		\n		\n\n					\n										\n					\n					\n			\n		\n		\n			\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:5:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:43:\"Unmute Slider Self-Hosted Background Videos\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:66:\"https://siteorigin.com/unmute-slide-self-hosted-background-videos/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:75:\"https://siteorigin.com/unmute-slide-self-hosted-background-videos/#comments\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 21 Oct 2021 20:28:26 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:2:{i:0;a:5:{s:4:\"data\";s:13:\"Announcements\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:1;a:5:{s:4:\"data\";s:7:\"Plugins\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:32:\"https://siteorigin.com/?p=335181\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:504:\"<p>SiteOrigin Widgets Bundle version <code>1.25.0</code> introduces a new Unmute icon setting to all Slider Widgets. The new setting applies to self-hosted background videos. Allow your users to optionally unmute slider background videos by clicking on an icon.</p>\n<p>The post <a rel=\"nofollow\" href=\"https://siteorigin.com/unmute-slide-self-hosted-background-videos/\">Unmute Slider Self-Hosted Background Videos</a> appeared first on <a rel=\"nofollow\" href=\"https://siteorigin.com\">SiteOrigin</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:14:\"Andrew Misplon\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:2713:\"<p>SiteOrigin Widgets Bundle version <code>1.25.0</code> introduces a new <span class=\"adminized-section\"><span class=\"adminized-part\">Unmute icon</span></span> setting to all Slider Widgets. The new setting applies to self-hosted background videos. Allow your users to optionally unmute slider background videos by clicking on an icon.</p>\n<h3>Demo</h3>\n<p><a href=\"https://demo.siteorigin.com/corp/slider-unmute-demo/\" rel=\"noopener\" target=\"_blank\">View a demo</a> using the SiteOrigin Hero Widget.</p>\n<h3>Widgets</h3>\n<p>The following SiteOrigin widgets offer the new slide background video unmute setting:</p>\n<ul>\n<li>Slider</li>\n<li>Layout Slider</li>\n<li>Hero</li>\n</ul>\n<h3>Settings</h3>\n<p>To display an unmute button on your slide background videos, navigate to any of the above-mentioned widgets and open the <span class=\"adminized-section\"><span class=\"adminized-part\">Slider Controls</span></span> section. There you&#8217;ll find the following new settings:</p>\n<p><strong>Unmute icon</strong><br />\nSlide background videos are muted. Enable to display an unmute/mute icon. Only applies to self-hosted videos.</p>\n<p><strong>Unmute icon position</strong><br />\nDefaults to Top right. The following options are available, Top right, Bottom right, Bottom left, Top left.</p>\n<div id=\"attachment_335185\" style=\"width: 1776px\" class=\"wp-caption alignnone\"><img aria-describedby=\"caption-attachment-335185\" loading=\"lazy\" src=\"https://siteorigin.com/wp-content/uploads/2021/10/unmute-icon-setting.png\" alt=\"\" width=\"1766\" height=\"267\" class=\"size-full wp-image-335185\" srcset=\"https://siteorigin.com/wp-content/uploads/2021/10/unmute-icon-setting.png 1766w, https://siteorigin.com/wp-content/uploads/2021/10/unmute-icon-setting-300x45.png 300w, https://siteorigin.com/wp-content/uploads/2021/10/unmute-icon-setting-699x106.png 699w, https://siteorigin.com/wp-content/uploads/2021/10/unmute-icon-setting-768x116.png 768w, https://siteorigin.com/wp-content/uploads/2021/10/unmute-icon-setting-1536x232.png 1536w, https://siteorigin.com/wp-content/uploads/2021/10/unmute-icon-setting-1050x159.png 1050w, https://siteorigin.com/wp-content/uploads/2021/10/unmute-icon-setting-313x47.png 313w\" sizes=\"(max-width: 1766px) 100vw, 1766px\" /><p id=\"caption-attachment-335185\" class=\"wp-caption-text\">Navigate to the Slider Controls section to find the Unmute icon setting.</p></div>\n<p>Thanks for reading. If you have any queries or comments, please, let us know below.</p>\n<p>The post <a rel=\"nofollow\" href=\"https://siteorigin.com/unmute-slide-self-hosted-background-videos/\">Unmute Slider Self-Hosted Background Videos</a> appeared first on <a rel=\"nofollow\" href=\"https://siteorigin.com\">SiteOrigin</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:71:\"https://siteorigin.com/unmute-slide-self-hosted-background-videos/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"2\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:5;a:6:{s:4:\"data\";s:76:\"\n		\n		\n					\n		\n		\n		\n				\n		\n		\n\n					\n										\n					\n					\n			\n		\n		\n			\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:5:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:50:\"Schedule Content Using the Toggle Visibility Addon\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:74:\"https://siteorigin.com/schedule-content-using-the-toggle-visibility-addon/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:83:\"https://siteorigin.com/schedule-content-using-the-toggle-visibility-addon/#comments\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Mon, 18 Oct 2021 20:12:51 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:2:{i:0;a:5:{s:4:\"data\";s:13:\"Announcements\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:1;a:5:{s:4:\"data\";s:7:\"Plugins\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:32:\"https://siteorigin.com/?p=334650\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:537:\"<p>The SiteOrigin Premium Toggle Visibility Addon now includes the option to schedule your content. Show or hide Page Builder rows or widgets using a customizable date range. When editing a row or widget, you\'ll find a new Scheduling setting within the Toggle Visibility section.</p>\n<p>The post <a rel=\"nofollow\" href=\"https://siteorigin.com/schedule-content-using-the-toggle-visibility-addon/\">Schedule Content Using the Toggle Visibility Addon</a> appeared first on <a rel=\"nofollow\" href=\"https://siteorigin.com\">SiteOrigin</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:14:\"Andrew Misplon\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:2048:\"<p>The SiteOrigin Premium Toggle Visibility Addon now includes the option to schedule your content. Show or hide Page Builder rows or widgets using a customizable date range. When editing a row or widget, you&#8217;ll find a new Scheduling setting within the Toggle Visibility section.</p>\n<p><strong>Scheduling</strong><br />\nEnable to display the scheduling section. Show or hide the row or widget between a selected date range. Once enabled, the following settings will be available.</p>\n<p><strong>Display:</strong> Choose between Show or Hide.<br />\n<strong>Date From:</strong> Select the date to show or hide the row or widget from.<br />\n<strong>Date To:</strong> Select the date to show or hide your row or widget to.</p>\n<h3>Toggle Visibility Logged In/Logged Out Using Shortcodes</h3>\n<p>The Toggle Visibility Addon has been expanded further to include a logged-in status shortcode. Content can be displayed or hidden based on a user&#8217;s logged-in status.</p>\n<p><code>[toggle_visibility logged=\"in\"]Only logged-in users will see this.[/toggle_visibility]</code></p>\n<p><code>[toggle_visibility logged=\"out\"]Only logged-out users will see this.[/toggle_visibility]</code></p>\n<p>The Toggle Visibility logged shortcode can be used anywhere text is added in your page.</p>\n<h3>Links</h3>\n<p><a href=\"https://siteorigin.com/downloads/premium/\">SiteOrigin Premium plugin page</a>.<br />\n<a href=\"https://siteorigin.com/premium-documentation/plugin-addons/toggle-visibility/\">Toggle Visibility Addon documentation</a>.</p>\n<p>Thanks for reading. If you have any questions or comments, please, let us know. If you&#8217;re a SiteOrigin Premium user and have any queries or requests, please, email <a href=\"mailto:support@siteorigin.com\">support@siteorigin.com</a> for quick support.</p>\n<p>The post <a rel=\"nofollow\" href=\"https://siteorigin.com/schedule-content-using-the-toggle-visibility-addon/\">Schedule Content Using the Toggle Visibility Addon</a> appeared first on <a rel=\"nofollow\" href=\"https://siteorigin.com\">SiteOrigin</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:79:\"https://siteorigin.com/schedule-content-using-the-toggle-visibility-addon/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"4\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:6;a:6:{s:4:\"data\";s:76:\"\n		\n		\n					\n		\n		\n		\n				\n		\n		\n\n					\n										\n					\n					\n			\n		\n		\n			\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:5:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:35:\"Ajax Saving Added to SiteOrigin CSS\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:59:\"https://siteorigin.com/ajax-saving-added-to-siteorigin-css/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:67:\"https://siteorigin.com/ajax-saving-added-to-siteorigin-css/#respond\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 12 Oct 2021 12:50:57 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:2:{i:0;a:5:{s:4:\"data\";s:13:\"Announcements\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:1;a:5:{s:4:\"data\";s:7:\"Plugins\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:32:\"https://siteorigin.com/?p=333637\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:373:\"<p>SiteOrigin CSS version <code>1.4.0</code> introduces Ajax saving. Save in the Expanded and Visual Editors without exiting to the Basic Editor.</p>\n<p>The post <a rel=\"nofollow\" href=\"https://siteorigin.com/ajax-saving-added-to-siteorigin-css/\">Ajax Saving Added to SiteOrigin CSS</a> appeared first on <a rel=\"nofollow\" href=\"https://siteorigin.com\">SiteOrigin</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:14:\"Andrew Misplon\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:3636:\"<p>SiteOrigin CSS version <code>1.4.0</code> introduces Ajax saving. Save in the Expanded and Visual Editors without exiting to the Basic Editor.</p>\n<p>The SiteOrigin CSS Expanded Mode workflow previously required the following steps:</p>\n<ul>\n<li>Open the expanded view.</li>\n<li>Make changes.</li>\n<li>Close the expanded view.</li>\n<li>Save in the Basic Editor.</li>\n</ul>\n<p>Similarly, the Visual Editor workflow previously required the following steps:</p>\n<ul>\n<li>Open the Visual Editor.</li>\n<li>Make changes.</li>\n<li>Close the Visual Editor.</li>\n<li>Save in the Basic Editor.</li>\n</ul>\n<p>Changes can now be saved in either the expanded or visual editor using the new save icon. <img loading=\"lazy\" src=\"https://siteorigin.com/wp-content/uploads/2021/10/ajax-save-button.png\" alt=\"\" width=\"60\" height=\"60\" class=\"alignnone size-full wp-image-333653\" style=\"display:inline-block;max-width:30px;vertical-align:bottom\" /></p>\n<div id=\"attachment_333651\" style=\"width: 1686px\" class=\"wp-caption alignnone\"><img aria-describedby=\"caption-attachment-333651\" loading=\"lazy\" src=\"https://siteorigin.com/wp-content/uploads/2021/10/expanded-editor-ajax-save-button.jpg\" alt=\"\" width=\"1676\" height=\"800\" class=\"size-full wp-image-333651\" srcset=\"https://siteorigin.com/wp-content/uploads/2021/10/expanded-editor-ajax-save-button.jpg 1676w, https://siteorigin.com/wp-content/uploads/2021/10/expanded-editor-ajax-save-button-300x143.jpg 300w, https://siteorigin.com/wp-content/uploads/2021/10/expanded-editor-ajax-save-button-699x334.jpg 699w, https://siteorigin.com/wp-content/uploads/2021/10/expanded-editor-ajax-save-button-768x367.jpg 768w, https://siteorigin.com/wp-content/uploads/2021/10/expanded-editor-ajax-save-button-1536x733.jpg 1536w, https://siteorigin.com/wp-content/uploads/2021/10/expanded-editor-ajax-save-button-1050x501.jpg 1050w, https://siteorigin.com/wp-content/uploads/2021/10/expanded-editor-ajax-save-button-313x149.jpg 313w\" sizes=\"(max-width: 1676px) 100vw, 1676px\" /><p id=\"caption-attachment-333651\" class=\"wp-caption-text\">Expanded Editor Ajax Save Button.</p></div>\n<div id=\"attachment_333648\" style=\"width: 1686px\" class=\"wp-caption alignnone\"><img aria-describedby=\"caption-attachment-333648\" loading=\"lazy\" class=\"wp-image-333648 size-full\" src=\"https://siteorigin.com/wp-content/uploads/2021/10/visual-editor-ajax-save-button-1.jpg\" alt=\"\" width=\"1676\" height=\"800\" srcset=\"https://siteorigin.com/wp-content/uploads/2021/10/visual-editor-ajax-save-button-1.jpg 1676w, https://siteorigin.com/wp-content/uploads/2021/10/visual-editor-ajax-save-button-1-300x143.jpg 300w, https://siteorigin.com/wp-content/uploads/2021/10/visual-editor-ajax-save-button-1-699x334.jpg 699w, https://siteorigin.com/wp-content/uploads/2021/10/visual-editor-ajax-save-button-1-768x367.jpg 768w, https://siteorigin.com/wp-content/uploads/2021/10/visual-editor-ajax-save-button-1-1536x733.jpg 1536w, https://siteorigin.com/wp-content/uploads/2021/10/visual-editor-ajax-save-button-1-1050x501.jpg 1050w, https://siteorigin.com/wp-content/uploads/2021/10/visual-editor-ajax-save-button-1-313x149.jpg 313w\" sizes=\"(max-width: 1676px) 100vw, 1676px\" /><p id=\"caption-attachment-333648\" class=\"wp-caption-text\">Visual Editor Ajax Save Button</p></div>\n<p>Thanks for reading. We hope you find the new Ajax save button useful. If you have any queries or requests, please, let us know in the comments below.</p>\n<p>The post <a rel=\"nofollow\" href=\"https://siteorigin.com/ajax-saving-added-to-siteorigin-css/\">Ajax Saving Added to SiteOrigin CSS</a> appeared first on <a rel=\"nofollow\" href=\"https://siteorigin.com\">SiteOrigin</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:64:\"https://siteorigin.com/ajax-saving-added-to-siteorigin-css/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"0\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:7;a:6:{s:4:\"data\";s:76:\"\n		\n		\n					\n		\n		\n		\n				\n		\n		\n\n					\n										\n					\n					\n			\n		\n		\n			\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:5:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:32:\"Announcing the Anything Carousel\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:56:\"https://siteorigin.com/announcing-the-anything-carousel/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:64:\"https://siteorigin.com/announcing-the-anything-carousel/#respond\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Mon, 26 Jul 2021 18:20:45 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:2:{i:0;a:5:{s:4:\"data\";s:13:\"Announcements\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:1;a:5:{s:4:\"data\";s:7:\"Plugins\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:32:\"https://siteorigin.com/?p=321887\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:572:\"<p>We\'re delighted to announce that a new carousel widget is now available in the Widgets Bundle, the <strong>Anything Carousel</strong>! Display images, text, or any other content in a carousel. We\'ve released the Anything Carousel with a clean wire template and a wide array of settings that allow complete customization to suit your site\'s design.</p>\n<p>The post <a rel=\"nofollow\" href=\"https://siteorigin.com/announcing-the-anything-carousel/\">Announcing the Anything Carousel</a> appeared first on <a rel=\"nofollow\" href=\"https://siteorigin.com\">SiteOrigin</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:14:\"Andrew Misplon\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:9581:\"<div id=\"pl-321887\"  class=\"panel-layout\" ><div id=\"pg-321887-0\"  class=\"panel-grid panel-no-style\" ><div id=\"pgc-321887-0-0\"  class=\"panel-grid-cell\" ><div id=\"panel-321887-0-0-0\" class=\"so-panel widget widget_sow-editor panel-first-child panel-last-child\" data-index=\"0\" ><div class=\"so-widget-sow-editor so-widget-sow-editor-base\">\n<div class=\"siteorigin-widget-tinymce textwidget\">\n	<p>We\'re delighted to announce that a new carousel widget is now available in the Widgets Bundle, the <strong>Anything Carousel</strong>! Display images, text, or any other content in a carousel. We\'ve released the Anything Carousel with a clean wire template and a wide array of settings that allow complete customization to suit your site\'s design.</p>\n</div>\n</div></div></div></div><div id=\"pg-321887-1\"  class=\"panel-grid panel-no-style\" ><div id=\"pgc-321887-1-0\"  class=\"panel-grid-cell\" ><div id=\"panel-321887-1-0-0\" class=\"so-panel widget widget_sow-anything-carousel panel-first-child panel-last-child\" data-index=\"1\" ><div class=\"so-widget-sow-anything-carousel so-widget-sow-anything-carousel-base-d844a3c079e8-321887\"><div class=\"sow-carousel-title has-title\">\n	<h3 class=\"widget-title\">Anything Carousel Demo</h3></div>\n\n<div class=\"sow-carousel-container \">\n				<a href=\"#\" class=\"sow-carousel-previous\" title=\"Previous\" aria-label=\"Previous Posts\" role=\"button\"></a>\n				<div class=\"sow-carousel-wrapper\"\n	     data-dir=\"ltr\"\n	     data-widget=\"anything\" data-item_count=\"6\" data-loop=\"\" data-carousel_settings=\"{&quot;loop&quot;:true,&quot;dots&quot;:true,&quot;animation&quot;:&quot;Ease&quot;,&quot;animation_speed&quot;:800,&quot;autoplay&quot;:false,&quot;pauseOnHover&quot;:false,&quot;autoplaySpeed&quot;:8000,&quot;item_overflow&quot;:false}\" data-responsive=\"{&quot;desktop_slides_to_scroll&quot;:3,&quot;tablet_landscape_breakpoint&quot;:1366,&quot;tablet_landscape_slides_to_scroll&quot;:3,&quot;tablet_portrait_breakpoint&quot;:1025,&quot;tablet_portrait_slides_to_scroll&quot;:2,&quot;mobile_breakpoint&quot;:480,&quot;mobile_slides_to_scroll&quot;:1,&quot;desktop_slides_to_show&quot;:3,&quot;tablet_landscape_slides_to_show&quot;:3,&quot;tablet_portrait_slides_to_show&quot;:2,&quot;mobile_slides_to_show&quot;:1}\" 	>\n		<div\n			class=\"sow-carousel-items\"\n					>\n				<div class=\"sow-carousel-item\" tabindex=\"-1\">\n		\n		<div class=\"sow-carousel-content\">\n			<p><img class=\"alignnone size-full wp-image-321891\" src=\"https://siteorigin.com/wp-content/uploads/2021/07/dave-herring-KMMR__2LEQY-unsplash-small.jpg\" alt=\"\" width=\"640\" height=\"427\" /></p>\n<p>Yosemite National Park is in California’s Sierra Nevada mountains. It’s famed for its giant, ancient sequoia trees, and for Tunnel View, the iconic vista of towering Bridalveil Fall, and the granite cliffs of El Capitan and Half Dome. In Yosemite Village are shops, restaurants, lodging, and the Yosemite Museum</p>\n<p><a style=\"color: #f14e4e;\" href=\"https://www.nps.gov/yose/index.htm\">Find out more</a>.</p>\n		</div>\n	</div>\n		<div class=\"sow-carousel-item\" tabindex=\"-1\">\n		\n		<div class=\"sow-carousel-content\">\n			<p><img class=\"alignnone size-full wp-image-321902\" src=\"https://siteorigin.com/wp-content/uploads/2021/07/owen-rupp-E0KNh67l5pE-unsplash.jpg\" alt=\"\" width=\"640\" height=\"427\" /></p>\n<p>Joshua Tree National Park is a vast protected area in southern California. It\'s characterized by rugged rock formations and stark desert landscapes. Named for the region’s twisted, bristled Joshua trees, the park straddles the cactus-dotted Colorado Desert and the Mojave Desert, which is higher and cooler.</p>\n<p><a style=\"color: #f14e4e;\" href=\"https://www.nps.gov/jotr/index.htm\">Find out more</a>.</p>\n		</div>\n	</div>\n		<div class=\"sow-carousel-item\" tabindex=\"-1\">\n		\n		<div class=\"sow-carousel-content\">\n			<p><img class=\"alignnone size-full wp-image-321903\" src=\"https://siteorigin.com/wp-content/uploads/2021/07/adam-skalecki-8i-LoPR-Jmc-unsplash.jpg\" alt=\"\" width=\"640\" height=\"427\" /></p>\n<p>Canyonlands National Park in southeastern Utah is known for its dramatic desert landscape carved by the Colorado River. Island in the Sky is a huge, flat-topped mesa with panoramic overlooks. Other notable areas include the Needles, the Maze, and the Native American rock paintings in Horseshoe Canyon.</p>\n<p><a style=\"color: #f14e4e;\" href=\"https://www.nps.gov/thingstodo/cany-mesa-arch.htm\">Find out more</a>.</p>\n		</div>\n	</div>\n		<div class=\"sow-carousel-item\" tabindex=\"-1\">\n		\n		<div class=\"sow-carousel-content\">\n			<p><img class=\"alignnone size-full wp-image-321905\" src=\"https://siteorigin.com/wp-content/uploads/2021/07/christoph-von-gellhorn-kjA82leKmJc-unsplash.jpg\" alt=\"\" width=\"640\" height=\"427\" /></p>\n<p>Saguaro National Park is in southern Arizona. Its 2 sections are on either side of the city of Tucson. The park is named for the large saguaro cactus, native to its desert environment. In the western Tucson Mountain District, Signal Hill Trail leads to petroglyphs of the ancient Hohokam people.</p>\n<p><a style=\"color: #f14e4e;\" href=\"https://www.nps.gov/sagu/index.htm\">Find out more</a>.</p>\n		</div>\n	</div>\n		<div class=\"sow-carousel-item\" tabindex=\"-1\">\n		\n		<div class=\"sow-carousel-content\">\n			<p><img class=\"alignnone size-full wp-image-321915\" src=\"https://siteorigin.com/wp-content/uploads/2021/07/intricate-explorer-2MIPToQmVY4-unsplash.jpg\" alt=\"\" width=\"640\" height=\"427\" /></p>\n<p>Theodore Roosevelt National Park lies in western North Dakota, where the Great Plains meet the rugged Badlands. A habitat for bison, elk and prairie dogs, the sprawling park has 3 sections linked by the Little Missouri River. The park is known for the Painted Canyon and the Maltese Cross Cabin.</p>\n<p><a style=\"color: #f14e4e;\" href=\"https://www.nps.gov/thro/index.htm\">Find out more</a>.</p>\n		</div>\n	</div>\n		<div class=\"sow-carousel-item\" tabindex=\"-1\">\n		\n		<div class=\"sow-carousel-content\">\n			<p><img class=\"alignnone size-full wp-image-321925\" src=\"https://siteorigin.com/wp-content/uploads/2021/07/john-peters-cGu4uuIWzJQ-unsplash.jpg\" alt=\"\" width=\"640\" height=\"427\" /></p>\n<p>Mount Rainier, also known as Tahoma or Tacoma, is a large active stratovolcano in the Cascade Range of the Pacific Northwest, located in Mount Rainier National Park about 59 miles (95 km) south-southeast of Seattle. With a summit elevation of 14,411 ft, it is the highest mountain in Washington state.</p>\n<p><a style=\"color: #f14e4e;\" href=\"https://www.nps.gov/mora/index.htm\">Find out more</a>.</p>\n		</div>\n	</div>\n			</div>\n	</div>\n\n				<a href=\"#\" class=\"sow-carousel-next\" title=\"Next\" aria-label=\"Next Posts\" role=\"button\"></a>\n			</div>\n</div></div></div></div><div id=\"pg-321887-2\"  class=\"panel-grid panel-no-style\" ><div id=\"pgc-321887-2-0\"  class=\"panel-grid-cell\" ><div id=\"panel-321887-2-0-0\" class=\"so-panel widget widget_sow-editor panel-first-child panel-last-child\" data-index=\"2\" ><div class=\"so-widget-sow-editor so-widget-sow-editor-base\">\n<div class=\"siteorigin-widget-tinymce textwidget\">\n	<h3>SiteOrigin Premium Carousel Addon</h3>\n<p>SiteOrigin Premium now includes the <a href=\"https://siteorigin.com/premium-documentation/plugin-addons/carousel/\">Carousel addon</a>. The Carousel addon provides a Layout Builder within each Anything Carousel item. The Layout Builder field is a mini-instance of Page Builder, allowing you to add rows, columns, and widgets.</p>\n<p>Shortly, the Carousel addon will be expanded to include additional settings, features, and templates for the Post and Anything Carousels.</p>\n<div id=\"attachment_321984\" style=\"width: 709px\" class=\"wp-caption alignleft\"><img aria-describedby=\"caption-attachment-321984\" loading=\"lazy\" class=\"wp-image-321984 size-large\" src=\"https://siteorigin.com/wp-content/uploads/2021/07/anything-carousel-layout-builder-699x414.png\" alt=\"\" width=\"699\" height=\"414\" srcset=\"https://siteorigin.com/wp-content/uploads/2021/07/anything-carousel-layout-builder-699x414.png 699w, https://siteorigin.com/wp-content/uploads/2021/07/anything-carousel-layout-builder-300x178.png 300w, https://siteorigin.com/wp-content/uploads/2021/07/anything-carousel-layout-builder-768x455.png 768w, https://siteorigin.com/wp-content/uploads/2021/07/anything-carousel-layout-builder-1050x622.png 1050w, https://siteorigin.com/wp-content/uploads/2021/07/anything-carousel-layout-builder-313x185.png 313w, https://siteorigin.com/wp-content/uploads/2021/07/anything-carousel-layout-builder.png 1212w\" sizes=\"(max-width: 699px) 100vw, 699px\" /><p id=\"caption-attachment-321984\" class=\"wp-caption-text\">Choose between a Text field or a Layout Builder in each Anything Carousel item using the Carousel addon.</p></div>\n</div>\n</div></div></div></div><div id=\"pg-321887-3\"  class=\"panel-grid panel-no-style\" ><div id=\"pgc-321887-3-0\"  class=\"panel-grid-cell\" ><div id=\"panel-321887-3-0-0\" class=\"so-panel widget widget_sow-editor panel-first-child panel-last-child\" data-index=\"3\" ><div class=\"so-widget-sow-editor so-widget-sow-editor-base\">\n<div class=\"siteorigin-widget-tinymce textwidget\">\n	<h3>Documentation Links</h3>\n<ul>\n<li><a href=\"https://siteorigin.com/widgets-bundle/anything-carousel-widget/\">Anything Carousel Widget documentation</a>.</li>\n<li><a href=\"https://siteorigin.com/premium-documentation/plugin-addons/carousel/\">SiteOrigin Premium Carousel Addon</a>.</li>\n</ul>\n</div>\n</div></div></div></div></div><p>The post <a rel=\"nofollow\" href=\"https://siteorigin.com/announcing-the-anything-carousel/\">Announcing the Anything Carousel</a> appeared first on <a rel=\"nofollow\" href=\"https://siteorigin.com\">SiteOrigin</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:61:\"https://siteorigin.com/announcing-the-anything-carousel/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"0\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:8;a:6:{s:4:\"data\";s:76:\"\n		\n		\n					\n		\n		\n		\n				\n		\n		\n\n					\n										\n					\n					\n			\n		\n		\n			\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:5:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:39:\"Page Builder Accessibility Enhancements\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:63:\"https://siteorigin.com/page-builder-accessibility-enhancements/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:72:\"https://siteorigin.com/page-builder-accessibility-enhancements/#comments\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Sat, 12 Jun 2021 09:07:16 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:2:{i:0;a:5:{s:4:\"data\";s:13:\"Announcements\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:1;a:5:{s:4:\"data\";s:7:\"Plugins\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:32:\"https://siteorigin.com/?p=315393\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:550:\"<p>We\'re excited to announce Page Builder version <code>2.12.0</code> and Widgets Bundle version <code>1.18.0</code> introduced wide-ranging accessibility enhancements. Users can now tab through all Page Builder and Widgets Bundle views, form fields, and settings, making changes as required without using a mouse.</p>\n<p>The post <a rel=\"nofollow\" href=\"https://siteorigin.com/page-builder-accessibility-enhancements/\">Page Builder Accessibility Enhancements</a> appeared first on <a rel=\"nofollow\" href=\"https://siteorigin.com\">SiteOrigin</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:14:\"Andrew Misplon\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:1531:\"<p>We&#8217;re excited to announce Page Builder version <code>2.12.0</code> and Widgets Bundle version <code>1.18.0</code> introduced wide-ranging accessibility enhancements. Users can now tab through all Page Builder and Widgets Bundle views, form fields and settings, making changes as required without using a mouse. Keyboard navigation is now available in the following areas:</p>\n<ul>\n<li>Page Builder rows, and columns.</li>\n<li>Page Builder Layouts view.</li>\n<li>Page Builder History view.</li>\n<li>Page Builder Live Editor.</li>\n<li>Page Builder row and widget form navigation.</li>\n<li>Widgets Bundle form field navigation.</li>\n</ul>\n<p>If you&#8217;re a semi-technical user and would like to view the work involved in these enhancements, please, find the pull request links below:</p>\n<ul>\n<li>Page Builder: <a href=\"https://github.com/siteorigin/siteorigin-panels/pull/772\">https://github.com/siteorigin/siteorigin-panels/pull/772</a></li>\n<li>Widgets Bundle: <a href=\"https://github.com/siteorigin/so-widgets-bundle/pull/1206\">https://github.com/siteorigin/so-widgets-bundle/pull/1206</a></li>\n</ul>\n<p>If you or your organization make use of Page Builder or Widgets Bundle accessibility features and have any questions or requests, please, let us know. </p>\n<p>Thanks for reading.</p>\n<p>The post <a rel=\"nofollow\" href=\"https://siteorigin.com/page-builder-accessibility-enhancements/\">Page Builder Accessibility Enhancements</a> appeared first on <a rel=\"nofollow\" href=\"https://siteorigin.com\">SiteOrigin</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:68:\"https://siteorigin.com/page-builder-accessibility-enhancements/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"6\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:9;a:6:{s:4:\"data\";s:76:\"\n		\n		\n					\n		\n		\n		\n				\n		\n		\n\n					\n										\n					\n					\n			\n		\n		\n			\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:5:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:67:\"Widgets Bundle: WP Super Cache &amp; Swift Performance Enhancements\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:84:\"https://siteorigin.com/widgets-bundle-wp-super-cache-swift-performance-enhancements/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:93:\"https://siteorigin.com/widgets-bundle-wp-super-cache-swift-performance-enhancements/#comments\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 03 Jun 2021 18:25:00 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:2:{i:0;a:5:{s:4:\"data\";s:13:\"Announcements\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:1;a:5:{s:4:\"data\";s:7:\"Plugins\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:32:\"https://siteorigin.com/?p=313748\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:734:\"<p>The SiteOrigin Widgets Bundle version <code>1.20.0</code> introduces compatibility for <a href=\"https://wordpress.org/plugins/wp-super-cache/\" rel=\"noopener\" target=\"_blank\">WP Super Cache</a> and <a href=\"https://wordpress.org/plugins/swift-performance-lite/\" rel=\"noopener\" target=\"_blank\">Swift Performance</a> plugins. The new compatibility ensures that WP Super Cache and Swift Performance won\'t reference outdated Widgets Bundle CSS files.</p>\n<p>The post <a rel=\"nofollow\" href=\"https://siteorigin.com/widgets-bundle-wp-super-cache-swift-performance-enhancements/\">Widgets Bundle: WP Super Cache &#038; Swift Performance Enhancements</a> appeared first on <a rel=\"nofollow\" href=\"https://siteorigin.com\">SiteOrigin</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:14:\"Andrew Misplon\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:1712:\"<p>The SiteOrigin Widgets Bundle version <code>1.20.0</code> released on the 1st of June introduces compatibility for <a href=\"https://wordpress.org/plugins/wp-super-cache/\" rel=\"noopener\" target=\"_blank\">WP Super Cache</a> and <a href=\"https://wordpress.org/plugins/swift-performance-lite/\" rel=\"noopener\" target=\"_blank\">Swift Performance</a> plugins. The new compatibility ensures that WP Super Cache and Swift Performance won&#8217;t reference outdated Widgets Bundle CSS files after a page containing SiteOrigin Widgets is saved. The Widgets Bundle along with all SiteOrigin plugins is actively developed on <a href=\"https://github.com/siteorigin/so-widgets-bundle\" rel=\"noopener\" target=\"_blank\">GitHub</a>. If you&#8217;re a technical user and would like to take a look at the commits that went into this improved caching plugin support, you can find the pull request <a href=\"https://github.com/siteorigin/so-widgets-bundle/pull/1258\" rel=\"noopener\" target=\"_blank\">here</a>.</p>\n<p>As part of our ongoing efforts to offer the best possible plugin compatibility, the Widgets Bundle introduced Autoptimize plugin support in 2019, read more about that in the announcement <a href=\"https://siteorigin.com/boost-siteorigin-plugin-performance-autoptimize/\">Boost SiteOrigin Plugin Performance with Autoptimize</a>.</p>\n<p>Thanks for reading, if you have any questions or requests, please, let us know in the comments below.</p>\n<p>The post <a rel=\"nofollow\" href=\"https://siteorigin.com/widgets-bundle-wp-super-cache-swift-performance-enhancements/\">Widgets Bundle: WP Super Cache &#038; Swift Performance Enhancements</a> appeared first on <a rel=\"nofollow\" href=\"https://siteorigin.com\">SiteOrigin</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:89:\"https://siteorigin.com/widgets-bundle-wp-super-cache-swift-performance-enhancements/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"3\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}}}s:27:\"http://www.w3.org/2005/Atom\";a:1:{s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:0:\"\";s:7:\"attribs\";a:1:{s:0:\"\";a:3:{s:4:\"href\";s:28:\"https://siteorigin.com/feed/\";s:3:\"rel\";s:4:\"self\";s:4:\"type\";s:19:\"application/rss+xml\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:44:\"http://purl.org/rss/1.0/modules/syndication/\";a:2:{s:12:\"updatePeriod\";a:1:{i:0;a:5:{s:4:\"data\";s:9:\"\n	hourly	\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:15:\"updateFrequency\";a:1:{i:0;a:5:{s:4:\"data\";s:4:\"\n	1	\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}}}}}}}}s:4:\"type\";i:128;s:7:\"headers\";O:42:\"Requests_Utility_CaseInsensitiveDictionary\":1:{s:7:\"\0*\0data\";a:17:{s:4:\"date\";s:29:\"Tue, 15 Feb 2022 10:25:11 GMT\";s:12:\"content-type\";s:34:\"application/rss+xml; charset=UTF-8\";s:12:\"x-powered-by\";s:10:\"PHP/7.0.31\";s:13:\"cache-control\";s:14:\"max-age=432000\";s:7:\"expires\";s:10:\"1644925976\";s:4:\"link\";s:59:\"<https://siteorigin.com/wp-json/>; rel=\"https://api.w.org/\"\";s:15:\"x-frame-options\";s:10:\"SAMEORIGIN\";s:13:\"last-modified\";s:29:\"Mon, 14 Feb 2022 20:01:41 GMT\";s:4:\"etag\";s:41:\"W/\"987f9653fafd306d03385e782dc3a570-gzip\"\";s:4:\"vary\";s:15:\"Accept-Encoding\";s:15:\"cf-cache-status\";s:3:\"HIT\";s:3:\"age\";s:4:\"