(20120, 2084, 'Theme', 'O:8:\"stdClass\":6:{s:4:\"Name\";s:22:\"Material Design Google\";s:8:\"ThemeURI\";N;s:11:\"Description\";s:511:\"Le thème officiel Material Design for WordPress &#8211; de l’équipe derrière le système de conception open-source de Google. Appliquez les principes du Material Design et du Material Theming à votre site, et personnalisez son style. Associez-le à l’extension officielle Material Design for WordPress pour personnaliser la navigation, les couleurs, la typographie et les formes de votre site, utilisez les composants Material et choisissez parmi plus de 1 000 polices Google et icônes Material Design.\";s:6:\"Author\";s:50:\"<a href=\"https://material.io/\">Material Design</a>\";s:7:\"Version\";s:5:\"0.5.1\";s:22:\"get_template_directory\";s:68:\"/home3/vieinves/public_html/wp-content/themes/material-design-google\";}'),
