(20128, 2085, 'Theme', 'O:8:\"stdClass\":6:{s:4:\"Name\";s:18:\"Construction Field\";s:8:\"ThemeURI\";N;s:11:\"Description\";s:1033:\"Construction Field is a WordPress theme special design for Construction Agency, Relate State Agency, Architecture house and overall construction and real estate sites.  For a construction company, it&#8217;s very important to showcase services in a very pleasant and distinct way to let their current clients be updated and attract more valuable customers. This WordPress theme serves that purpose. Construction Field included important features for presenting online presence of any company beautifully.  Its a fully responsive, multi-purpose theme and SEO friendly theme. It has a highly customized option and advanced widgets which lets the user design the whole look of the site without touching code. Having noted features such as About Section, Service Section, Gallery Section, Blog/News Section, Social Media Integration, Theme Options, Testimonial, FAQ/Accordion, Layout/Design Controls and many others makes it more advanced. Demo: http://demo.acmethemes.com/construction-field Support: https://www.acmethemes.com/supports/\";s:6:\"Author\";s:52:\"<a href=\"https://www.acmethemes.com/\">acmethemes</a>\";s:7:\"Version\";s:5:\"3.0.4\";s:22:\"get_template_directory\";s:64:\"/home3/vieinves/public_html/wp-content/themes/construction-field\";}'),
